('01928852-67d2-7792-8050-202efb8041dc', '14th Dalai Lama', '14th-dalai-lama', NULL, 'https://en.wikipedia.org/wiki/14th_Dalai_Lama', 'The 14th Dalai Lama (né Lhamo Thondup), known as Gyalwa Rinpoche to the Tibetan people, is the current Dalai Lama, the highest spiritual leader and former head of state of Tibet. Born on 6 July 1935, or in the Tibetan calendar, in the Wood-Pig Year, 5th month, 5th day. He is considered a living Bodhisattva; specifically, an emanation of Avalokiteśvara in Sanskrit and Chenrezig in Tibetan.', 'Current foremost spiritual leader of Tibet', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:14.894754', '2024-10-13 23:59:14.894754'),
('01928852-67d6-77de-8db9-20873b3fce88', 'A. A. Milne', 'a-a-milne', NULL, 'https://en.wikipedia.org/wiki/A._A._Milne', 'Alan Alexander Milne (18 January 1882 – 31 January 1956) was an English author, best known for his books about the teddy bear Winnie-the-Pooh and for various poems. Milne was a noted writer, primarily as a playwright, before the huge success of Pooh overshadowed all his previous work.', 'British author', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:14.901216', '2024-10-13 23:59:14.901216'),
('01928852-67d9-78aa-b219-4e52d4e543d0', 'A. P. J. Abdul Kalam', 'a-p-j-abdul-kalam', NULL, 'https://en.wikipedia.org/wiki/A._P._J._Abdul_Kalam', 'Avul Pakir Jainulabdeen Abdul Kalam (15 October 1931 – 27 July 2015) was an aerospace scientist who served as the 11th President of India from 2002 to 2007.', 'Scientist and 11th President of India', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:14.904278', '2024-10-13 23:59:14.904278'),
('01928852-67dd-7a74-974a-ff18d1f489bd', 'A. Powell Davies', 'a-powell-davies', NULL, 'https://en.wikipedia.org/wiki/A._Powell_Davies', 'Arthur Powell Davies (June 5, 1902 – September 26, 1957) was the minister of All Souls Church, Unitarian in Washington, D.C. from 1944 until his death in 1957. A prolific author of theological books and sermon collections, he came to national prominence in the U.S. through his liberal activism advocating civil rights for African-Americans and women.', 'Civil rights activist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:14.908294', '2024-10-13 23:59:14.908294'),
('01928852-67e5-7f8e-b2d3-f3277d2af558', 'Abigail Adams', 'abigail-adams', NULL, 'https://en.wikipedia.org/wiki/Abigail_Adams', 'Abigail Adams (November 22, [O.S. November 11] 1744 – October 28, 1818) was the wife and closest advisor of John Adams, as well as the mother of John Quincy Adams. She is sometimes considered to have been a Founder of the United States, and is now designated as the first Second Lady and second First Lady of the United States, although these titles were not used at the time.', '2nd First Lady of the United States', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:14.912891', '2024-10-13 23:59:14.912891'),
('01928852-67f6-7de7-afc8-c88a404f2cf1', 'Abraham Lincoln', 'abraham-lincoln', NULL, 'https://en.wikipedia.org/wiki/Abraham_Lincoln', 'Abraham Lincoln (February 12, 1809 – April 15, 1865) was an American statesman and lawyer who served as the 16th president of the United States (1861–1865). Lincoln led the nation through its greatest moral, constitutional, and political crisis in the American Civil War.', '16th president of the United States', NULL, '{}', NULL, 'f', 'f', 't', 'f', 34, '2024-10-13 23:59:14.932867', '2024-10-13 23:59:14.932867'),
('01928852-67fb-7306-9028-3c1bf5ba2688', 'Abraham Maslow', 'abraham-maslow', NULL, 'https://en.wikipedia.org/wiki/Abraham_Maslow', 'Abraham Harold Maslow (April 1, 1908 – June 8, 1970) was an American psychologist who was best known for creating Maslow''s hierarchy of needs, a theory of psychological health predicated on fulfilling innate human needs in priority, culminating in self-actualization.', 'American psychologist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:14.938348', '2024-10-13 23:59:14.938348'),
('01928852-6806-77fe-98ce-8f8ffc60ba59', 'Adam Smith', 'adam-smith', NULL, 'https://en.wikipedia.org/wiki/Adam_Smith', 'Adam Smith (baptized 16 June 1723 – 17 July 1790) was a Scottish economist and philosopher who was a pioneer of political economy and key figure during the Scottish Enlightenment. Also known as "The Father of Economics" or "The Father of Capitalism", he wrote two classic works, The Theory of Moral Sentiments (1759) and An Inquiry into the Nature and Causes of the Wealth of Nations (1776). The latter, often abbreviated as The Wealth of Nations, is considered his magnum opus and the first modern work of economics.', 'Scottish economist and philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:14.945021', '2024-10-13 23:59:14.945021'),
('01928852-680c-7f4d-9c5d-104d3390e2bd', 'Aeschylus', 'aeschylus', NULL, 'https://en.wikipedia.org/wiki/Aeschylus', 'Aeschylus was an ancient Greek author of Greek tragedy, and is often described as the father of tragedy. Academics'' knowledge of the genre begins with his work, and understanding of earlier Greek tragedy is largely based on inferences made from reading his surviving plays.', 'Ancient Athenian playwright', NULL, '{}', NULL, 'f', 'f', 't', 'f', 3, '2024-10-13 23:59:14.953242', '2024-10-13 23:59:14.953242'),
('01928852-6814-7ec3-87d5-8118dce26611', 'Aesop', 'aesop', NULL, 'https://en.wikipedia.org/wiki/Aesop', 'Aesop (c. 620 – 564 BCE) was a Greek fabulist and storyteller credited with a number of fables now collectively known as Aesop''s Fables.', 'Ancient Greek storyteller', NULL, '{}', NULL, 'f', 'f', 't', 'f', 10, '2024-10-13 23:59:14.963301', '2024-10-13 23:59:14.963301'),
