('01928852-6823-7e99-8a24-0815fc6ffd71', 'Agatha Christie', 'agatha-christie', NULL, 'https://en.wikipedia.org/wiki/Agatha_Christie', 'Dame Agatha Mary Clarissa Christie, Lady Mallowan,  (15 September 1890 – 12 January 1976) was an English writer known for her 66 detective novels and 14 short story collections, particularly those revolving around fictional detectives Hercule Poirot and Miss Marple. She also wrote the world''s longest-running play The Mousetrap and six romances under the pen name Mary Westmacott.', 'English mystery writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:14.977855', '2024-10-13 23:59:14.977855'),
('01928852-6826-787a-87e8-c15756da9b23', 'Akhenaten', 'akhenaten', NULL, 'https://en.wikipedia.org/wiki/Akhenaten', 'Akhenaten, known before the fifth year of his reign as Amenhotep IV, was an ancient Egyptian pharaoh of the 18th Dynasty, who ruled for 17 years and died perhaps in 1336 BC or 1334 BC. ', '18th Dynasty pharaoh', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:14.981659', '2024-10-13 23:59:14.981659'),
