('01928852-6ef6-777a-9476-5f31d57a695d', 'Jack Benny', 'jack-benny', NULL, 'https://en.wikipedia.org/wiki/Jack_Benny', 'Benjamin Kubelsky (February 14, 1894 – December 26, 1974), known professionally as Jack Benny, was an American entertainer, who evolved from a modest success playing violin on the vaudeville circuit to one of the leading entertainers of the twentieth century with a highly popular comedic career in radio, television, and film. He was known for his comic timing and the ability to cause laughter with a pregnant pause or a single expression, such as his signature exasperated summation "Well! " His radio and television programs, popular from 1932 until his death in 1974, were a major influence on the sitcom genre. Benny portrayed himself as a miser who obliviously played his violin badly and claimed perpetually to be 39 years of age.', 'American comedic entertainer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:16.725703', '2024-10-13 23:59:16.725703'),
