('01928852-6f24-73e8-814e-0638030e3a78', 'Jared Diamond', 'jared-diamond', NULL, 'https://en.wikipedia.org/wiki/Jared_Diamond', 'Jared Mason Diamond (born September 10, 1937) is an American geographer, historian, anthropologist, and author best known for his popular science books The Third Chimpanzee (1991); Guns, Germs, and Steel (1997, awarded a Pulitzer Prize); Collapse (2005), The World Until Yesterday (2012), and Upheaval (2019). Originally trained in physiology, Diamond is known for drawing from a variety of fields, including anthropology, ecology, geography, and evolutionary biology.', 'American scientist and author', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:16.772098', '2024-10-13 23:59:16.772098'),
