('01928852-6f2f-76c9-9552-ab33fb03802f', 'Jean Cocteau', 'jean-cocteau', NULL, 'https://en.wikipedia.org/wiki/Jean_Cocteau', 'Jean Maurice Eugène Clément Cocteau (5 July 1889 – 11 October 1963) was a French poet, playwright, novelist, designer, filmmaker, visual artist and critic. Cocteau is best known for his novels Le Grand Écart (1923), Le Livre Blanc (1928), and Les Enfants Terribles (1929); the stage plays La Voix Humaine (1930), La Machine Infernale (1934), Les Parents terribles (1938), La Machine à écrire (1941), and L''Aigle à deux têtes (1946); and the films The Blood of a Poet (1930), Les Parents Terribles (1948), from his own eponymous piéce, Beauty and the Beast (1946), Orpheus (1949), and Testament of Orpheus (1960), which alongside Blood of a Poet and Orpheus constitute the so-called Orphic Trilogy.', 'French poet', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:16.782678', '2024-10-13 23:59:16.782678'),
