('01928852-6f3e-7104-adb9-1623d1d16d5b', 'Jeff Bezos', 'jeff-bezos', NULL, 'https://en.wikipedia.org/wiki/Jeff_Bezos', 'Jeffrey Preston Bezos (born January 12, 1964) is an American entrepreneur, media proprietor, investor, computer engineer, and commercial astronaut. He is the founder, executive chairman and former president and CEO of Amazon. With a net worth of around US$135.3 billion as of July 2022, Bezos is the second-wealthiest person in the world and was the wealthiest from 2017 to 2021 according to both Bloomberg''s Billionaires Index and Forbes.Born in Albuquerque and raised in Houston and Miami, Bezos graduated from Princeton University in 1986.', 'American engineer and entrepreneur', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:16.797028', '2024-10-13 23:59:16.797028'),
('01928852-6f40-7dc8-9e62-efe62872a44a', 'Jerome', 'jerome', NULL, 'https://en.wikipedia.org/wiki/Jerome', 'Jerome, also known as Jerome of Stridon was a Latin priest, confessor, theologian, and historian; he is commonly known as Saint Jerome. Jerome was born at Stridon, a village near Emona on the border of Dalmatia and Pannonia', 'Saint', NULL, '{}', NULL, 'f', 'f', 't', 'f', 3, '2024-10-13 23:59:16.799582', '2024-10-13 23:59:16.799582'),
('01928852-6f43-70fe-9815-700c521eb081', 'Jessamyn West', 'jessamyn-west', NULL, 'https://en.wikipedia.org/wiki/Jessamyn_West_(writer)', 'Mary Jessamyn West (July 18, 1902 – February 23, 1984) was an American author of short stories and novels, notably The Friendly Persuasion. A Quaker from Indiana, she graduated from Fullerton Union High School in 1919 and Whittier College in 1923. There she helped found the Palmer Society in 1921.', 'American author', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:16.802033', '2024-10-13 23:59:16.802033'),
('01928852-6f46-7622-bbf1-55dd2896b243', 'Jesse Owens', 'jesse-owens', NULL, 'https://en.wikipedia.org/wiki/Jesse_Owens', 'James Cleveland "Jesse" Owens (September 12, 1913 – March 31, 1980) was an American track and field athlete who won four gold medals at the 1936 Olympic Games.Owens specialized in the sprints and the long jump and was recognized in his lifetime as "perhaps the greatest and most famous athlete in track and field history". He set three world records and tied another, all in less than an hour, at the 1935 Big Ten track meet in Ann Arbor, Michigan—a feat that has never been equaled and has been called "the greatest 45 minutes ever in sport".He achieved international fame at the 1936 Summer Olympics in Berlin, Germany, by winning four gold medals: 100 meters, long jump, 200 meters, and 4 × 100-meter relay. He was the most successful athlete at the Games and, as a black American man, was credited with "single-handedly crushing Hitler''s myth of Aryan supremacy".The Jesse Owens Award is USA Track and Field''s highest accolade for the year''s best track and field athlete.', 'American track and field athlete', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:16.80505', '2024-10-13 23:59:16.80505'),
