('01928852-7137-7def-94e3-5d2267e4917b', 'Lee Trevino', 'lee-trevino', NULL, 'https://en.wikipedia.org/wiki/Lee_Trevino', 'Lee Buck Trevino (born December 1, 1939) is an American retired professional golfer who is regarded as one of the greatest players in golf history. He was inducted to the World Golf Hall of Fame in 1981. Trevino won six major championships and 29 PGA Tour events over the course of his career.', 'American professional golfer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:17.302337', '2024-10-13 23:59:17.302337'),
('01928852-713a-706e-aee6-827db5eff06d', 'Len Wein', 'len-wein', NULL, 'https://en.wikipedia.org/wiki/Len_Wein', 'Leonard Norman Wein (June 12, 1948 – September 10, 2017) was an American comic book writer and editor best known for co-creating DC Comics'' Swamp Thing and Marvel Comics'' Wolverine, and for helping revive the Marvel superhero team the X-Men (including the co-creation of Nightcrawler, Storm, and Colossus). Additionally, he was the editor for writer Alan Moore and illustrator Dave Gibbons'' influential DC miniseries Watchmen.', 'American comic book writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.305341', '2024-10-13 23:59:17.305341'),
