('01928852-7147-751d-b514-f1488f6f1550', 'Leonard Nimoy', 'leonard-nimoy', NULL, 'https://en.wikipedia.org/wiki/Leonard_Nimoy', 'Leonard Simon Nimoy (March 26, 1931 – February 27, 2015) was an American actor, film director, photographer, author, singer, and songwriter. He was known for playing Spock in the Star Trek franchise, a character he portrayed in television and film for almost fifty years, from a pilot episode shot in late 1964 to his final film performance in 2013.Nimoy began his career in his early twenties, teaching acting classes in Hollywood and making minor film and television appearances through the 1950s, as well as playing the title role in Kid Monk Baroni.', 'American actor', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.31873', '2024-10-13 23:59:17.31873'),
('01928852-714a-78f9-b601-986148cb4b27', 'Leonardo da Vinci', 'leonardo-da-vinci', NULL, 'https://en.wikipedia.org/wiki/Leonardo_da_Vinci', 'Leonardo di ser Piero da Vinci, known as Leonardo da Vinci, was an Italian polymath of the Renaissance whose areas of interest included invention, drawing, painting, sculpture, architecture, science, music, mathematics, engineering, literature, anatomy, geology, astronomy, botany, paleontology, and cartography.', 'Italian Renaissance polymath', NULL, '{}', NULL, 'f', 'f', 't', 'f', 11, '2024-10-13 23:59:17.321392', '2024-10-13 23:59:17.321392'),
('01928852-714c-7ccb-b9c7-dd90eb1e0468', 'Lewis Carroll', 'lewis-carroll', NULL, 'https://en.wikipedia.org/wiki/Lewis_Carroll', 'Charles Lutwidge Dodgson (27 January 1832 – 14 January 1898), better known by his pen name Lewis Carroll, was an English writer of world-famous children''s fiction, notably Alice''s Adventures in Wonderland and its sequel Through the Looking-Glass. He was noted for his facility at word play, logic, and fantasy.', 'English writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.323723', '2024-10-13 23:59:17.323723'),
