('01928852-7150-7516-9767-5e51cbc85a6f', 'Libby Larsen', 'libby-larsen', NULL, 'https://en.wikipedia.org/wiki/Libby_Larsen', 'Elizabeth Brown Larsen (born December 24, 1950) is a contemporary American classical composer. Along with composer Stephen Paulus, she is a co-founder of the Minnesota Composers Forum, now the American Composers Forum.A former holder of the Papamarkou Chair at John W. Kluge Center of the Library of Congress, Larsen has also held residencies with the Minnesota Orchestra, the Charlotte Symphony Orchestra and the Colorado Symphony Orchestra.', 'American classical composer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.32794', '2024-10-13 23:59:17.32794');
