('01928852-7262-79b5-8658-9635f4313d1d', 'Mao Zedong', 'mao-zedong', NULL, 'https://en.wikipedia.org/wiki/Mao_Zedong', 'Mao Zedong (December 26, 1893 – September 9, 1976), also known as Chairman Mao, was a Chinese communist revolutionary who became the founding father of the People''s Republic of China (PRC), which he ruled as the chairman of the Communist Party of China from its establishment in 1949 until his death in 1976. Ideologically a Marxist–Leninist, his theories, military strategies, and political policies are collectively known as Maoism.', 'Former Chairman of the People''s Republic of China', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.59901', '2024-10-13 23:59:17.59901'),
('01928852-7267-7a4c-a0fd-e3c32168ca08', 'Marcel Proust', 'marcel-proust', NULL, 'https://en.wikipedia.org/wiki/Marcel_Proust', 'Valentin Louis Georges Eugène Marcel Proust (10 July 1871 – 18 November 1922) was a French novelist, critic, and essayist best known for his monumental novel À la recherche du temps perdu (In Search of Lost Time; earlier rendered as Remembrance of Things Past), published in seven parts between 1913 and 1927.', 'French novelist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:17.605653', '2024-10-13 23:59:17.605653'),
('01928852-726b-780d-ad27-ca400d34e96f', 'Marcia Fudge', 'marcia-fudge', NULL, 'https://en.wikipedia.org/wiki/Marcia_Fudge', 'Marcia Louise Fudge (born October 29, 1952) is an American politician serving as the U.S. Representative from Ohio''s 11th congressional district since 2008. A member of the Democratic Party, she won a special election to succeed Stephanie Tubbs Jones, who died in office.', 'U.S. Representative from Ohio', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.60984', '2024-10-13 23:59:17.60984'),
('01928852-726f-73a3-874e-ff874af9432a', 'Marcus Aurelius', 'marcus-aurelius', NULL, 'https://en.wikipedia.org/wiki/Marcus_Aurelius', 'Marcus Aurelius (26 April 121 – 17 March 180) was a Roman emperor from 161 to 180 and a Stoic philosopher. He was the last of the rulers known as the Five Good Emperors, and the last emperor of the Pax Romana, an age of relative peace and stability for the Roman Empire.', 'Philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 14, '2024-10-13 23:59:17.614328', '2024-10-13 23:59:17.614328'),
('01928852-7273-7a43-84de-843d842de709', 'Margaret Chase Smith', 'margaret-chase-smith', NULL, 'https://en.wikipedia.org/wiki/Margaret_Chase_Smith', 'Margaret Madeline Chase Smith was a United States politician. A member of the Republican Party, she served as a U.S Representative and a U.S. Senator from Maine. She was the first woman to serve in both houses of the United States Congress, and the first woman to represent Maine in either.', 'Former member of the U.S. Senate', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.618084', '2024-10-13 23:59:17.618084'),
('01928852-7277-74d5-a896-37e619d6c0aa', 'Margaret Cousins', 'margaret-cousins', NULL, 'https://en.wikipedia.org/wiki/Margaret_Cousins', 'Margaret Elizabeth Cousin (7 October 1878 – 11 March 1954) was an Irish-Indian educationist, suffragist and Theosophist, who established All India Women''s Conference (AIWC) in 1927.', 'Irish poet', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.621866', '2024-10-13 23:59:17.621866'),
('01928852-727a-781e-9183-bb13bb33c89f', 'Margaret Fuller', 'margaret-fuller', NULL, 'https://en.wikipedia.org/wiki/Margaret_Fuller', 'Sarah Margaret Fuller Ossoli (May 23, 1810 – July 19, 1850), commonly known as Margaret Fuller, was an American journalist, editor, critic, and women''s rights advocate associated with the American transcendentalism movement.', 'American journalist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.625392', '2024-10-13 23:59:17.625392'),
