('01928852-7282-76cf-a654-ce639d3effd6', 'Margaret Mead', 'margaret-mead', NULL, 'https://en.wikipedia.org/wiki/Margaret_Mead', 'Margaret Mead (December 16, 1901 – November 15, 1978) was an American cultural anthropologist who featured frequently as an author and speaker in the mass media during the 1960s and 1970s.', 'American cultural anthropologist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:17.633118', '2024-10-13 23:59:17.633118'),
('01928852-7285-7150-9475-10555089ac48', 'Margaret Thatcher', 'margaret-thatcher', NULL, 'https://en.wikipedia.org/wiki/Margaret_Thatcher', 'Margaret Hilda Thatcher, Baroness Thatcher,  (13 October 1925 – 8 April 2013) also known as the Iron Lady, was a British stateswoman who served as Prime Minister of the United Kingdom from 1979 to 1990 and leader of the Conservative Party from 1975 to 1990. She was the longest-serving British prime minister of the 20th century and the first woman to hold that office.', 'Former Prime Minister of the United Kingdom', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:17.636215', '2024-10-13 23:59:17.636215'),
