('01928852-734e-7b1d-845f-1780d2ae9616', 'Orson Welles', 'orson-welles', NULL, 'https://en.wikipedia.org/wiki/Orson_Welles', 'George Orson Welles (May 6, 1915 – October 10, 1985) was an American actor, director, writer and producer who is remembered for his innovative work in radio, theatre and film. He is considered one of the greatest filmmakers of all time.While in his twenties Welles directed a number of high-profile stage productions for the Federal Theatre Project, including an adaptation of Macbeth with an entirely African American cast and the political musical The Cradle Will Rock.', 'American actor', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:17.837162', '2024-10-13 23:59:17.837162'),
