('01928852-7374-739f-a614-95fa8387c986', 'Pauline Kael', 'pauline-kael', NULL, 'https://en.wikipedia.org/wiki/Pauline_Kael', 'Pauline Kael (June 19, 1919 – September 3, 2001) was an American film critic who wrote for The New Yorker magazine from 1968 to 1991. Known for her "witty, biting, highly opinionated and sharply focused" reviews, Kael''s opinions often ran contrary to those of her contemporaries. One of the most influential American film critics of her era, she left a lasting impression on the art form.', 'American film critic', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:17.875978', '2024-10-13 23:59:17.875978'),
('01928852-745f-7423-a69b-397ae6c9e587', 'Paulo Coelho', 'paulo-coelho', NULL, 'https://en.wikipedia.org/wiki/Paulo_Coelho', 'Paulo Coelho de Souza (born 24 August 1947) is a Brazilian lyricist and novelist, best known for his novel The Alchemist. In 2014, he uploaded his personal papers online to create a virtual Paulo Coelho Foundation.', 'Brazilian novelist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.109524', '2024-10-13 23:59:18.109524'),
