('01928852-7471-7b04-a39b-eee028a3a690', 'Pete Rose', 'pete-rose', NULL, 'https://en.wikipedia.org/wiki/Pete_Rose', 'Peter Edward Rose Sr. (born April 14, 1941), also known by his nickname "Charlie Hustle", is an American former professional baseball player and manager. Rose played in Major League Baseball (MLB) from 1963 to 1986, most prominently as a member of the Cincinnati Reds team known as The Big Red Machine for their dominance of the National League in the 1970s.', 'American baseball player', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:18.128648', '2024-10-13 23:59:18.128648'),
('01928852-7475-7236-b7e6-e109cbcf9059', 'Peter Abelard', 'peter-abelard', NULL, 'https://en.wikipedia.org/wiki/Peter_Abelard', 'Peter Abelard (1079 – 21 April 1142) was a medieval French scholastic philosopher, theologian, and preeminent logician. His love for, and affair with, Héloïse d''Argenteuil has become legendary.', 'French scholastic philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.132365', '2024-10-13 23:59:18.132365'),
