('01928852-7480-756c-8ea8-983155ee75d6', 'Peter Elbow', 'peter-elbow', NULL, 'https://en.wikipedia.org/wiki/Peter_Elbow', 'Peter Elbow is a Professor of English Emeritus at the University of Massachusetts Amherst, where he also directed the Writing Program from 1996 until 2000. He writes about theory, practice, and pedagogy, and has authored several books and papers.', 'Professor', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.141241', '2024-10-13 23:59:18.141241'),
('01928852-7484-715d-90ec-267a9fd04c98', 'Phil Jackson', 'phil-jackson', NULL, 'https://en.wikipedia.org/wiki/Phil_Jackson', 'Philip Douglas Jackson (born September 17, 1945) is an American former professional basketball player, coach, and executive in the National Basketball Association (NBA). A power forward, Jackson played 12 seasons in the NBA, winning NBA championships with the New York Knicks in 1970 and 1973.', 'American basketball player', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.146976', '2024-10-13 23:59:18.146976'),
('01928852-7488-7fcf-a662-b1abf598dd17', 'Philip Sidney', 'philip-sidney', NULL, 'https://en.wikipedia.org/wiki/Philip_Sidney', 'Sir Philip Sidney (30 November 1554 – 17 October 1586) was an English poet, courtier, scholar and soldier who is remembered as one of the most prominent figures of the Elizabethan age. His works include Astrophel and Stella, The Defence of Poesy (also known as The Defence of Poetry or An Apology for Poetry) and The Countess of Pembroke''s Arcadia.', 'English poet', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.150673', '2024-10-13 23:59:18.150673'),
('01928852-748c-7927-b5c6-6569fe035193', 'Phyllis Grissim-Theroux', 'phyllis-grissim-theroux', NULL, 'https://books.google.com/books/about/The_Book_Of_Eulogies.html?id=xtbIrQEACAAJ&source=kp_author_description', 'Phyllis Theroux is the author of "California and Other States of Grace" and "Nightlights: Bedtime Stories for Parents in the Dark." The founder of the Nightwriters seminar, she is a magazine columnist, children''s book writer, and was a regular essayist on "The NewsHour with Jim Lehrer." She lives in Ashland, Virginia.', 'Author', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.154972', '2024-10-13 23:59:18.154972'),
('01928852-748f-76de-9467-c60dba989829', 'Pierre Teilhard de Chardin', 'pierre-teilhard-de-chardin', NULL, 'https://en.wikipedia.org/wiki/Pierre_Teilhard_de_Chardin', 'Pierre Teilhard de Chardin  (1 May 1881 – 10 April 1955) was a French idealist philosopher and Jesuit priest who trained as a paleontologist and geologist and took part in the discovery of the Peking Man. He conceived the vitalist idea of the Omega Point (a maximum level of complexity and consciousness towards which he believed the universe was evolving), and he developed Vladimir Vernadsky''s concept of noosphere.', 'French philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.15835', '2024-10-13 23:59:18.15835'),
('01928852-7493-7b3f-832a-8e363ed39d21', 'Pierre-Auguste Renoir', 'pierre-auguste-renoir', NULL, 'https://en.wikipedia.org/wiki/Pierre-Auguste_Renoir', 'Pierre-Auguste Renoir (25 February 1841 – 3 December 1919), was a French artist who was a leading painter in the development of the Impressionist style. As a celebrator of beauty and especially feminine sensuality, it has been said that "Renoir is the final representative of a tradition which runs directly from Rubens to Watteau."', 'French painter and sculptor', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.162102', '2024-10-13 23:59:18.162102'),
('01928852-7495-7bbb-8c71-fb1111ec3bdf', 'Plato', 'plato', NULL, 'https://en.wikipedia.org/wiki/Plato', 'Plato (428 – 348 BC) was an Athenian philosopher during the Classical period in Ancient Greece, founder of the Platonist school of thought, and the Academy, the first institution of higher learning in the Western world.', 'Greek philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 11, '2024-10-13 23:59:18.164871', '2024-10-13 23:59:18.164871'),
