('01928852-749c-7668-abe3-54be9e73ee89', 'Plotinus', 'plotinus', NULL, 'https://en.wikipedia.org/wiki/Plotinus', 'Plotinus (204 – 270) was a major Hellenistic philosopher who lived in Roman Egypt. In his philosophy, described in the Enneads, there are three principles: the One, the Intellect, and the Soul.', 'Neoplatonist philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.171498', '2024-10-13 23:59:18.171498'),
('01928852-74a0-7141-8ad0-533813297501', 'Plutarch', 'plutarch', NULL, 'https://en.wikipedia.org/wiki/Plutarch', 'Plutarch was a Greek Middle Platonist philosopher, historian, biographer, essayist, and priest at the Temple of Apollo. He is known primarily for his Parallel Lives, a series of biographies of illustrious Greeks and Romans, and Moralia, a collection of essays and speeches.', 'Greek philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 5, '2024-10-13 23:59:18.174655', '2024-10-13 23:59:18.174655'),
('01928852-74a4-73a6-87e0-255399b0aa03', 'Pope John XXIII', 'pope-john-xxiii', NULL, 'https://en.wikipedia.org/wiki/Pope_John_XXIII', 'Pope John XXIII (25 November 1881 – 3 June 1963) was head of the Catholic Church and sovereign of the Vatican City State from 28 October 1958 to his death in 1963; he was canonized on 27 April 2014. Angelo Giuseppe Roncalli was one of thirteen children born to a family of sharecroppers who lived in a village in Lombardy.', '261st Pope of the Catholic Church', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.179374', '2024-10-13 23:59:18.179374'),
('01928852-74a7-7d6f-b09f-f1da08beb6c3', 'Pope Paul VI', 'pope-paul-vi', NULL, 'https://en.wikipedia.org/wiki/Pope_Paul_VI', 'Pope Paul VI (born Giovanni Battista Enrico Antonio Maria Montini (Italian pronunciation: [dʒoˈvanːi baˈtːista enˈriːko anˈtɔːnjo maˈriːa monˈtiːni]); 26 September 1897 – 6 August 1978) was head of the Catholic Church and sovereign of the Vatican City State from 21 June 1963 to his death in 1978.  Succeeding John XXIII, he continued the Second Vatican Council which he closed in 1965, implementing its numerous reforms, and fostered improved ecumenical relations with Eastern Orthodox and Protestant churches, which resulted in many historic meetings and agreements.', 'Fomer Pope', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.182547', '2024-10-13 23:59:18.182547'),
('01928852-74aa-7011-94f0-b562090aa8be', 'Princess Diana', 'princess-diana', NULL, 'https://en.wikipedia.org/wiki/Diana,_Princess_of_Wales', 'Diana, Princess of Wales was a member of the British royal family. She was the first wife of Charles, Prince of Wales, and the mother of Prince William and Prince Harry. ', 'Princess of Wales', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.185568', '2024-10-13 23:59:18.185568'),
('01928852-74ad-78ef-9dae-9c93c6cc52f7', 'Publilius Syrus', 'publilius-syrus', NULL, 'https://en.wikipedia.org/wiki/Publilius_Syrus', 'Publilius Syrus, was a Latin writer, best known for his sententiae. He was a Syrian who was brought as a slave to Roman Italy. By his wit and talent, Syrus won the favour of his master, who granted him manumission and educated him. He became a member of the Publilia gens.', '1st century BC Syrian-born Latin writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 5, '2024-10-13 23:59:18.188487', '2024-10-13 23:59:18.188487'),
('01928852-74b0-7deb-a1aa-e7364b0fbd95', 'Rabbi Hillel', 'rabbi-hillel', NULL, 'https://en.wikipedia.org/wiki/Hillel_the_Elder', 'Hillel was a Jewish religious leader, sage and scholar associated with the development of the Mishnah and the Talmud and the founder of the House of Hillel school of tannaim. He is popularly known as the author of two sayings: "If I am not for myself, who will be for me? And being for myself, what am ''I''?"', 'Jewish religious leader of the 1st century', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.191375', '2024-10-13 23:59:18.191375'),
('01928852-74b3-733a-96bf-f69311a30ef7', 'Rabindranath Tagore', 'rabindranath-tagore', NULL, 'https://en.wikipedia.org/wiki/Rabindranath_Tagore', 'Rabindranath Tagore FRAS, also known by his pen name Bhanu Singha Thakur, and also known by his sobriquets Gurudev, Kabiguru, and Biswakabi, was a polymath, poet, musician, and artist from the Indian subcontinent.', 'Bengali poet and philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.19438', '2024-10-13 23:59:18.19438'),
('01928852-74b7-7dbe-a68b-84ca859e54ba', 'Rachel Carson', 'rachel-carson', NULL, 'https://en.wikipedia.org/wiki/Rachel_Carson', 'Rachel Louise Carson (May 27, 1907 – April 14, 1964) was an American marine biologist, author, and conservationist whose book Silent Spring and other writings are credited with advancing the global environmental movement.', 'American marine biologist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.198771', '2024-10-13 23:59:18.198771'),
('01928852-74ba-7a27-99b0-b5d9968fc40f', 'Rainer Maria Rilke', 'rainer-maria-rilke', NULL, 'https://en.wikipedia.org/wiki/Rainer_Maria_Rilke', 'René Karl Wilhelm Johann Josef Maria Rilke (4 December 1875 – 29 December 1926), better known as Rainer Maria Rilke, was a Bohemian-Austrian poet and novelist. He is "widely recognized as one of the most lyrically intense German-language poets".', 'Austrian poet and writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.201834', '2024-10-13 23:59:18.201834'),
