('01928852-74c3-7e12-8d93-0c5a55ee071c', 'Ralph Waldo Emerson', 'ralph-waldo-emerson', NULL, 'https://en.wikipedia.org/wiki/Ralph_Waldo_Emerson', 'Ralph Waldo Emerson (May 25, 1803 – April 27, 1882) was an American essayist, lecturer, philosopher, and poet who led the transcendentalist movement of the mid-19th century. He was seen as a champion of individualism and a prescient critic of the countervailing pressures of society, and he disseminated his thoughts through dozens of published essays and more than 1,500 public lectures across the United States.', 'American philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 54, '2024-10-13 23:59:18.210826', '2024-10-13 23:59:18.210826'),
('01928852-74c7-7ed7-8316-be59e42e7449', 'Ramakrishna', 'ramakrishna', NULL, 'https://en.wikipedia.org/wiki/Ramakrishna', 'Sri Ramakrishna Paramahansa (18 February 1836 – 16 August 1886) was an Indian Hindu mystic, saint and considered as an avatar by many in 19th century Bengal. Sri Ramakrishna experienced spiritual ecstasies from a young age, and was influenced by several religious traditions, including devotion toward the Goddess Kali, Tantra (shakta), Vaishnava (bhakti), and Advaita Vedanta.', 'Indian mystic', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.214328', '2024-10-13 23:59:18.214328'),
