('01928852-74d1-7eb5-945e-ac5757ce356a', 'Reggie Jackson (basketball, born 1990)', 'reggie-jackson-basketball-born-1990', NULL, 'https://en.wikipedia.org/wiki/Reggie_Jackson_(basketball,_born_1990)', 'Reginald Jackson (born April 16, 1990) is an American professional basketball player for the Los Angeles Clippers of the National Basketball Association (NBA). He played three seasons for the Boston College Eagles before declaring for the 2011 NBA draft where he was drafted 24th overall by the Oklahoma City Thunder.', 'American basketball player', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.224354', '2024-10-13 23:59:18.224354'),
('01928852-74d4-7011-8292-52fdc5ae9798', 'Reinhold Niebuhr', 'reinhold-niebuhr', NULL, 'https://en.wikipedia.org/wiki/Reinhold_Niebuhr', 'Karl Paul Reinhold Niebuhr (1892–1971) was an American Reformed theologian, ethicist, commentator on politics and public affairs, and professor at Union Theological Seminary for more than 30 years. Niebuhr was one of America''s leading public intellectuals for several decades of the 20th century and received the Presidential Medal of Freedom in 1964.', 'American Reformed theologian', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.227447', '2024-10-13 23:59:18.227447'),
('01928852-74d7-75f4-8e0a-4aa4c05223c6', 'René Descartes', 'rene-descartes', NULL, 'https://en.wikipedia.org/wiki/Ren%C3%A9_Descartes', 'René Descartes (31 March 1596 – 11 February 1650) was a French philosopher, mathematician, and scientist. A native of the Kingdom of France, he spent about 20 years (1629–1649) of his life in the Dutch Republic after serving for a while in the Dutch States Army of Maurice of Nassau, Prince of Orange and the Stadtholder of the United Provinces.', 'French philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 3, '2024-10-13 23:59:18.230194', '2024-10-13 23:59:18.230194'),
('01928852-74da-71ea-85c5-2626040df0be', 'Richard Bach', 'richard-bach', NULL, 'https://en.wikipedia.org/wiki/Richard_Bach', 'Richard David Bach (born June 23, 1936) is an American writer widely known as the author of some of the 1970s'' biggest sellers, including Jonathan Livingston Seagull (1970) and Illusions: The Adventures of a Reluctant Messiah (1977). Bach has written numerous works of fiction, and also non-fiction flight-related titles.', 'American spiritual writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 30, '2024-10-13 23:59:18.233297', '2024-10-13 23:59:18.233297'),
('01928852-74dd-7703-90b9-17bf30f40043', 'Richard Burton', 'richard-burton', NULL, 'https://en.wikipedia.org/wiki/Richard_Burton', 'Richard Burton (10 November 1925 – 5 August 1984) was a Welsh actor. Noted for his mellifluous baritone voice, Burton established himself as a formidable Shakespearean actor in the 1950s, and he gave a memorable performance of Hamlet in 1964.', 'Welsh actor', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.236094', '2024-10-13 23:59:18.236094'),
('01928852-74e0-7bd9-8801-8cba8adee541', 'Richard Garriott', 'richard-garriott', NULL, 'https://en.wikipedia.org/wiki/Richard_Garriott', 'Richard Allen Garriott de Cayeux (born July 4, 1961) is an English-American video-game developer and entrepreneur. Garriott, who is the son of NASA astronaut Owen Garriott, was originally a game designer and programmer, and is now involved in a number of aspects of computer-game development.', 'Video game developer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.239245', '2024-10-13 23:59:18.239245'),
