('01928852-74e6-7dc5-a0f9-816100b10820', 'Richard Whately', 'richard-whately', NULL, 'https://en.wikipedia.org/wiki/Richard_Whately', 'Richard Whately (1 February 1787 – 8 October 1863) was an English rhetorician, logician, economist, academic and theologian who also served as a reforming Church of Ireland Archbishop of Dublin. He was a leading Broad Churchman, a prolific and combative author over a wide range of topics, a flamboyant character, and one of the first reviewers to recognise the talents of Jane Austen.', 'English academic', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.245873', '2024-10-13 23:59:18.245873'),
