('01928852-7547-7a0b-aacf-1f2716c18ab1', 'Sasha Cohen', 'sasha-cohen', NULL, 'https://en.wikipedia.org/wiki/Sasha_Cohen', 'Alexandra Pauline "Sasha" Cohen (born October 26, 1984) is a retired American figure skater. She is the 2006 Olympic silver medalist, a three-time World Championship medalist, the 2003 Grand Prix Final Champion, and the 2006 U.S. Champion. She is known for her artistry, flexibility and body lines, and musical interpretation.', 'American figure skater', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:18.342993', '2024-10-13 23:59:18.342993'),
('01928852-754a-773d-93e2-2286c02a237a', 'Satchel Paige', 'satchel-paige', NULL, 'https://en.wikipedia.org/wiki/Satchel_Paige', 'Leroy Robert "Satchel" Paige (July 7, 1906 – June 8, 1982) was an American Negro league baseball and Major League Baseball (MLB) pitcher who is notable for his longevity in the game, and for attracting record crowds wherever he pitched. Paige was a right-handed pitcher, and at age 42 in 1948, was the oldest major league rookie while playing for the Cleveland Indians.', 'American baseball player', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.345347', '2024-10-13 23:59:18.345347'),
