('01928852-773b-7553-92eb-3fdb88846bc3', 'Warren Buffett', 'warren-buffett', NULL, 'https://en.wikipedia.org/wiki/Warren_Buffett', 'Warren Edward Buffett (born August 30, 1930) is an American business magnate, investor, and philanthropist. He is currently the chairman and CEO of Berkshire Hathaway. He is one of the best-known fundamental investors in the world as a result of his immense investment success possessing a net worth of $104 billion as of March 2023, making him the fifth-richest person in the world.', 'American business magnate and philanthropist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 9, '2024-10-13 23:59:18.843031', '2024-10-13 23:59:18.843031'),
('01928852-773e-7b37-bfbf-18ac77d39385', 'Warren Spahn', 'warren-spahn', NULL, 'https://en.wikipedia.org/wiki/Warren_Spahn', 'Warren Edward Spahn (April 23, 1921 – November 24, 2003) was an American professional baseball player. He played in Major League Baseball as a left-handed pitcher in 1942 and then from 1946 until 1965, most notably for the Boston Braves, who became the Milwaukee Braves after the team moved west before the 1953 season. His baseball career was interrupted by his military service in the United States Army during the Second World War.Born and raised in Buffalo, New York, Spahn attended South Park High School.', 'American baseball player', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:18.845363', '2024-10-13 23:59:18.845363'),
('01928852-7741-71a7-a9ec-760f631de7db', 'Washington Irving', 'washington-irving', NULL, 'https://en.wikipedia.org/wiki/Washington_Irving', 'Washington Irving (April 3, 1783 – November 28, 1859) was an American short-story writer, essayist, biographer, historian, and diplomat of the early 19th century. He is best known for his short stories "Rip Van Winkle" (1819) and "The Legend of Sleepy Hollow" (1820), both of which appear in his collection The Sketch Book of Geoffrey Crayon, Gent.', 'American writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.848667', '2024-10-13 23:59:18.848667'),
('01928852-7744-71bf-9a7d-d848a44374a8', 'Wayne Dyer', 'wayne-dyer', NULL, 'https://en.wikipedia.org/wiki/Wayne_Dyer', 'Wayne Walter Dyer (May 10, 1940 – August 29, 2015) was an American self-help author and a motivational speaker. His first book, Your Erroneous Zones (1976), is one of the best-selling books of all time, with an estimated 100 million copies sold to date.', 'American self-help author', NULL, '{}', NULL, 'f', 'f', 't', 'f', 24, '2024-10-13 23:59:18.851092', '2024-10-13 23:59:18.851092'),
('01928852-7747-75ea-b8aa-8a7d92d62094', 'Wayne Gretzky', 'wayne-gretzky', NULL, 'https://en.wikipedia.org/wiki/Wayne_Gretzky', 'Wayne Douglas Gretzky (born January 26, 1961) is a Canadian former professional ice hockey player and former head coach. He played 20 seasons in the National Hockey League (NHL) for four teams from 1979 to 1999. Nicknamed "the Great One", he has been called the greatest hockey player ever by many sportswriters, players, the NHL itself, and by The Hockey News, based on extensive surveys of hockey writers, ex-players, general managers and coaches.', 'Canadian ice hockey player and coach', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.854596', '2024-10-13 23:59:18.854596'),
('01928852-7749-73c2-be81-ecc904b3ab2d', 'Whoopi Goldberg', 'whoopi-goldberg', NULL, 'https://en.wikipedia.org/wiki/Whoopi_Goldberg', 'Caryn Elaine Johnson (born November 13, 1955), known professionally as Whoopi Goldberg (), is an American actor, comedian, author, and television personality. She has been nominated for 13 Emmy Awards and is one of the few entertainers to have won an Emmy Award, a Grammy Award, an Academy Award, and a Tony Award.', 'American actress', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.856973', '2024-10-13 23:59:18.856973'),
('01928852-774c-7be9-a89a-0b229af4649b', 'Will Durant', 'will-durant', NULL, 'https://en.wikipedia.org/wiki/Will_Durant', 'William James "Will" Durant (November 5, 1885 – November 7, 1981) was an American writer, historian, and philosopher. He became best known for his work The Story of Civilization, 11 volumes written in collaboration with his wife, Ariel Durant, and published between 1935 and 1975.', 'American writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.85927', '2024-10-13 23:59:18.85927'),
('01928852-774e-7073-baf6-c0da77bed554', 'Will Rogers', 'will-rogers', NULL, 'https://en.wikipedia.org/wiki/Will_Rogers', 'William Penn Adair Rogers (November 4, 1879 – August 15, 1935) was an American stage and film actor, vaudeville performer, cowboy, humorist, newspaper columnist, and social commentator from Oklahoma. He was a Cherokee citizen born in the Cherokee Nation, Indian Territory.', 'American humorist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 4, '2024-10-13 23:59:18.861655', '2024-10-13 23:59:18.861655'),
('01928852-7750-7a3f-a343-982d8d30e646', 'Willa Cather', 'willa-cather', NULL, 'https://en.wikipedia.org/wiki/Willa_Cather', 'Willa Sibert Cather (December 7, 1873 – April 24, 1947) was an American writer who achieved recognition for her novels of frontier life on the Great Plains, including O Pioneers! (1913), The Song of the Lark (1915), and My Ántonia (1918).', 'American writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.863818', '2024-10-13 23:59:18.863818'),
('01928852-7754-7ec1-967c-e752177f3b43', 'William Arthur Ward', 'william-arthur-ward', NULL, 'https://en.wikipedia.org/wiki/William_Arthur_Ward', 'William Arthur Ward (December 17, 1921–March 30, 1994) was an often quoted writer of inspirational maxims.More than 100 articles, poems and meditations written by Ward were published in such magazines as Reader''s Digest, The Phi Delta Kappan, Science of Mind, and various Christian publications. His column “Pertinent Proverbs” was published by the Fort Worth Star-Telegram and also in American service club publications.', 'American writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 5, '2024-10-13 23:59:18.86675', '2024-10-13 23:59:18.86675'),
('01928852-7757-7e9f-b5fa-113e06dad56c', 'William Blake', 'william-blake', NULL, 'https://en.wikipedia.org/wiki/William_Blake', 'William Blake (28 November 1757 – 12 August 1827) was an English poet, painter, and printmaker. Largely unrecognised during his lifetime, Blake is now considered a seminal figure in the history of the poetry and visual arts of the Romantic Age.', 'English poet and artist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 6, '2024-10-13 23:59:18.870551', '2024-10-13 23:59:18.870551'),
('01928852-775a-7207-be00-8351222f8ca8', 'William Burroughs', 'william-burroughs', NULL, 'https://en.wikipedia.org/wiki/William_S._Burroughs', 'William Seward Burroughs (February 5, 1914 – August 2, 1997) was an American writer and visual artist. Burroughs was a primary figure of the Beat Generation and a major postmodernist author whose influence is considered to have affected a range of popular culture as well as literature.', 'American writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.872821', '2024-10-13 23:59:18.872821'),
('01928852-775d-7a6a-a8c4-cc4f53e2c937', 'William Butler Yeats', 'william-butler-yeats', NULL, 'https://en.wikipedia.org/wiki/W._B._Yeats', 'William Butler Yeats (13 June 1865 – 28 January 1939) was an Irish poet and one of the foremost figures of 20th-century literature. A pillar of the Irish literary establishment, he helped to found the Abbey Theatre, and in his later years served two terms as a Senator of the Irish Free State.', 'Irish poet and playwright', NULL, '{}', NULL, 'f', 'f', 't', 'f', 2, '2024-10-13 23:59:18.87663', '2024-10-13 23:59:18.87663'),
('01928852-7760-78f2-9cb7-44e2797561bc', 'William C. Menninger', 'william-c-menninger', NULL, 'https://en.wikipedia.org/wiki/William_C._Menninger', 'William Claire Menninger  (October 15, 1899 – September 6, 1966)  was a co-founder with his brother Karl and his father of The Menninger Foundation in Topeka, Kansas, an internationally known center for treatment of behavioral disorders.', 'Karl Menninger''s brother', NULL, '{}', NULL, 'f', 'f', 't', 'f', 3, '2024-10-13 23:59:18.879146', '2024-10-13 23:59:18.879146'),
('01928852-7763-761a-b8b7-8ee919c3c35f', 'William Cowper', 'william-cowper', NULL, 'https://en.wikipedia.org/wiki/William_Cowper', 'William Cowper (26 November 1731 – 25 April 1800) was an English poet and hymnodist. One of the most popular poets of his time, Cowper changed the direction of 18th century nature poetry by writing of everyday life and scenes of the English countryside.', 'English poet', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.882057', '2024-10-13 23:59:18.882057'),
('01928852-7765-74b1-b9f9-523937474d42', 'William Ellery Channing', 'william-ellery-channing', NULL, 'https://en.wikipedia.org/wiki/William_Ellery_Channing', 'William Ellery Channing was the foremost Unitarian preacher in the United States in the early nineteenth century and, along with Andrews Norton, one of Unitarianism''s leading theologians.', 'Preacher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 3, '2024-10-13 23:59:18.88467', '2024-10-13 23:59:18.88467'),
('01928852-7768-7e6f-ae70-79d99910abc4', 'William Hazlitt', 'william-hazlitt', NULL, 'https://en.wikipedia.org/wiki/William_Hazlitt', 'William Hazlitt (10 April 1778 – 18 September 1830) was an English essayist, drama and literary critic, painter, social commentator, and philosopher. He is now considered one of the greatest critics and essayists in the history of the English language, placed in the company of Samuel Johnson and George Orwell.', '19th-century English essayist and critic', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.887456', '2024-10-13 23:59:18.887456'),
('01928852-776a-7e77-bae2-8a19d049c9af', 'William Hurt', 'william-hurt', NULL, 'https://en.wikipedia.org/wiki/William_Hurt', 'William McChord Hurt (born March 20, 1950) is an American actor, director, producer, and screenwriter. He studied at the Juilliard School and began acting on stage in the 1970s.', 'American actor', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.889994', '2024-10-13 23:59:18.889994'),
('01928852-776d-7fa0-b9ab-ef6bcc4002c8', 'William Inge', 'william-inge', NULL, 'https://en.wikipedia.org/wiki/William_Inge_(priest)', 'William Ralph Inge (6 June 1860 – 26 February 1954) was an English author, Anglican priest, professor of divinity at Cambridge, and Dean of St Paul''s Cathedral, which provided the appellation by which he was widely known, Dean Inge. He was nominated for the Nobel Prize in Literature three times.', 'English author', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.892222', '2024-10-13 23:59:18.892222'),
('01928852-7770-7ab7-a0dd-ca218884ec26', 'William James', 'william-james', NULL, 'https://en.wikipedia.org/wiki/William_James', 'William James (January 11, 1842 – August 26, 1910) was an American philosopher and psychologist, and the first educator to offer a psychology course in the United States. James is considered to be a leading thinker of the late nineteenth century, one of the most influential philosophers of the United States, and the "Father of American psychology".Along with Charles Sanders Peirce, James established the philosophical school known as pragmatism, and is also cited as one of the founders of functional psychology.', 'American philosopher', NULL, '{}', NULL, 'f', 'f', 't', 'f', 5, '2024-10-13 23:59:18.895385', '2024-10-13 23:59:18.895385'),
('01928852-7773-7bc5-8834-a8bd1a779409', 'William Lyon Phelps', 'william-lyon-phelps', NULL, 'https://en.wikipedia.org/wiki/William_Lyon_Phelps', 'William Lyon Phelps (January 2, 1865 New Haven, Connecticut – August 21, 1943 New Haven, Connecticut) was an American author, critic and scholar. He taught the first American university course on the modern novel.', 'American author', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.898615', '2024-10-13 23:59:18.898615'),
('01928852-7775-7c61-9ba4-f354b4670447', 'William Penn', 'william-penn', NULL, 'https://en.wikipedia.org/wiki/William_Penn', 'William Penn (14 October 1644 – 30 July 1718) was the son of the admiral and politician Sir William Penn. Penn was a writer, early member of the Religious Society of Friends (Quakers), and founder of the English North American colony the Province of Pennsylvania.', 'Writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.900988', '2024-10-13 23:59:18.900988'),
('01928852-7778-7f8a-a2a7-3538399042c8', 'William Saroyan', 'william-saroyan', NULL, 'https://en.wikipedia.org/wiki/William_Saroyan', 'William Saroyan (August 31, 1908 – May 18, 1981) was an Armenian-American novelist, playwright, and short story writer. He was awarded the Pulitzer Prize for Drama in 1940, and in 1943 won the Academy Award for Best Story for the film adaptation of his novel The Human Comedy.', 'American writer', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.903277', '2024-10-13 23:59:18.903277'),
('01928852-777a-762d-9378-c5e7bfe93c82', 'William Shakespeare', 'william-shakespeare', NULL, 'https://en.wikipedia.org/wiki/William_Shakespeare', 'William Shakespeare (bapt. 26 April 1564 – 23 April 1616) was an English playwright, poet, and actor, widely regarded as the greatest writer in the English language and the world''s greatest dramatist.', 'English playwright', NULL, '{}', NULL, 'f', 'f', 't', 'f', 14, '2024-10-13 23:59:18.905511', '2024-10-13 23:59:18.905511'),
