('01928852-7780-7679-9b31-cfa69b438c90', 'William Wordsworth', 'william-wordsworth', NULL, 'https://en.wikipedia.org/wiki/William_Wordsworth', 'William Wordsworth (7 April 1770 – 23 April 1850) was an English Romantic poet who, with Samuel Taylor Coleridge, helped to launch the Romantic Age in English literature with their joint publication Lyrical Ballads (1798). Wordsworth''s magnum opus is generally considered to be The Prelude, a semi-autobiographical poem of his early years that he revised and expanded a number of times.', 'English Romantic poet', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.911176', '2024-10-13 23:59:18.911176'),
('01928852-7782-7be5-b01e-bf9291139728', 'Wilson Mizner', 'wilson-mizner', NULL, 'https://en.wikipedia.org/wiki/Wilson_Mizner', 'Wilson Mizner (May 19, 1876 – April 3, 1933) was an American playwright, raconteur, and entrepreneur.  His best-known plays are The Deep Purple, produced in 1910, and The Greyhound, produced in 1912.', 'American playwright', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.913623', '2024-10-13 23:59:18.913623'),
('01928852-7785-733d-946f-215257abfe3f', 'Wilt Chamberlain', 'wilt-chamberlain', NULL, 'https://en.wikipedia.org/wiki/Wilt_Chamberlain', 'Wilton Norman Chamberlain (August 21, 1936 – October 12, 1999) was an American professional basketball player who played as a center. Standing at 7 ft 1 in (2.16 m) tall, he played in the National Basketball Association (NBA) for 14 years and is widely regarded as one of the greatest players in the sport''s history. Several publications have argued that Chamberlain is the greatest NBA player of all time.', 'American hall of fame basketball player', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:18.916784', '2024-10-13 23:59:18.916784'),
