('01928852-778a-7b63-b73f-e0042755dd2e', 'Winston Churchill', 'winston-churchill', NULL, 'https://en.wikipedia.org/wiki/Winston_Churchill', 'Sir Winston Leonard Spencer-Churchill  (30 November 1874 – 24 January 1965) was a British politician, army officer, and writer. He was the Prime Minister of the United Kingdom from 1940 to 1945, when he led Britain to victory in the Second World War, and again from 1951 to 1955.', 'British statesman', NULL, '{}', NULL, 'f', 'f', 't', 'f', 37, '2024-10-13 23:59:18.921522', '2024-10-13 23:59:18.921522'),
('01928852-778c-7bfd-bcb7-a3cf11f148d4', 'Wolfgang Amadeus Mozart', 'wolfgang-amadeus-mozart', NULL, 'https://en.wikipedia.org/wiki/Wolfgang_Amadeus_Mozart', 'Wolfgang Amadeus Mozart (27 January 1756 – 5 December 1791), baptised as Johannes Chrysostomus Wolfgangus Theophilus Mozart, was a prolific and influential composer of the Classical period. Born in Salzburg, Mozart showed prodigious ability from his earliest childhood.', 'Composer of the Classical period', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.923954', '2024-10-13 23:59:18.923954'),
('01928852-778e-7d9c-9f3f-3af59f7e07b5', 'Woodrow Wilson', 'woodrow-wilson', NULL, 'https://en.wikipedia.org/wiki/Woodrow_Wilson', 'Thomas Woodrow Wilson (December 28, 1856 – February 3, 1924) was an American politician, lawyer, and academic who served as the 28th president of the United States from 1913 to 1921. A member of the Democratic Party, Wilson served as the president of Princeton University and as the 34th governor of New Jersey before winning the 1912 presidential election.', '28th president of the United States', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.925978', '2024-10-13 23:59:18.925978'),
('01928852-7790-79f7-8c8c-b0430a929515', 'Woody Allen', 'woody-allen', NULL, 'https://en.wikipedia.org/wiki/Woody_Allen', 'Woody Allen (December 1, 1935) is an American film director, writer, actor, and comedian whose career spans more than six decades and multiple Academy Award-winning movies. He began his career as a comedy writer on Sid Caesar''s comedy variety program, Your Show of Shows, working alongside Mel Brooks, Carl Reiner, Larry Gelbart and Neil Simon.', 'American film director', NULL, '{}', NULL, 'f', 'f', 't', 'f', 14, '2024-10-13 23:59:18.927835', '2024-10-13 23:59:18.927835'),
('01928852-7793-76fb-b52e-d61092028073', 'Woody M Guthrie', 'woody-m-guthrie', NULL, 'https://en.wikipedia.org/wiki/Woody_Guthrie', 'Woodrow Wilson Guthrie (July 14, 1912 – October 3, 1967) was an American singer-songwriter, and one of the most significant figures in early American folk music. His work focused on themes of American socialism and anti-fascism. His music includes songs such as "This Land Is Your Land", written to oppose the American exceptionalist song "God Bless America", and has inspired several generations both politically and musically.Guthrie wrote hundreds of country, folk, and children''s songs, along with ballads and improvised works.', 'American singer-songwriter and folk musician', NULL, '{}', NULL, 'f', 'f', 't', 'f', 0, '2024-10-13 23:59:18.929984', '2024-10-13 23:59:18.929984'),
('01928852-7795-789b-a6fa-2f71177fa01c', 'Yogi Berra', 'yogi-berra', NULL, 'https://en.wikipedia.org/wiki/Yogi_Berra', 'Lawrence Peter "Yogi" Berra (May 12, 1925 – September 22, 2015) was an American professional baseball catcher, who later took on the roles of manager and coach. He played 19 seasons in Major League Baseball (MLB) (1946–1963, 1965), all but the last for the New York Yankees.', 'American baseball player', NULL, '{}', NULL, 'f', 'f', 't', 'f', 4, '2024-10-13 23:59:18.932883', '2024-10-13 23:59:18.932883'),
('01928852-7797-7715-9b25-293f9a5fe83c', 'Yoko Ono', 'yoko-ono', NULL, 'https://en.wikipedia.org/wiki/Yoko_Ono', 'Yoko Ono Lennon  (born February 18, 1933) is a Japanese multimedia artist, singer, songwriter and peace activist.  Her work also encompasses performance art, which she performs in both English and Japanese, and filmmaking.', 'Japanese artist', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:18.934975', '2024-10-13 23:59:18.934975'),
('01928852-7828-7363-a3a4-163cde932dad', 'Yolanda Hadid', 'yolanda-hadid', NULL, 'https://en.wikipedia.org/wiki/Yolanda_Hadid', 'Yolanda Hadid (born 11 January 1964) is a Dutch-American television personality and former model. She is best known as a star of the American reality-television show The Real Housewives of Beverly Hills.', 'Dutch television personality', NULL, '{}', NULL, 'f', 'f', 't', 'f', 1, '2024-10-13 23:59:19.079199', '2024-10-13 23:59:19.079199'),
