('0034b1fe-524c-4223-89e9-ff473ea94343', 'When watching after yourself, you watch after others. When watching after others, you watch after yourself.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:04:43.12148', '2024-10-14 00:04:43.12148'),
('006e9f12-58ba-4ac4-9e45-a4601537ade1', 'Do not go where the path may lead, go instead where there is no path and leave a trail.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.453666', '2024-10-14 00:05:37.453666'),
('007a1b2a-6c94-4ca9-a35b-7bf820efaa49', 'I don''t need a friend who changes when I change and who nods when I nod; my shadow does that much better.', '01928852-74a0-7141-8ad0-533813297501', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:36.796081', '2024-10-14 00:05:36.796081'),
('008a2afe-739c-415b-b8be-ef77d8ca93db', 'Do something wonderful, people may imitate it.', '01928852-683a-71d6-b41c-d2b672f92792', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:37.235829', '2024-10-14 00:05:37.235829'),
('00a5b8af-9f85-49ec-acd5-dbe829f1f280', 'If we are not given the chance to forget, we are also not given the chance to recover our memories, to alter them with time, perspective, and wisdom. Forgetting, we can be ourselves beyond what the past has told us we are; we can evolve. That is the possibility we want from the future.', '01928852-6aaa-706c-9d04-4196728d589c', '{wisdom,future}', NULL, 't', 'f', '2024-10-14 00:05:29.793148', '2024-10-14 00:05:29.793148'),
