('07f2edcb-f7a0-4234-a42e-8258896cfefc', 'Trust your own instinct. Your mistakes might as well be your own, instead of someone else''s.', '01928852-6931-73f2-b51b-68bba0e1d4be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.02088', '2024-10-14 00:05:28.02088'),
