('09de9f21-d8aa-42a0-a249-4f53d7e69390', 'Look up at the stars and not down at your feet. Try to make sense of what you see, and wonder about what makes the universe exist. Be curious.', '01928852-757b-7236-b7ab-8ad7f7fb910c', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:36.453922', '2024-10-14 00:05:36.453922'),
('09f07aed-7f17-4469-afba-17562a31396b', 'Trust only movement. Life happens at the level of events, not of words. Trust movement.', '01928852-6862-7941-ba64-a3286e25bb8d', '{famous-quotes,life}', NULL, 't', 'f', '2024-10-14 00:05:27.309709', '2024-10-14 00:05:27.309709'),
