('0a78f1db-80cd-419e-a541-a35ca8f4988e', 'All I required to be happy was friendship and people I could admire.', '01928852-6ae0-738e-bdf7-f3121ed74503', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:29.809942', '2024-10-14 00:05:29.809942'),
('0a802a1c-f9b8-459f-b1f8-77280e37b476', 'If you don''t know where you are going, any road will get you there.', '01928852-714c-7ccb-b9c7-dd90eb1e0468', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.856817', '2024-10-14 00:05:36.856817'),
('0b186379-e036-4c1e-a3fc-ce7f1c0c5ac9', 'To listen well is as powerful a means of communication and influence as to talk well.', '01928852-70a6-717f-a8b3-49bf9ddf523f', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.166582', '2024-10-14 00:05:35.166582'),
('0b1b3b3a-1144-47a3-af5c-db59c0a5e5ea', 'Many men go fishing all of their lives without knowing that it is not fish they are after.', '01928852-6e80-74e5-9876-70d42cdf42c4', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.850379', '2024-10-14 00:04:43.850379'),
('0b222ef8-cdbe-41a6-a2d9-49a2635ff921', 'Problems are only opportunities with thorns on them.', '01928852-6ecd-7beb-ae69-2eef19236b28', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.960491', '2024-10-14 00:05:32.960491'),
('0b437b46-55e8-4ea7-91f6-3b9b820f80cd', 'We gain the strength of the temptation we resist.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.266253', '2024-10-14 00:05:29.266253'),
('0b499fec-7110-47a3-bc23-cc87287ac816', 'We lost because we told ourselves we lost.', '01928852-7143-7521-9d54-139d8ad1626f', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.792536', '2024-10-14 00:05:27.792536'),
('0b78122f-0312-46c2-9c25-72af14116049', 'It has become appallingly obvious that our technology has exceeded our humanity.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:34.576645', '2024-10-14 00:05:34.576645'),
('0b7b2e8e-cd54-4f94-9f22-c114b13c5d55', 'Life isn''t about finding yourself. Life is about creating yourself.', '01928852-6917-7836-96a6-0032b8b45499', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.550987', '2024-10-14 00:05:26.550987'),
('0b7fffd8-5667-442c-ae77-8339600cb7df', 'When you have got an elephant by the hind legs and he is trying to run away, it''s best to let him run.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.766556', '2024-10-14 00:05:29.766556'),
('0b885507-9bd9-4b06-8db5-cf751aef0679', 'The highest stage in moral culture at which we can arrive is when we recognize that we ought to control our thoughts.', '01928852-6ab6-77ac-be97-cb19a1ba50c7', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.445216', '2024-10-14 00:05:34.445216'),
('0bad90ee-5d7f-4a77-8eb0-14e7b8f969bb', 'There are two ways to slide easily through life: to believe everything or to doubt everything; both ways save us from thinking.', '01928852-6864-7c46-9c0f-89a8c19ef36d', '{famous-quotes,life}', NULL, 't', 'f', '2024-10-14 00:05:29.835837', '2024-10-14 00:05:29.835837'),
('0bce0a6f-d247-4ca0-a889-2a2ed39b043f', 'What is not started today is never finished tomorrow.', '01928852-6f6e-72a3-82ea-f8859e323434', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.137036', '2024-10-14 00:05:27.137036'),
('0bdd784d-c5a6-4d34-9167-086aa06429a4', 'One is not called noble who harms living beings. By not harming living beings one is called noble.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,virtue}', NULL, 't', 'f', '2024-10-14 00:04:42.999404', '2024-10-14 00:04:42.999404'),
('0c3bcd64-6b35-4cbb-923a-f8f2c7258ba7', 'Your attitude, not your aptitude, will determine your altitude.', '01928852-782c-7b27-b787-284e61240cd3', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.325121', '2024-10-14 00:05:29.325121'),
('0c5ebc61-534a-428d-8e39-3421bae328eb', 'Start where you are. Use what you have. Do what you can.', '01928852-68bd-71c9-9320-2caa3c61880c', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:34.257111', '2024-10-14 00:05:34.257111'),
('0c81cde8-f6b7-4ab7-b488-a7d17b50ac21', 'Whatever we expect with confidence becomes our own self-fulfilling prophecy.', '01928852-6a4b-7890-863c-53107229ddee', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.201899', '2024-10-14 00:05:36.201899'),
('0c9002ae-cb69-4205-bba3-f78511056561', 'Two of man''s basic needs are to love and to share. Both of these needs are satisfied in greater or lesser degree by friendship.', '01928852-7307-7788-adbd-770b20e435fe', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:31.550781', '2024-10-14 00:05:31.550781'),
('0c912203-d88a-491d-b251-3f9ed1736ef8', 'Adversity has the effect of eliciting talents, which in prosperous circumstances would have lain dormant.', '01928852-6ec3-7e50-9008-b6c9260f7584', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.976733', '2024-10-14 00:05:33.976733'),
('0c9f02b7-e2a4-406e-9192-b355bd0f395b', 'Much wisdom often goes with fewest words.', '01928852-7571-7f1c-90a4-db4bf8cb4038', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.501726', '2024-10-14 00:05:32.501726'),
('0ccb2a0e-7123-411e-b3f0-4a5322386418', 'A youth, when at home, should be filial and, abroad, respectful to his elders. He should be earnest and truthful. He should overflow in love to all and cultivate the friendship of the good. When he has time and opportunity, after the performance of these things, he should employ them in polite studies.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:36.871652', '2024-10-14 00:05:36.871652'),
('0ce9ca71-04b9-4cc4-8b36-1265aff73cd5', 'I prefer the folly of enthusiasm to the indifference of wisdom.', '01928852-6884-77ad-a225-b2401731958d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.614648', '2024-10-14 00:05:29.614648'),
('0cf71fad-4b35-4f63-b678-44cfb147f2a0', 'I never considered a difference of opinion in politics, in religion, in philosophy, as cause for withdrawing from a friend.', '01928852-76c9-7011-8399-cc2c7c075bec', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:27.777886', '2024-10-14 00:05:27.777886'),
('0d23698a-8597-4a12-95b8-53541f9ae703', 'It has long been an axiom of mine that the little things are infinitely the most important.', '01928852-68c7-761a-848e-1e238c5932ad', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.952459', '2024-10-14 00:05:25.952459'),
('0d2ec4d3-d93b-4625-af86-a243a6994938', 'Wisdom is nothing but a preparation of the soul, a capacity, a secret art of thinking, feeling and breathing thoughts of unity at every moment of life.', '01928852-6eb2-74f4-aad9-46b1542bdb71', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.57251', '2024-10-14 00:05:34.57251'),
('0d3bf699-0b2c-4195-bf5f-f0924591dfb7', 'I cannot make my days longer, so I strive to make them better.', '01928852-6e80-74e5-9876-70d42cdf42c4', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.017009', '2024-10-14 00:05:29.017009'),
('0d72f8a6-bbce-405d-a28d-8e4ccabc5106', 'A lie gets halfway around the world before the truth has a chance to get its pants on.', '01928852-778a-7b63-b73f-e0042755dd2e', '{history,politics,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.246913', '2024-10-14 00:05:25.246913'),
('0d7dbc90-c2c1-42bb-b0ea-29c146ce097e', 'The best way to pay for a lovely moment is to enjoy it.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.988027', '2024-10-14 00:05:36.988027'),
('0d7e5c4e-6dcb-4a0c-9f2b-ea92eb19a205', 'Allow the world to live as it chooses, and allow yourself to live as you choose.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.216801', '2024-10-14 00:05:27.216801'),
('0d9a3d5d-a5f8-4751-b1ed-dd4dcecb815a', 'You cannot find yourself by going into the past. You can find yourself by coming into the present.', '01928852-6c63-7d04-951f-6e0cd76fb527', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.254777', '2024-10-14 00:05:27.254777'),
('0da61376-39d3-4530-8c05-8957e082ce2a', 'Do not turn back when you are just at the goal.', '01928852-74ad-78ef-9dae-9c93c6cc52f7', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.924368', '2024-10-14 00:05:32.924368'),
('0dd6d3d7-352b-47cc-847f-18aa4a45d8cf', 'True happiness means forging a strong spirit that is undefeated, no matter how trying our circumstances.', '01928852-6b09-70bb-b5d7-6842f2d812b5', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.950894', '2024-10-14 00:05:36.950894'),
('0dfbef2b-8b5d-4eaf-8a35-3c03f8161038', 'A man should look for what is, and not for what he thinks should be.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.669623', '2024-10-14 00:05:35.669623'),
('0e2723b3-74b2-4967-b486-9844f677d891', 'Character is like a tree and reputation like a shadow. The shadow is what we think of it; the tree is the real thing.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.820132', '2024-10-14 00:05:25.820132'),
('0e2b2984-bb3d-4fcb-a7ec-bf6960894d8c', 'A man must be big enough to admit his mistakes, smart enough to profit from them, and strong enough to correct them.', '01928852-7076-7cad-8bfc-b825086639d6', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.066701', '2024-10-14 00:05:27.066701'),
('0e2e339d-391e-400d-b6c3-86d4b6ed9775', 'To be what we are, and to become what we are capable of becoming, is the only end of life.', '01928852-74fd-727e-97d2-c98874aae563', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.366453', '2024-10-14 00:05:34.366453'),
('0eb78eb5-4507-471f-867b-e6b7e701057b', 'I am fond of pigs. Dogs look up to us. Cats look down on us. Pigs treat us as equals.', '01928852-778a-7b63-b73f-e0042755dd2e', '{humorous,famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:25.270013', '2024-10-14 00:05:25.270013'),
('0ed1a7a2-6711-40b4-8a9d-5570df7560a6', 'Of course there is no formula for success except perhaps an unconditional acceptance of life and what it brings.', '01928852-68cf-7125-9106-61972fda74fd', '{success}', NULL, 't', 'f', '2024-10-14 00:05:27.399927', '2024-10-14 00:05:27.399927'),
('0f379b34-dae6-40fe-89f6-07869cd3b2de', 'Only those who dare to fail greatly can ever achieve greatly.', '01928852-74ed-78d8-8c65-9a183c758e63', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.389996', '2024-10-14 00:05:36.389996'),
('0f405b58-b60f-4956-99a3-7d0cee73f5d8', 'The world is round and the place which may seem like the end may also be the beginning.', '01928852-6ee9-7802-949a-712c2ea594f1', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.193868', '2024-10-14 00:05:27.193868'),
('0f9b7bf3-ad4b-4335-a907-ce3238ed0e87', 'It is one of the severest tests of friendship to tell your friend his faults. So to love a man that you cannot bear to see a stain upon him, and to speak painful truth through loving words, that is friendship.', '01928852-6ea0-7b1d-8d68-5ab8428d717c', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:31.166221', '2024-10-14 00:05:31.166221'),
('0ff24ebd-dd03-4d98-9950-ae96d1107840', 'I believe that a simple and unassuming manner of life is best for everyone, best both for the body and the mind.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{famous-quotes,life}', NULL, 't', 'f', '2024-10-14 00:05:35.320073', '2024-10-14 00:05:35.320073'),
('0ffe822d-b693-40b2-8f07-e16e4240d278', 'Using the power of decision gives you the capacity to get past any excuse to change any and every part of your life in an instant.', '01928852-76ed-7661-a537-c3978973ac97', '{success}', NULL, 't', 'f', '2024-10-14 00:05:26.807123', '2024-10-14 00:05:26.807123'),
('1019db8c-5028-4069-8611-004f8f79c997', 'All is flux; nothing stays still.', '01928852-6ea6-787f-808f-450f3289eb96', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.909761', '2024-10-14 00:05:33.909761'),
('10214e67-40f3-4ebf-9e8c-478c6c1d90fc', 'The World is my country, all mankind are my brethren, and to do good is my religion.', '01928852-76cb-76ce-9a7b-76983016bbf0', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.424727', '2024-10-14 00:05:28.424727'),
('1028302a-03f9-4ba2-a990-f3ab68b07bd4', 'Do the difficult things while they are easy and do the great things while they are small. A journey of a thousand miles must begin with a single step.', '01928852-7123-7698-bcd8-ce7b8878a322', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:29.625542', '2024-10-14 00:05:29.625542'),
('104c0ae6-c71e-4289-a886-75bf0f222e6c', 'When you are content to be simply yourself and don''t compare or compete, everybody will respect you.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.221044', '2024-10-14 00:05:30.221044'),
('105a1e17-ed3b-48b0-85d8-bb3039b7bc9c', 'I have always found that mercy bears richer fruits than strict justice.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.060676', '2024-10-14 00:05:25.060676'),
('1064b7fa-6c8c-4725-8cde-67b5ceff6458', 'Love is rarer than genius itself. And friendship is rarer than love.', '01928852-6acf-7f9b-a7a8-cea29bd8e8df', '{friendship,love}', NULL, 't', 'f', '2024-10-14 00:05:32.609208', '2024-10-14 00:05:32.609208'),
('106d0112-23d0-45ad-887c-330d049ca11a', 'Life is like a sewer. What you get out of it depends on what you put into it.', '01928852-76e3-7fab-831d-dc6370eeae17', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.357149', '2024-10-14 00:05:27.357149'),
('106f87ca-52a3-4d3d-9461-972c6db15286', 'The supreme art of war is to subdue the enemy without fighting.', '01928852-7589-7bbe-a373-da38f1a1230b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:37.046455', '2024-10-14 00:05:37.046455'),
('10a089e9-e3b3-492c-a925-e5d5b425f201', 'There are many ways of going forward, but only one way of standing still.', '01928852-6cf2-7719-89e2-fc251b33f18e', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.08354', '2024-10-14 00:05:29.08354'),
('10a21bc2-782c-401a-b78e-b63868fb0a80', 'Make it your habit not to be critical about small things.', '01928852-6c81-78c5-a795-3ba976b2e49d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.399147', '2024-10-14 00:05:25.399147'),
('10a4c044-42f9-4d59-aceb-c9c9466f502f', 'No matter how carefully you plan your goals they will never be more than pipe dreams unless you pursue them with gusto.', '01928852-771c-7097-8d20-83620afa5f84', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.77034', '2024-10-14 00:05:27.77034'),
('10ed61a3-41c9-4b35-bbca-e537a0003ab7', 'We make our own fortunes and we call them fate.', '01928852-690b-77b8-bda5-e8dc48fd4fa9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.541144', '2024-10-14 00:05:26.541144'),
('10f4f8ff-ac8c-41a4-83af-2745692f8835', 'There are no limitations to the mind except those we acknowledge.', '01928852-7319-70d7-9011-72c190bdd6f0', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.283573', '2024-10-14 00:05:30.283573'),
('10f8b7c2-15cd-4ea7-8c5b-f394e56c51b7', 'The greater our knowledge increases the more our ignorance unfolds.', '01928852-7087-754b-baed-0b0afc98ab6a', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.736144', '2024-10-14 00:05:25.736144'),
('11409635-4e1f-4d69-9893-608748766fc6', 'Imagination disposes of everything; it creates beauty, justice, and happiness, which are everything in this world.', '01928852-6934-7c5a-a71f-65849702aff4', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.131189', '2024-10-14 00:05:29.131189'),
('1150054a-9d73-47a2-a4a4-0709e5b5fc35', 'No one can make you feel inferior without your consent.', '01928852-6c92-7a6b-a6bb-78c31b86df98', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.935623', '2024-10-14 00:05:28.935623'),
('1165be79-5d83-4699-bf58-6f0c8f1a30d1', 'The word philosophy sounds high-minded, but it simply means the love of wisdom. If you love something, you don''t just read about it; you hug it, you mess with it, you play with it, you argue with it.', '01928852-6eca-7b4d-8a45-be68fd15cc67', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.377076', '2024-10-14 00:05:28.377076'),
('11945668-d2a8-4e51-be93-5204cd8d3694', 'We shall never know all the good that a simple smile can do.', '01928852-7309-7867-bcdd-764791e3c9b8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.971341', '2024-10-14 00:05:36.971341'),
('119869e8-5ca6-4e45-ad36-802e11d6bab1', 'Everything that happens as it should, and if you observe carefully, you will find this to be so.', '01928852-726f-73a3-874e-ff874af9432a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.970803', '2024-10-14 00:05:30.970803'),
('11a0c502-1623-48c6-bda0-f29b4a7aa88f', 'A wise man will make more opportunities than he finds.', '01928852-6ce2-73fa-9c99-68db0fa6a7a2', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.231302', '2024-10-14 00:05:27.231302'),
('11aff131-b228-40ab-83c2-46355768f147', 'You can''t let praise or criticism get to you. It''s a weakness to get caught up in either one.', '01928852-70c2-7a6e-b25e-e8c193b0337b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.055234', '2024-10-14 00:05:33.055234'),
('11c0c9cd-3c3d-46d9-adb4-ac579229bded', 'A little more persistence, a little more effort, and what seemed hopeless failure may turn to glorious success.', '01928852-6c90-7231-913f-c43f8cd95fbc', '{success}', NULL, 't', 'f', '2024-10-14 00:05:25.911423', '2024-10-14 00:05:25.911423'),
('11f3783c-4fac-4b3d-bd77-7b83dae44cda', 'We are masters of the unsaid words, but slaves of those we let slip out.', '01928852-778a-7b63-b73f-e0042755dd2e', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.189535', '2024-10-14 00:05:25.189535'),
