('13c78aa8-f3e6-4188-8a54-7a571f98a94d', 'Always seek out the seed of triumph in every adversity.', '01928852-7343-78c7-9517-53ef98ff7f51', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.799824', '2024-10-14 00:05:35.799824'),
('1406f1a2-e7c1-4d7c-aa06-7505271547f3', 'Love is like a friendship caught on fire. In the beginning a flame, very pretty, often hot and fierce, but still only light and flickering. As love grows older, our hearts mature and our love becomes as coals, deep-burning and unquenchable.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:31.857503', '2024-10-14 00:05:31.857503'),
('140f98c2-1124-4f7b-8ce9-9cad602ebb51', 'You know you''re in love when you can''t fall asleep because reality is finally better than your dreams.', '01928852-6b68-7103-940a-27bff50ae691', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.244079', '2024-10-14 00:05:32.244079'),
