('141cff64-fdac-40c2-a96a-3ba1a1d3c9f7', 'Whenever you have eliminated the impossible, whatever remains, however improbable, must be the truth.', '01928852-68c7-761a-848e-1e238c5932ad', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.541289', '2024-10-14 00:05:33.541289'),
('145b85e5-37c2-4fe1-922f-48edfb25898b', 'In romance, we feel the need to zoom in and expound on our partner''s foibles in intimate detail; in friendship, we tend to do the opposite, avoiding confrontation through fear, lethargy or both.', '01928852-7297-72fc-a63c-fd4a7ab91445', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:28.61197', '2024-10-14 00:05:28.61197'),
('1468658b-57ce-4cd9-90bf-e2ce8f1db841', 'To know oneself is to study oneself in action with another person.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.97674', '2024-10-14 00:05:32.97674'),
('148f2423-e976-41b5-93df-77ae7799d11d', 'In rivers, the water that you touch is the last of what has passed and the first of that which comes; so with present time.', '01928852-714a-78f9-b601-986148cb4b27', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.876853', '2024-10-14 00:05:31.876853'),
