('14a736e9-1c11-459a-875c-5a5647cff04c', 'Six essential qualities that are the key to success: Sincerity, personal integrity, humility, courtesy, wisdom, charity.', '01928852-7760-78f2-9cb7-44e2797561bc', '{success,life}', NULL, 't', 'f', '2024-10-14 00:05:37.487414', '2024-10-14 00:05:37.487414'),
