('14d04fc6-1851-45c2-8d7d-c19a7c7b371f', 'Wisdom is the right use of knowledge. To know is not to be wise. Many men know a great deal and are all the greater fools for it. There is no fool so great a fool as a knowing fool. But to know how to use knowledge is to have wisdom.', '01928852-6ad2-7a11-80a5-18e6c902ff35', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.144097', '2024-10-14 00:05:29.144097'),
