('151145f5-dcc2-4a85-8c43-09121a93da8e', 'Great minds discuss ideas; average minds discuss events; small minds discuss people.', '01928852-6c92-7a6b-a6bb-78c31b86df98', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.432592', '2024-10-14 00:05:34.432592'),
