('1558b127-747b-4760-a816-89e42c0d010e', 'The great myth of our times is that technology is communication.', '01928852-7150-7516-9767-5e51cbc85a6f', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:28.011149', '2024-10-14 00:05:28.011149'),
('15d2eb80-64cd-4ece-90b3-48d978aff744', 'What makes Superman a hero is not that he has power, but that he has the wisdom and the maturity to use the power wisely. From an acting point of view, that''s how I approached the part.', '01928852-6ae8-7a26-aa16-ec3b6cf5ad9f', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.594253', '2024-10-14 00:05:26.594253'),
