('16ab6fed-e4e5-41c5-94f8-7ee2c1bf82c8', 'Rock n'' roll as a genre is different from pop and hip hop: it is about bands, and that for me suggests brotherhood, family, friendship and community.', '01928852-7582-7422-85de-4166913c4f0d', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:33.227294', '2024-10-14 00:05:33.227294'),
('16bbb024-00d3-4c20-a03a-014fa00cb09b', 'The strong bond of friendship is not always a balanced equation; friendship is not always about giving and taking in equal shares. Instead, friendship is grounded in a feeling that you know exactly who will be there for you when you need something, no matter what or when.', '01928852-7562-78c3-bb32-9a3e0fcce21a', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:36.368912', '2024-10-14 00:05:36.368912'),
('16c0c821-4119-4ffc-91cc-19aa25e0426b', 'Three things in human life are important. The first is to be kind. The second is to be kind. The third is to be kind.', '01928852-6e8a-7f24-9e0f-e049342e41d5', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.569732', '2024-10-14 00:05:36.569732'),
