('176667a5-04bd-49f2-8a3c-660dbc56cf4c', 'Let me tell you the secret that has led me to my goal: my strength lies solely in my tenacity.', '01928852-7166-7408-aa00-65cfab5dbe79', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.884128', '2024-10-14 00:05:32.884128'),
