('17dcd717-a3ed-4b3e-80ec-59c33e07b107', 'A man who doesn''t trust himself can never really trust anyone else.', '01928852-6f36-72af-91e9-709d866be27b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:25.79774', '2024-10-14 00:05:25.79774'),
