('18150665-b579-4215-bd4a-2347ebb63f77', 'True wisdom is less presuming than folly. The wise man doubteth often, and changeth his mind; the fool is obstinate, and doubteth not; he knoweth all things but his own ignorance.', '01928852-6826-787a-87e8-c15756da9b23', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.207994', '2024-10-14 00:05:27.207994'),
