('1986c8a9-d4ec-47be-ad8c-11755757a7de', 'A true friend is one who overlooks your failures and tolerates your success!', '01928852-6b5c-7ae6-9b69-e6ae24231f62', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:34.008411', '2024-10-14 00:05:34.008411'),
('19f574c5-599b-44d0-9191-9f4a91f6fefe', 'A friend is, as it were, a second self.', '01928852-6af0-792f-a520-9a06cb1ad7f7', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:25.828864', '2024-10-14 00:05:25.828864'),
('1a0e0506-e41f-47d3-8dbc-50bb8010fdff', 'Through perseverance many people win success out of what seemed destined to be certain failure.', '01928852-690b-77b8-bda5-e8dc48fd4fa9', '{success}', NULL, 't', 'f', '2024-10-14 00:05:32.582226', '2024-10-14 00:05:32.582226'),
