('1a854d76-15c7-4b42-9a84-e16441610528', 'There is no failure except in no longer trying.', '01928852-6c90-7231-913f-c43f8cd95fbc', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.078757', '2024-10-14 00:05:26.078757'),
