('1b9a3708-79dd-4873-a4bb-39018770958f', 'If you talk to a man in a language he understands, that goes to his head. If you talk to him in his language, that goes to his heart.', '01928852-7323-70bd-82a2-4f5d1f1dde9a', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.068514', '2024-10-14 00:05:29.068514'),
