('1bc01dc8-9fde-43de-a3f6-2e16f06ec64c', 'No pessimist ever discovered the secrets of the stars, or sailed to an uncharted land, or opened a new heaven to the human spirit.', '01928852-6e68-7e82-b1a6-7a4567140254', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.489661', '2024-10-14 00:05:32.489661'),
