('1be4e01c-06a2-424f-ba62-e4965ccff31e', 'He who learns must suffer. And even in our sleep pain that cannot forget falls drop by drop upon the heart, and in our own despair, against our will, comes wisdom to us by the awful grace of God.', '01928852-680c-7f4d-9c5d-104d3390e2bd', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.626981', '2024-10-14 00:05:35.626981'),
('1bea6713-d66c-444c-bb2e-a551a5fb05a9', 'By three methods we may learn wisdom: First, by reflection, which is noblest; Second, by imitation, which is easiest; and third by experience, which is the bitterest.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.459292', '2024-10-14 00:05:30.459292'),
