('1c378bd6-7167-47c8-a37b-17fc62a9bce1', 'Be miserable. Or motivate yourself. Whatever has to be done, it''s always your choice.', '01928852-7744-71bf-9a7d-d848a44374a8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.953744', '2024-10-14 00:05:32.953744'),
