('1c56a700-aac4-4dd5-ad2a-2919aa4d0b2e', 'On every thorn, delightful wisdom grows, in every rill a sweet instruction flows.', '01928852-6c88-70a2-9e41-86121be8709c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.435695', '2024-10-14 00:05:27.435695'),
('1c874299-8ddc-4c41-9c21-907219fb21b4', 'Trust yourself. You know more than you think you do.', '01928852-6913-7eeb-b3db-cda1d02ce618', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.180688', '2024-10-14 00:05:27.180688'),
