('1d38b3c1-6a3c-43c3-ac43-96ea634aae6e', 'Remember that sometimes not getting what you want is a wonderful stroke of luck.', '01928852-6b0b-786b-8dd4-995ae2eb3355', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.56287', '2024-10-14 00:05:34.56287'),
('1d5038aa-e93d-4c0c-961c-775eb276e930', 'You cannot change anything in your life with intention alone, which can become a watered-down, occasional hope that you''ll get to tomorrow. Intention without action is useless.', '01928852-6a7c-7d79-9221-b6103de03c18', '{change,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.604082', '2024-10-14 00:05:28.604082'),
