('1d81850d-5061-4ecb-937b-0cf11fb0b890', 'Business, you know, may bring you money, but friendship hardly ever does.', '01928852-6f17-7d58-a03d-e8d78e506931', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:27.259043', '2024-10-14 00:05:27.259043'),
