('1e4ff14e-02f6-48c1-a99d-01cb8ecb97c7', 'I, too, do not envision a doctrine of self the clinging to which there would not arise sorrow, lamentation, pain, grief, and despair.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.994945', '2024-10-14 00:05:28.994945'),
