('1e612e3d-9da3-458e-b11c-f0e609a9f4c1', 'We are all faced with a series of great opportunities brilliantly disguised as impossible situations.', '01928852-6aed-7634-8a3e-578c704ed937', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.44582', '2024-10-14 00:05:32.44582'),
