('1f1e4be0-dc1c-44cd-9ffc-2727c0e85850', 'An economist is an expert who will know tomorrow why the things he predicted yesterday didn''t happen today.', '01928852-7132-7a51-bb1a-7e40abf407fd', '{business}', NULL, 't', 'f', '2024-10-14 00:04:43.511077', '2024-10-14 00:04:43.511077'),
