('1fdd459e-4596-450b-bfe3-4180b96947b6', 'If you correct your mind, the rest of your life will fall into place.', '01928852-7123-7698-bcd8-ce7b8878a322', '{life}', NULL, 't', 'f', '2024-10-14 00:05:37.156873', '2024-10-14 00:05:37.156873'),
('1feb79ed-925e-4d2f-99f2-5bcd463f33be', 'The most complicated achievements of thought are possible without the assistance of consciousness.', '01928852-755b-7ae3-a03d-d8ec18a78542', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.844214', '2024-10-14 00:05:30.844214'),
('2013b444-ff77-4b4e-b2c6-9fca1fff714b', 'Mediocrity knows nothing higher than itself, but talent instantly recognizes genius.', '01928852-68c7-761a-848e-1e238c5932ad', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.910241', '2024-10-14 00:05:27.910241'),
