('206f90ce-38d2-47a4-bcb1-14b8af074a91', 'You''re not obligated to win. You''re obligated to keep trying to do the best you can every day.', '01928852-728d-727c-a9d1-42987aaeef8f', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.213915', '2024-10-14 00:05:35.213915'),
('206fc306-d436-4961-89ae-76f1428768f8', 'Take no thought of who is right or wrong or who is better than. Be not for or against.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.563832', '2024-10-14 00:05:36.563832'),
('207cc484-b09f-4cbf-881b-676f18d4f7dd', 'You are not here merely to make a living. You are here in order to enable the world to live more amply, with greater vision, with a finer spirit of hope and achievement. You are here to enrich the world, and you impoverish yourself if you forget the errand.', '01928852-778e-7d9c-9f3f-3af59f7e07b5', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:33.654426', '2024-10-14 00:05:33.654426'),
