('208a27e4-f943-4e38-b4bb-2e999589eb1f', 'We cannot be more sensitive to pleasure without being more sensitive to pain.', '01928852-682f-7990-bde7-7116c7df0f5d', '{life,pain}', NULL, 't', 'f', '2024-10-14 00:05:25.314812', '2024-10-14 00:05:25.314812'),
