('20cb12c1-a6ee-4a92-8874-e50a55c71972', 'There is only one happiness in life, to love and be loved.', '01928852-6d24-72a9-85f9-a4377b64fd6e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.789529', '2024-10-14 00:05:33.789529'),
