('20e566c3-cfc8-4050-9664-cb1b4adf6f55', 'All the great things are simple, and many can be expressed in a single word: freedom, justice, honor, duty, mercy, hope.', '01928852-778a-7b63-b73f-e0042755dd2e', '{social-justice,freedom,history}', NULL, 't', 'f', '2024-10-14 00:05:25.050104', '2024-10-14 00:05:25.050104'),
