('215f5d8f-cf8d-40c1-9a53-bf87fa0ead56', 'Consult not your fears but your hopes and your dreams. Think not about your frustrations, but about your unfulfilled potential. Concern yourself not with what you tried and failed in, but with what it is still possible for you to do.', '01928852-74a4-73a6-87e0-255399b0aa03', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:36.935256', '2024-10-14 00:05:36.935256'),
('216140d9-b68a-4cbd-8ca7-dd045ae39172', 'Never pretend to a love which you do not actually feel, for love is not ours to command.', '01928852-682f-7990-bde7-7116c7df0f5d', '{love}', NULL, 't', 'f', '2024-10-14 00:05:25.157349', '2024-10-14 00:05:25.157349'),
('216cfd14-ce0a-42c8-a3af-72a63557c971', 'The extreme limit of wisdom, that''s what the public calls madness.', '01928852-6f2f-76c9-9552-ab33fb03802f', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.561943', '2024-10-14 00:05:35.561943'),
('21a0eef5-cec5-4cf4-a8c1-957d0291ce6c', 'To fly, we have to have resistance.', '01928852-72cd-7dff-bc6b-208a737d8644', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.239814', '2024-10-14 00:05:35.239814'),
