('2234ff61-b9f8-45bd-b07a-96673930b2c4', 'Logic is the beginning of wisdom, not the end.', '01928852-7147-751d-b514-f1488f6f1550', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.567538', '2024-10-14 00:05:30.567538'),
