('2bbaa8c0-d45a-4732-a1bf-b2850b6e5e30', 'When you begin to touch your heart or let your heart be touched, you begin to discover that it''s bottomless.', '01928852-7466-7e60-a399-6cf4813bb052', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.170129', '2024-10-14 00:05:27.170129'),
('2c09995c-85a6-480e-9dc8-c014768996d1', 'If you do not express your own original ideas, if you do not listen to your own being, you will have betrayed yourself.', '01928852-7513-76f1-b8be-ab13e6e1b190', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.672556', '2024-10-14 00:05:29.672556'),
