('2c391498-530e-4b50-93e6-131206a15e66', 'It all depends on how we look at things, and not how they are in themselves.', '01928852-6a64-7ada-9375-506781793732', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.531457', '2024-10-14 00:05:36.531457'),
('2c4c19fb-b5af-4d59-bc4d-7ecf23fac244', 'In order to live free and happily you must sacrifice boredom. It is not always an easy sacrifice.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.481109', '2024-10-14 00:05:28.481109'),
('2c55eb2b-ae96-4413-9b51-858507c29b86', 'In action a great heart is the chief qualification. In work, a great head.', '01928852-68da-7006-a925-23c5ccfab1ad', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.761183', '2024-10-14 00:05:35.761183'),
('2c9941cc-0229-46de-9d31-101336bae0e7', 'Friendship without self-interest is one of the rare and beautiful things of life.', '01928852-6f09-72cf-8bac-e1e0dd041744', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:28.014137', '2024-10-14 00:05:28.014137'),
('2ca66ed6-1262-48de-bfb6-d921d19e4391', 'The trick is in what one emphasizes. We either make ourselves miserable, or we make ourselves happy. The amount of work is the same.', '01928852-6a73-75a2-a81b-360a4214f0f9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.510101', '2024-10-14 00:05:26.510101'),
('2ca91833-fd51-43b5-9b9a-768f07a5a6bb', 'To wear your heart on your sleeve isn''t a very good plan; you should wear it inside, where it functions best.', '01928852-7285-7150-9475-10555089ac48', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.126021', '2024-10-14 00:05:29.126021'),
('2cb25d23-6bba-4524-8325-b9d2e68d93ec', 'Remember that failure is an event, not a person.', '01928852-782c-7b27-b787-284e61240cd3', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.936086', '2024-10-14 00:05:33.936086'),
('2cbd4f9d-9083-45f4-9723-ab01fcd2a5a2', 'How many legs does a dog have if you call his tail a leg? Four. Saying that a tail is a leg doesn''t make it a leg.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{truth}', NULL, 't', 'f', '2024-10-14 00:05:25.025783', '2024-10-14 00:05:25.025783'),
('2ccf9260-d470-4e76-b180-9c6d7e3ccefe', 'One of the most beautiful qualities of true friendship is to understand and to be understood.', '01928852-754f-749d-9583-b870cbe8d40c', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:25.775765', '2024-10-14 00:05:25.775765'),
('2cef3b3b-d21a-4a12-9efc-66e765ba365f', 'Never accept ultimatums, conventional wisdom, or absolutes.', '01928852-6ae8-7a26-aa16-ec3b6cf5ad9f', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.734391', '2024-10-14 00:05:27.734391'),
('2cf72556-0142-4397-9c07-0eee86f8b251', 'Friendship, like love, is destroyed by long absence, though it may be increased by short intermissions.', '01928852-753a-73c1-9fa6-1952f433a528', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:37.525491', '2024-10-14 00:05:37.525491'),
('2d2d1463-debc-4551-ba42-063b539519cb', 'I do not believe in a fate that falls on men however they act; but I do believe in a fate that falls on man unless they act.', '01928852-6d01-77cf-a898-8dbfebef9e89', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.64', '2024-10-14 00:05:28.64'),
('2d30ad23-0cb4-4781-b5fb-b61901d6c919', 'Friendship is always a sweet responsibility, never an opportunity.', '01928852-7107-7406-9ddd-aa4185419e20', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:32.604442', '2024-10-14 00:05:32.604442'),
('2d9c79c7-1a19-497d-9942-58c31bc5a045', 'When a friend is in trouble, don''t annoy him by asking if there is anything you can do. Think up something appropriate and do it.', '01928852-67dd-7a74-974a-ff18d1f489bd', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:33.582682', '2024-10-14 00:05:33.582682'),
('2da789a6-db28-469b-8095-f750b5fcbf4a', 'There are two primary choices in life: to accept conditions as they exist or accept responsibility for changing them.', '01928852-6b3c-7b7e-b9d1-0ec52c690e37', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.60575', '2024-10-14 00:05:33.60575'),
('2df2b335-a9a5-4f1e-b538-9516460b635d', 'Optimism is the faith that leads to achievement. Nothing can be done without hope and confidence.', '01928852-6e68-7e82-b1a6-7a4567140254', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:26.77586', '2024-10-14 00:05:26.77586'),
('2e6527dd-0951-468e-bfde-2e03a2cb79e0', 'Quick decisions are unsafe decisions.', '01928852-7571-7f1c-90a4-db4bf8cb4038', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.464108', '2024-10-14 00:05:34.464108'),
('2e929cd5-8556-4859-9896-dd413e4e4648', 'You can''t win unless you learn how to lose.', '01928852-7109-7b25-81cc-e3466c15202e', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.796746', '2024-10-14 00:04:43.796746'),
('2e9f5f46-e5fe-4910-b713-30068e7cc717', 'The superior man is satisfied and composed; the mean man is always full of distress.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.943357', '2024-10-14 00:05:29.943357'),
('2eb601da-0a89-4a19-9af8-e5898168d8f3', 'We''ve got to have a dream if we are going to make a dream come true.', '01928852-7724-71bb-b5fd-e792995c18d5', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.559133', '2024-10-14 00:05:34.559133'),
('2eb9c584-a965-4ddc-b1d2-db2cb1c8eb09', 'There are basically two types of people. People who accomplish things, and people who claim to have accomplished things. The first group is less crowded.', '01928852-72a3-779c-ab93-ce6393452d73', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.17007', '2024-10-14 00:05:35.17007'),
('2eba8632-3544-407b-b9bc-f8c197636a3b', 'Friendship is one of our most treasured relationships, but it isn''t codified and celebrated; it''s never going to give you a party.', '01928852-6d5b-7022-9d61-9c067d54e809', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:26.036412', '2024-10-14 00:05:26.036412'),
('2ec482c5-eb2d-4751-a171-e57bef9322be', 'Discipline is the bridge between goals and accomplishment.', '01928852-6f51-7fee-bdb9-d6147817832c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.635385', '2024-10-14 00:05:34.635385'),
('2ee355c9-bc7a-48c6-a130-ce72667b1172', 'In dwelling, live close to the ground. In thinking, keep to the simple. In conflict, be fair and generous. In governing, don''t try to control. In work, do what you enjoy. In family life, be completely present.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.851505', '2024-10-14 00:05:35.851505'),
('2ef4d126-4974-41f6-ae8a-85e05b42e701', 'When we seek to discover the best in others, we somehow bring out the best in ourselves.', '01928852-7754-7ec1-967c-e752177f3b43', '{famous-quotes,friendship,self-help}', NULL, 't', 'f', '2024-10-14 00:05:27.109971', '2024-10-14 00:05:27.109971'),
('2f0a90f7-0b64-4a9e-bc2d-1e28c6ce6d72', 'I''m a great believer in luck and I find the harder I work, the more I have of it.', '01928852-76c9-7011-8399-cc2c7c075bec', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.954304', '2024-10-14 00:05:27.954304'),
('2f158189-ad7d-4947-839d-0e3f93945833', 'There is a wisdom of the head, and a wisdom of the heart.', '01928852-6abc-768d-9a4a-bf7f6d36afc1', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.195019', '2024-10-14 00:05:29.195019'),
('2f285039-35ab-4d33-a197-fea6503379ed', 'We must reach out our hand in friendship and dignity both to those who would befriend us and those who would be our enemy.', '01928852-68bd-71c9-9320-2caa3c61880c', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:27.345122', '2024-10-14 00:05:27.345122'),
('2f4dc1a5-805a-459e-aba5-872a8ce60b6d', 'Work while you have the light. You are responsible for the talent that has been entrusted to you.', '01928852-6e7a-783f-b5b8-e0e4ed07c39c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.826336', '2024-10-14 00:05:27.826336'),
('2f6e6712-c766-404f-a2a0-79efd004ed24', 'All our knowledge begins with the senses, proceeds then to the understanding, and ends with reason. There is nothing higher than reason.', '01928852-6ed8-7607-9314-e75a0eff1d17', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.011976', '2024-10-14 00:05:34.011976'),
('2f7fec10-cd69-4b3b-ae46-6b4bc1846a1b', 'Sorrow is knowledge, those that know the most must mourn the deepest, the tree of knowledge is not the tree of life.', '01928852-715e-7538-8a2d-a4899d8e814c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.570245', '2024-10-14 00:05:32.570245'),
('2fab838f-e502-4b37-94b9-f7c906bbbc43', 'Great ideas often receive violent opposition from mediocre minds.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{famous-quotes,technology}', NULL, 't', 'f', '2024-10-14 00:05:35.252711', '2024-10-14 00:05:35.252711'),
('2fac29c2-ec83-41fb-a486-a8271031d4c6', 'How many cares one loses when one decides not to be something but to be someone.', '01928852-6af5-7465-9205-6679935ab414', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.443339', '2024-10-14 00:05:36.443339'),
('2fe0a593-288a-4a6e-86a9-572fc9a7e65a', 'People grow through experience if they meet life honestly and courageously. This is how character is built.', '01928852-6c92-7a6b-a6bb-78c31b86df98', '{character}', NULL, 't', 'f', '2024-10-14 00:05:37.174818', '2024-10-14 00:05:37.174818'),
