('302f4ed3-d6d9-4994-8a35-f187d5586088', 'Everyone has been made for some particular work, and the desire for that work has been put in every heart.', '01928852-751e-7ba4-bbc6-9f9044390793', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.991072', '2024-10-14 00:05:36.991072'),
('3061c462-bcb3-41e8-8c2f-9fbf7fbc08b7', 'Anyone who doesn''t take truth seriously in small matters cannot be trusted in large ones either.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.711853', '2024-10-14 00:05:31.711853'),
('30e4d064-36bc-43a9-ae6a-641e946d8845', 'Beginning today, treat everyone you meet as if they were going to be dead by midnight. Extend to them all the care, kindness and understanding you can muster, and do it with no thought of any reward. Your life will never be the same again.', '01928852-7343-78c7-9517-53ef98ff7f51', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:29.968431', '2024-10-14 00:05:29.968431'),
('31071890-b4ff-46f8-baf7-475de4e40afd', 'When the world is so complicated, the simple gift of friendship is within all of our hands.', '01928852-728a-7793-a4f1-394295f12ad3', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:32.291605', '2024-10-14 00:05:32.291605'),
('312c8fb0-2327-4304-8e14-b2f512a86b11', 'Wisdom has its root in goodness, not goodness its root in wisdom.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.057111', '2024-10-14 00:05:26.057111'),
('314fa7d4-d41e-4c56-9079-e257d8006296', 'Reading, after a certain age, diverts the mind too much from its creative pursuits. Any man who reads too much and uses his own brain too little falls into lazy habits of thinking.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{education}', NULL, 't', 'f', '2024-10-14 00:04:42.800145', '2024-10-14 00:04:42.800145'),
('315996f0-7010-4828-a921-b60ea623947d', 'Never bend your head. Always hold it high. Look the world right in the eye.', '01928852-6e68-7e82-b1a6-7a4567140254', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.014289', '2024-10-14 00:05:31.014289'),
('3162bb9c-dda7-4a4f-9350-ff97231725f1', 'When I let go of what I am, I become what I might be.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.664271', '2024-10-14 00:05:27.664271'),
('3170be6f-071c-41a6-b96d-5ec10750c052', 'The amount of happiness that you have depends on the amount of freedom you have in your heart.', '01928852-76a2-7c33-a980-dc54938dc8d2', '{freedom}', NULL, 't', 'f', '2024-10-14 00:05:33.200089', '2024-10-14 00:05:33.200089'),
('3193ea4f-f21b-4d04-bfb0-8d1dc902dfdf', 'Be Impeccable with Your Word. Speak with integrity. Say only what you mean. Avoid using the word to speak against yourself or to gossip about others. Use the power of your word in the direction of truth and love.', '01928852-6b4c-70f5-a2da-8510d7045a12', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:35.334793', '2024-10-14 00:05:35.334793'),
('31a4df1f-2428-4515-90b0-273d1d2104c7', 'Faith, as well intentioned as it may be, must be built on facts, not fiction--faith in fiction is a damnable false hope.', '01928852-76b7-746d-ac06-f2d9547d384b', '{religion}', NULL, 't', 'f', '2024-10-14 00:04:42.67505', '2024-10-14 00:04:42.67505'),
('31c0c42f-fb53-4d05-9df8-e06a15c54d9d', 'It is unwise to be too sure of one''s own wisdom. It is healthy to be reminded that the strongest might weaken and the wisest might err.', '01928852-7177-7e3a-83fb-11ff0731979c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.713052', '2024-10-14 00:05:29.713052'),
('31e79f38-6731-47c1-82f0-db85247ed22c', 'Of all possessions a friend is the most precious.', '01928852-6eb4-79bf-8978-eed35673e96e', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:27.078497', '2024-10-14 00:05:27.078497'),
('31f43939-1569-439f-9a3d-9d43dbedddab', 'The least movement is of importance to all nature. The entire ocean is affected by a pebble.', '01928852-6934-7c5a-a71f-65849702aff4', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.379694', '2024-10-14 00:05:34.379694'),
('32310ce4-b0e0-48cd-8f5c-4196c034b242', 'You''ve got to go out on a limb sometimes because that''s where the fruit is.', '01928852-774e-7073-baf6-c0da77bed554', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.913345', '2024-10-14 00:05:35.913345'),
('323827fd-af50-483a-97bf-67fbd871bcf2', 'Beauty is not in the face; beauty is a light in the heart.', '01928852-7107-7406-9ddd-aa4185419e20', '{life}', NULL, 't', 'f', '2024-10-14 00:05:37.005031', '2024-10-14 00:05:37.005031'),
('324edf07-336e-4f08-8e51-ba693536d39c', 'I had three chairs in my house; one for solitude, two for friendship, three for society.', '01928852-6e80-74e5-9876-70d42cdf42c4', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:35.187255', '2024-10-14 00:05:35.187255'),
('328113ce-b82d-41bc-9744-5e5b03da01dd', 'A good head and a good heart are always a formidable combination.', '01928852-7323-70bd-82a2-4f5d1f1dde9a', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.511757', '2024-10-14 00:05:28.511757'),
