('3291d5a3-cbb1-4e5a-a4ed-c9b5eaad72fe', 'Life a culmination of the past, an awareness of the present, an indication of the future beyond knowledge, the quality that gives a touch of divinity to matter.', '01928852-6acd-7b96-979e-50f0d773b80e', '{future,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.443613', '2024-10-14 00:05:28.443613'),
