('38f97a23-a290-4ea4-b50c-00532559d33f', 'Do good by stealth, and blush to find it fame.', '01928852-684b-7591-b6df-3f12c4a750d1', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.636337', '2024-10-14 00:05:28.636337'),
