('3949e5d8-48fe-42e1-8808-35021ae2b659', 'There is no retirement for an artist, it''s your way of living so there is no end to it.', '01928852-6e96-7b16-bd8d-909c64c1c912', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.22979', '2024-10-14 00:05:31.22979'),
