('39633a58-ffdf-44f5-8e5a-fe43c24954ed', 'Sometimes our fate resembles a fruit tree in winter. Who would think that those branches would turn green again and blossom, but we hope it, we know it.', '01928852-6f6e-72a3-82ea-f8859e323434', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.666413', '2024-10-14 00:05:29.666413'),
