('397b9190-1908-4f11-97c9-c6febf777f13', 'Divide each difficulty into as many parts as is feasible and necessary to resolve it.', '01928852-74d7-75f4-8e0a-4aa4c05223c6', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.594986', '2024-10-14 00:05:33.594986'),
('3997b595-87d7-4881-87c3-ad4b63958894', 'He is no fool who gives what he cannot keep to gain what he cannot lose.', '01928852-6f4c-7cac-a516-6c11adf949f4', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.72557', '2024-10-14 00:05:26.72557'),
