('3a9c8f49-0d89-436c-ad5c-9371abef3e69', 'To have much learning and skill, to be well-trained in discipline, and good in speech — this is the highest blessing.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.432917', '2024-10-14 00:05:36.432917'),
