('3add5669-2fe6-4495-ab75-d4f57da6c07f', 'Appreciation is the highest form of prayer, for it acknowledges the presence of good wherever you shine the light of your thankful thoughts.', '01928852-682c-7eac-aee4-e5bb55969901', '{famous-quotes,faith}', NULL, 't', 'f', '2024-10-14 00:05:36.524682', '2024-10-14 00:05:36.524682'),
('3ade9202-0a60-41ae-a5dc-11f2fed6df8d', 'Friendship improves happiness and abates misery, by the doubling of our joy and the dividing of our grief.', '01928852-6af0-792f-a520-9a06cb1ad7f7', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:35.572342', '2024-10-14 00:05:35.572342'),
('3b067f6a-2f40-43f8-889a-6392fd22322c', 'The smallest act of kindness is worth more than the grandest intention.', '01928852-7350-73ef-8896-8295114c7610', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.148217', '2024-10-14 00:05:33.148217'),
('3b25d0b4-8f50-45d2-802e-62eb8163f39e', 'Notice that the stiffest tree is most easily cracked, while the bamboo or willow survives by bending with the wind.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.167863', '2024-10-14 00:05:29.167863'),
('3b38057b-bc6b-4a68-85f9-c8c640e75e0a', 'The way we communicate with others and with ourselves ultimately determines the quality of our lives.', '01928852-76ed-7661-a537-c3978973ac97', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.212976', '2024-10-14 00:05:36.212976'),
('3b384a3d-5c7c-4d6a-a597-6541867261ad', 'The way you see people is the way you treat them, and the way you treat them is what they become.', '01928852-6f6e-72a3-82ea-f8859e323434', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.990071', '2024-10-14 00:05:28.990071'),
('3b68d6d3-4e43-4f29-bb0b-101f77c205fa', 'Three things cannot be long hidden: the sun, the moon, and the truth.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.313159', '2024-10-14 00:05:32.313159'),
('3b73e921-f29e-4f3f-b8af-d91f6008b657', 'The moment one gives close attention to anything, it becomes a mysterious, awesome, indescribably magnificent world in itself.', '01928852-6e92-7177-866e-c0a7c8f86f2b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.762905', '2024-10-14 00:05:31.762905'),
('3b9a4cd0-2224-4aea-8b66-819959173a77', 'There is only one success - to be able to spend your life in your own way.', '01928852-6ae6-7917-bf90-4b26c7dc5cdb', '{success,life}', NULL, 't', 'f', '2024-10-14 00:05:32.277622', '2024-10-14 00:05:32.277622'),
('3bef9edc-a0ba-4c7e-8e9b-e9756322aa97', 'Ignorance and bungling with love are better than wisdom and skill without.', '01928852-6e80-74e5-9876-70d42cdf42c4', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.346454', '2024-10-14 00:05:26.346454'),
