('3c1d0111-616f-4b20-bc50-06be9ae2bf56', 'Perfection of means and confusion of ends seems to characterize our age.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{humorous}', NULL, 't', 'f', '2024-10-14 00:04:42.806259', '2024-10-14 00:04:42.806259'),
('3c329d2e-ec6c-47d3-9754-f97221e4f1ef', 'The three great essentials to achieve anything worthwhile are: Hard work, Stick-to-itiveness, and Common sense.', '01928852-76b7-746d-ac06-f2d9547d384b', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.037926', '2024-10-14 00:05:37.037926');
