('3cfe1e0a-62c8-4476-8dfd-5d135eac0802', 'The more you like yourself, the less you are like anyone else, which makes you unique.', '01928852-7724-71bb-b5fd-e792995c18d5', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.432811', '2024-10-14 00:05:27.432811'),
('3d0d734b-7d96-4e53-9e2c-e88c6b7bfc1f', 'There is no charm equal to tenderness of heart.', '01928852-6f17-7d58-a03d-e8d78e506931', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.599703', '2024-10-14 00:05:28.599703'),
('3d53c2c4-b27c-49f8-a55e-b085e12e05de', 'Nothing is softer or more flexible than water, yet nothing can resist it.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.242347', '2024-10-14 00:05:34.242347'),
