('3d692283-9707-486d-a5b0-76a0a52a24e2', 'Imagination is more important than knowledge. For while knowledge defines all we currently know and understand, imagination points to all we might yet discover and create.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{famous-quotes,technology,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.754887', '2024-10-14 00:05:29.754887'),
('3d826e1a-8a8b-45d1-a776-0ef3d43b8b12', 'People don''t notice whether it''s winter or summer when they''re happy.', '01928852-68ae-757a-a935-540429953998', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.020615', '2024-10-14 00:05:35.020615'),
('3db7e93a-e9cf-4965-9c52-96272d0fb53e', 'Be your own hero, it''s cheaper than a movie ticket.', '01928852-6b5a-7e21-a84f-354b0c2fed90', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.518272', '2024-10-14 00:05:36.518272'),
('3db8b3a6-f419-4b0f-9cb4-a94af10057fb', 'Sometimes the most important thing in a whole day is the rest we take between two deep breaths.', '01928852-6ccb-7ac2-95d4-f7ec288b368a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.530561', '2024-10-14 00:05:34.530561'),
