('3e7442da-e5ed-42ae-a511-eb1ee9a99224', 'Act as if what you do makes a difference. It does.', '01928852-7770-7ab7-a0dd-ca218884ec26', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.470898', '2024-10-14 00:05:32.470898'),
('3ed27be5-6f38-4c4a-b9e4-2e6f3f1a94f0', 'Wisdom begins in wonder.', '01928852-756a-7fd4-b16a-01ad0d140de2', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.707453', '2024-10-14 00:05:31.707453'),
('3ed5b941-4e21-4313-8427-5d714e2f108f', 'Some do not understand that we must die, But those who do realize this settle their quarrels.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,life}', NULL, 't', 'f', '2024-10-14 00:04:43.413786', '2024-10-14 00:04:43.413786'),
('3f2b8b09-4f9f-4580-8674-7f349897b556', 'I am not bothered by the fact that I am unknown. I am bothered when I do not know others.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.751986', '2024-10-14 00:05:31.751986'),
