('3f457ca7-858e-4293-baf5-f6518c5fe370', 'The only way to prove that you''re a good sport is to lose.', '01928852-6cc8-76d2-a748-de520c3ff935', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.486317', '2024-10-14 00:04:43.486317'),
('3f6c5cf5-f4ae-437a-a559-f97a95680604', 'The fall of dropping water wears away the Stone.', '01928852-7170-791c-824a-6347ec051293', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.241473', '2024-10-14 00:05:33.241473'),
('3f958a92-3bd0-476b-91da-1ebf2aea341a', 'Sometimes being a friend means mastering the art of timing. There is a time for silence. A time to let go and allow people to hurl themselves into their own destiny. And a time to prepare to pick up the pieces when it''s all over.', '01928852-7341-7adb-ad44-3f829bfe1116', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:29.871407', '2024-10-14 00:05:29.871407'),
('3f967d50-e35e-4f13-ad4a-d23256914537', 'To succeed, we must first believe that we can.', '01928852-72d9-7d1d-b6cf-0d6d121d3aff', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.514128', '2024-10-14 00:05:33.514128'),
('3fa12b78-55ca-418c-8df0-c7b2dac4482b', 'When fate hands us a lemon, let''s try to make lemonade.', '01928852-6b0e-77ca-bc5d-cd5da36bf700', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.980814', '2024-10-14 00:05:36.980814'),
('3fb08736-1cf1-4b8e-834b-7f127d896f2e', 'Friendship... is not something you learn in school. But if you haven''t learned the meaning of friendship, you really haven''t learned anything.', '01928852-730b-749c-9143-9aa109b3a0e8', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:30.936635', '2024-10-14 00:05:30.936635'),
