('3ff732d1-0ea0-4a23-ab9f-35398cbe881e', 'The world is but a canvas to the imagination.', '01928852-6e80-74e5-9876-70d42cdf42c4', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.450344', '2024-10-14 00:05:32.450344'),
('40044c2e-3f7f-40f7-b2bf-e77353be4856', 'Never, never, never give up.', '01928852-778a-7b63-b73f-e0042755dd2e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.903608', '2024-10-14 00:05:36.903608'),
('401728f2-ff2b-42a1-a28a-156b22983d54', 'In every walk with nature, one receives far more than he seeks.', '01928852-70ae-7962-85df-7423c98ee6fd', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.008641', '2024-10-14 00:05:35.008641'),
