('5279dbb5-fb15-4fac-b1d7-087e3879f54c', 'As a water bead on a lotus leaf, as water on a red lily, does not adhere, so the sage does not adhere to the seen, the heard, or the sensed.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,philosophy}', NULL, 't', 'f', '2024-10-14 00:04:42.994752', '2024-10-14 00:04:42.994752'),
