('52afeb93-b056-4ff9-b001-462f669a2409', 'Men in general judge more from appearances than from reality. All men have eyes, but few have the gift of penetration.', '01928852-7326-71b7-a7cc-e83995a8954d', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.542063', '2024-10-14 00:05:28.542063'),
