('53d01a56-a85a-48a0-8111-97d520a6ace3', 'We will develop and cultivate the liberation of mind by lovingkindness, make it our vehicle, make it our basis, stabilize it, exercise ourselves in it, and fully perfect it.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,love}', NULL, 't', 'f', '2024-10-14 00:04:42.97654', '2024-10-14 00:04:42.97654'),
