('6414b0c3-72ac-4ab4-a24a-e066481e7380', 'It''s just a job. Grass grows, birds fly, waves pound the sand. I beat people up.', '01928852-730b-749c-9143-9aa109b3a0e8', '{sports}', NULL, 't', 'f', '2024-10-14 00:04:43.71687', '2024-10-14 00:04:43.71687'),
