('65ba770e-0eeb-4f3e-b1b8-e34e33710a35', 'One needs something to believe in, something for which one can have whole-hearted enthusiasm. One needs to feel that one''s life has meaning, that one is needed in this world.', '01928852-6d58-7250-88c1-c46aed96ec1d', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.388492', '2024-10-14 00:05:30.388492'),
