('66dad9f4-736e-4206-aa3f-0880328f3ee5', 'Each man has his own vocation; his talent is his call. There is one direction in which all space is open to him.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.539801', '2024-10-14 00:05:30.539801'),
