('79e3bf81-6c60-4ee5-b03c-6ddc718a5bc5', 'I won''t close down a business of subnormal profitability merely to add a fraction of a point to our corporate returns. I also feel it inappropriate for even an exceptionally profitable company to fund an operation once it appears to have unending losses in prospect. Adam Smith would disagree with my first proposition and Karl Marx would disagree with my second; the middle ground is the only position that leaves me comfortable.', '01928852-773b-7553-92eb-3fdb88846bc3', '{}', NULL, 't', 'f', '2024-10-14 00:04:42.849999', '2024-10-14 00:04:42.849999'),
('79f9dbac-b66e-442b-9817-af93d4ee84a4', 'The noblest worship is to make yourself as good and as just as you can.', '01928852-6ee7-73ce-9b5f-b721184f9ba2', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.599245', '2024-10-14 00:05:29.599245'),
('7a0475a7-d5aa-40ce-ab01-f1e0c40db0f4', 'I don''t believe in failure. It''s not failure if you enjoyed the process.', '01928852-734a-7d5e-9d80-a55b35905931', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.074958', '2024-10-14 00:05:35.074958'),
('7a06c061-e58d-44bf-af20-fab4493e2f33', 'A day of worry is more exhausting than a day of work.', '01928852-70a0-7242-80cf-b515a6ded032', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.793552', '2024-10-14 00:05:33.793552'),
('7a4b8ae5-4e0f-49a5-b232-588ca811a501', 'Friendship, like the immortality of the soul, is too good to be believed.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:29.784619', '2024-10-14 00:05:29.784619'),
('7a5df8a7-373a-4e05-a5c3-e96f30e6760e', 'Bodily exercise, when compulsory, does no harm to the body; but knowledge which is acquired under compulsion obtains no hold on the mind.', '01928852-7495-7bbb-8c71-fb1111ec3bdf', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.652822', '2024-10-14 00:05:35.652822'),
('7a6566dc-ff92-48fc-880b-1abb9e4140f1', 'I''m not in this world to live up to your expectations and you''re not in this world to live up to mine.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.05368', '2024-10-14 00:05:26.05368'),
('7a72e283-24ae-4b1b-9fca-a2b5e295f7d4', 'Criticism is something you can easily avoid by saying nothing, doing nothing, and being nothing.', '01928852-68b3-7125-bd4b-b18bd987836b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.162113', '2024-10-14 00:05:31.162113'),
('7a7449cd-3831-4908-977a-22b1c56c2c14', 'Good actions give strength to ourselves and inspire good actions in others.', '01928852-7495-7bbb-8c71-fb1111ec3bdf', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.140975', '2024-10-14 00:05:27.140975');
INSERT INTO "public"."quotes" ("id", "content", "author_id", "categories_slug", "bible_reference", "active", "verified", "created_at", "updated_at") VALUES
('7a7bcdc6-c78d-4970-826c-3d967693fe9e', 'The cause is hidden. The effect is visible to all.', '01928852-7352-701e-936e-f953a1185478', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.524637', '2024-10-14 00:05:30.524637'),
('7a858075-5c91-4da3-8464-72ba7fd3f637', 'Between saying and doing, many a pair of shoes is worn out.', '01928852-6edf-7665-a6b2-c0ebb2c5aa1e', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.223918', '2024-10-14 00:05:36.223918'),
('7a99b39b-be0e-402b-bdb3-880606a7a2c1', 'Don''t believe what your eyes are telling you. All they show is limitation. Look with your understanding, find out what you already know, and you''ll see the way to fly.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.913389', '2024-10-14 00:05:27.913389'),
('7a9bc2da-08fa-4830-8bca-0094bf3df382', 'Know how to listen, and you will profit even from those who talk badly.', '01928852-74a0-7141-8ad0-533813297501', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.672285', '2024-10-14 00:05:34.672285'),
('7aaab055-209e-43bd-81d8-cbc34064cbf4', 'They blame those who remain silent, they blame those who speak much, they blame those who speak in moderation. There is none in the world who is not blamed.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:04:43.073373', '2024-10-14 00:04:43.073373'),
('7ac2134d-cf7a-4891-81d8-45dafe478302', 'If you''ll not settle for anything less than your best, you will be amazed at what you can accomplish in your lives.', '01928852-770d-757d-8ad9-6eab16a7b24b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.998972', '2024-10-14 00:05:28.998972'),
('7aced30e-6cd1-42d1-96ba-0fa911de6128', 'For beautiful eyes, look for the good in others; for beautiful lips, speak only words of kindness; and for poise, walk with the knowledge that you are never alone.', '01928852-68e3-765f-ba17-61b341cde050', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.1774', '2024-10-14 00:05:29.1774'),
('7ad3694f-7e3e-4eae-a8a8-4ef764dac382', 'If you seek truth, you will not seek victory by dishonorable means, and if you find truth you will become invincible.', '01928852-6cb6-7e88-84e6-88b53db6a61e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.109543', '2024-10-14 00:05:29.109543'),
('7aef5f54-7f27-4e14-954a-ed5b74a85ce6', 'Difficulties are meant to rouse, not discourage. The human spirit is to grow strong by conflict.', '01928852-7765-74b1-b9f9-523937474d42', '{famous-quotes,inspirational,power-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.965532', '2024-10-14 00:05:29.965532'),
('7af8dd6e-6049-4049-9b9b-796bfcec8009', 'Motivation is the art of getting people to do what you want them to do because they want to do it.', '01928852-6b6a-72ad-8238-85ef3b228761', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:31.885374', '2024-10-14 00:05:31.885374'),
('7b09ba8d-2ebb-4b79-88ec-a4e4417e0af4', 'Were here for a reason. I believe a bit of the reason is to throw little torches out to lead people through the dark.', '01928852-7749-73c2-be81-ecc904b3ab2d', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.95953', '2024-10-14 00:05:30.95953'),
('7b18b65b-fdd1-4246-9405-3252dd38c748', 'A noble one produces an abundance of merit by having a compassionate mind towards all living beings.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,love}', NULL, 't', 'f', '2024-10-14 00:04:43.099749', '2024-10-14 00:04:43.099749'),
('7b6dd5fb-7713-4741-b0b1-e8ebd3f57807', 'But what is liberty without wisdom, and without virtue? It is the greatest of all possible evils; for it is folly, vice, and madness, without tuition or restraint.', '01928852-6c79-74fd-93ec-3d60d24759c1', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.585569', '2024-10-14 00:05:31.585569'),
('7b73db69-945f-46c5-9630-6c8c6106ca89', 'To choose what is difficult all one''s days, as if it were easy, that is faith.', '01928852-7721-7b17-8c87-5e8d0dfd64a9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.569591', '2024-10-14 00:05:33.569591'),
('7bf23172-a054-4b9d-a012-801934784d73', 'Courage is rightly esteemed the first of human qualities... because it is the quality which guarantees all others.', '01928852-778a-7b63-b73f-e0042755dd2e', '{courage}', NULL, 't', 'f', '2024-10-14 00:05:25.236152', '2024-10-14 00:05:25.236152'),
('7c06ef49-4b2c-4947-a0db-37e681557a73', 'No distance of place or lapse of time can lessen the friendship of those who are thoroughly persuaded of each other''s worth.', '01928852-7505-7e83-b1a5-8e4389d004c8', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:35.059064', '2024-10-14 00:05:35.059064'),
('7c17c3bb-0ef1-44ab-93e0-888a0005cebf', 'I want my friend to miss me as long as I miss him.', '01928852-68e6-7883-b658-c2333e80ec26', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:35.263717', '2024-10-14 00:05:35.263717'),
('7c423b7b-2ba2-47ff-b22c-534174adeda4', 'Moral excellence comes about as a result of habit. We become just by doing just acts, temperate by doing temperate acts, brave by doing brave acts.', '01928852-68b3-7125-bd4b-b18bd987836b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.999268', '2024-10-14 00:05:33.999268'),
('7c744a20-813d-49ab-9b5d-310659d7abfc', 'Life''s challenges are not supposed to paralyze you, they''re supposed to help you discover who you are.', '01928852-6919-7332-b447-0f202ee69e3e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.846616', '2024-10-14 00:05:29.846616'),
('7c9c495e-65f9-45df-b617-8ffeab35b245', 'All know the way; few actually walk it.', '01928852-6a39-7d74-bc5a-cfcddfb4600b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.727678', '2024-10-14 00:05:31.727678'),
('7cba9b9f-b715-4c0d-b644-4aeb420be05e', 'Once you label me you negate me.', '01928852-7574-74e3-bfeb-73a6517ad59b', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.17283', '2024-10-14 00:05:29.17283'),
('7cbd53bb-0309-4ce0-ba12-b09ccb53feef', 'All I can say about life is, Oh God, enjoy it!', '01928852-6942-75a2-9f5c-08deca8c0dca', '{life}', NULL, 't', 'f', '2024-10-14 00:05:33.972482', '2024-10-14 00:05:33.972482'),
('7cdc305c-cb5f-4c4d-8182-2cd0045f8d56', 'I hear and I forget. I see and I remember. I do and I understand.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.696408', '2024-10-14 00:05:26.696408'),
('7cf3a7e0-629f-454b-acb6-671d000c7763', 'You might well remember that nothing can bring you success but yourself.', '01928852-7319-70d7-9011-72c190bdd6f0', '{success}', NULL, 't', 'f', '2024-10-14 00:05:26.481997', '2024-10-14 00:05:26.481997'),
('7d17fe58-dc1c-44db-a17c-c0a254c1a8c6', 'Friendship is an arrangement by which we undertake to exchange small favors for big ones.', '01928852-72fc-7769-abf8-628e4acf833a', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:31.703209', '2024-10-14 00:05:31.703209'),
('7d42f087-022e-47f6-849a-f2477f88410a', 'Our work is the presentation of our capabilities.', '01928852-6c85-71ef-b81e-e28f6ebe58c0', '{business}', NULL, 't', 'f', '2024-10-14 00:04:43.800002', '2024-10-14 00:04:43.800002'),
('7d437374-9148-4255-bb35-c538ee170787', 'Faith in oneself is the best and safest course.', '01928852-72e0-771a-8532-f73f9ea6d5b9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.677288', '2024-10-14 00:05:28.677288'),
('7d7a787a-3a74-457e-a106-b753615efe88', 'Love is blind; friendship closes its eyes.', '01928852-6cff-7025-b670-d40866a1d990', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:31.138328', '2024-10-14 00:05:31.138328'),
('7dbb827a-b9d3-4f1f-8151-2d4d6300c854', 'The weak can never forgive. Forgiveness is the attribute of the strong.', '01928852-7177-7e3a-83fb-11ff0731979c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.316104', '2024-10-14 00:05:35.316104'),
('7ded06d5-d023-40ca-ade9-22d0eb5d037c', 'Let the future tell the truth and evaluate each one according to his work and accomplishments. The present is theirs; the future, for which I have really worked, is mine.', '01928852-732c-721a-b5d3-b5ebc3a323af', '{future,famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.612821', '2024-10-14 00:05:33.612821'),
('7dee8d55-8ccd-4d3e-900f-b6a7188d64be', 'Don''t judge each day by the harvest you reap but by the seeds that you plant.', '01928852-74fd-727e-97d2-c98874aae563', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.649437', '2024-10-14 00:05:33.649437'),
('7dfb7d20-33f1-46db-94de-35c08103b8d0', 'To lead people walk behind them.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.252363', '2024-10-14 00:05:30.252363'),
('7e027cd2-796e-4a15-b92e-9179e5c22351', 'Experts on romance say for a happy marriage there has to be more than a passionate love. For a lasting union, they insist, there must be a genuine liking for each other. Which, in my book, is a good definition for friendship.', '01928852-729a-70f1-a61e-d1c3ba8b90c6', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:33.901218', '2024-10-14 00:05:33.901218'),
('7e4b5de1-61a1-4f84-a21a-a465e95cb21e', 'Do not be too timid and squeamish about your reactions. All life is an experiment. The more experiments you make the better.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.357647', '2024-10-14 00:05:36.357647'),
('7e4fc5d2-bac6-485d-9cbc-040055e375df', 'Friendship needs no words - it is solitude delivered from the anguish of loneliness.', '01928852-6b06-7101-ae5e-6617f9d00540', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:26.770584', '2024-10-14 00:05:26.770584'),
('7e5afe0c-0c2d-42de-866b-1735f91f4402', 'The greatest obstacle to connecting with our joy is resentment.', '01928852-7466-7e60-a399-6cf4813bb052', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.446015', '2024-10-14 00:05:30.446015'),
('7e6564d2-14cc-4966-b926-db079afdde88', 'Yesterday''s home runs don''t win today''s games.', '01928852-68f2-74b9-819f-df2b779442ed', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.021637', '2024-10-14 00:05:26.021637'),
('7e8a5bd5-7606-4da0-913b-9800c96245e8', 'You can only grow if you''re willing to feel awkward and uncomfortable when you try something new.', '01928852-6a4b-7890-863c-53107229ddee', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.30655', '2024-10-14 00:05:36.30655'),
('7e9dd2f4-f7e0-42b8-8e95-2931560f6f72', 'Autumn is a second spring when every leaf is a flower.', '01928852-6833-7961-9730-7b88ca9964db', '{famous-quotes,nature}', NULL, 't', 'f', '2024-10-14 00:05:33.214344', '2024-10-14 00:05:33.214344'),
('7ea665fa-185c-44ed-9433-8bab1c7ddfff', 'To conquer fear is the beginning of wisdom.', '01928852-691b-7c11-9520-ccf422538662', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.357308', '2024-10-14 00:05:32.357308'),
('7f28a8d2-68db-424d-8b2b-49e23133ead6', 'Success is getting what you want. Happiness is wanting what you get.', '01928852-6b0e-77ca-bc5d-cd5da36bf700', '{happiness}', NULL, 't', 'f', '2024-10-14 00:05:27.881901', '2024-10-14 00:05:27.881901'),
('7f2a64ba-6770-4f94-8f69-6e65ed1e0396', 'Stay away from what might have been and look at what will be.', '01928852-72a6-7ea9-9784-d12bbf652701', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.125914', '2024-10-14 00:05:31.125914'),
('7f31a0ca-58b3-41ae-ab2b-33ae8dc5155e', 'Science investigates; religion interprets. Science gives man knowledge which is power; religion gives man wisdom which is control.', '01928852-72ab-7ffe-b42e-3dfa401825b9', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.829357', '2024-10-14 00:05:36.829357'),
('7fcdf21c-6cd3-4fab-bc6c-40ca4434a6fb', 'Few people are capable of expressing with equanimity opinions which differ from the prejudices of their social environment. Most people are even incapable of forming such opinions.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{society}', NULL, 't', 'f', '2024-10-14 00:04:42.725778', '2024-10-14 00:04:42.725778'),
('7fce190b-0164-4e3f-86bc-09169337d8a6', 'Happiness mainly comes from our own attitude, rather than from external factors.', '01928852-6b0b-786b-8dd4-995ae2eb3355', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.511639', '2024-10-14 00:05:30.511639'),
('7fd69cbe-e926-4924-a797-83be6148b997', 'The greatest way to live with honor in this world is to be what we pretend to be.', '01928852-756a-7fd4-b16a-01ad0d140de2', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.3537', '2024-10-14 00:05:27.3537'),
('7fd6c545-b9d2-4185-9180-e22044d09e31', 'Nature takes away any faculty that is not used.', '01928852-776d-7fa0-b9ab-ef6bcc4002c8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.395332', '2024-10-14 00:05:28.395332'),
('7fd85158-c660-499a-a931-ae777c2d16eb', 'If the stars should appear but one night every thousand years how man would marvel and adore.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.658387', '2024-10-14 00:05:28.658387'),
('8022347c-3ab2-454f-8c6d-7a314b476e5b', 'It does not matter how slowly you go as long as you do not stop.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:36.287139', '2024-10-14 00:05:36.287139'),
('80381a8b-4693-420d-ba5e-b6ca5030d945', 'Without hard work, nothing grows but weeds.', '01928852-6d39-78da-90ff-f8e6c1b97402', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:29.692857', '2024-10-14 00:05:29.692857'),
('806950da-8f3a-4bef-9541-b6bb224d201d', 'Do all things with love.', '01928852-7343-78c7-9517-53ef98ff7f51', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.589389', '2024-10-14 00:05:33.589389'),
('807fe7d9-e72c-44a0-9dda-3d61e36c01c2', 'Only two things are infinite, the universe and human stupidity, and I''m not sure about the former.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{stupidity}', NULL, 't', 'f', '2024-10-14 00:04:42.710243', '2024-10-14 00:04:42.710243'),
('80ad7a05-5fa4-4f75-af0f-ca902a9e105c', 'It is far better to be alone, than to be in bad company.', '01928852-6d2a-7f6c-ac13-5797dd10ef25', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.436854', '2024-10-14 00:05:34.436854'),
('80bcdf45-0ae6-46be-9792-e16cefddffef', 'When I was 40, my doctor advised me that a man in his 40s shouldn''t play tennis. I heeded his advice carefully and could hardly wait until I reached 50 to start again.', '01928852-6ecf-7b49-8ac4-f34dcdaf507f', '{sports,humorous}', NULL, 't', 'f', '2024-10-14 00:04:43.67301', '2024-10-14 00:04:43.67301'),
('80e249c6-ca4c-485e-822c-555a26626adb', 'Education is the most powerful weapon which you can use to change the world.', '01928852-7323-70bd-82a2-4f5d1f1dde9a', '{change,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.23915', '2024-10-14 00:05:31.23915'),
('810e51ea-7602-4e9e-9eb4-3f0099d120f8', 'It is not wisdom but Authority that makes a law.', '01928852-76c3-7b82-86be-6de9ff5a287c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.830109', '2024-10-14 00:05:27.830109'),
('81531cc9-8e21-4ea8-b4f9-8c4868a72869', 'But man is not made for defeat. A man can be destroyed but not defeated.', '01928852-6cc5-7cac-837b-b316a5327a35', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.113792', '2024-10-14 00:05:37.113792'),
