('818abd2b-d968-4c95-bf4d-f657b6b67a9a', 'Friendship is the source of the greatest pleasures, and without friends even the most agreeable pursuits become tedious.', '01928852-76ae-7ec0-ade5-449cd1063f10', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:27.158026', '2024-10-14 00:05:27.158026'),
