('81a78dd8-80f7-4ea1-a573-202e1c110761', 'Government of the people, by the people, for the people, shall not perish from the Earth.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{history,politics,famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:25.004545', '2024-10-14 00:05:25.004545'),
('81b7ea54-fac6-44cd-9434-3e2eb79713a4', 'Technology is teaching us to be human again.', '01928852-755e-78a9-ae5f-950093ae96b2', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:31.515812', '2024-10-14 00:05:31.515812'),
('81c4b3a0-8750-4e88-9e25-978aa5918394', 'If we open a quarrel between past and present, we shall find that we have lost the future.', '01928852-778a-7b63-b73f-e0042755dd2e', '{history}', NULL, 't', 'f', '2024-10-14 00:05:25.184647', '2024-10-14 00:05:25.184647'),
('81f3e5b0-327f-4777-a76c-5a6fd3f5508c', 'I hope we shall crush in its birth the aristocracy of our monied corporations which dare already to challenge our government to a trial by strength, and bid defiance to the laws of our country.', '01928852-76c9-7011-8399-cc2c7c075bec', '{business}', NULL, 't', 'f', '2024-10-14 00:04:43.472494', '2024-10-14 00:04:43.472494'),
