('823abc2d-01b4-4d3c-9906-6b93d663c86e', 'Truth, and goodness, and beauty are but different faces of the same all.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.636724', '2024-10-14 00:05:31.636724'),
