('827ae191-c105-4140-9ba8-9f8e7414eafa', 'Knowledge rests not upon truth alone, but upon error also.', '01928852-6a64-7ada-9375-506781793732', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.905513', '2024-10-14 00:05:33.905513'),
('8288a9e2-a418-4640-9e8b-49e2c7b210dd', 'All this modern technology just makes people try to do everything at once.', '01928852-6926-7a32-a674-af744d54e8d0', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:29.875705', '2024-10-14 00:05:29.875705'),
('82ac7cd8-3bf3-491a-9cca-2d0a4ccae0eb', 'Every day is a new opportunity. You can build on yesterday''s success or put its failures behind and start over again. That''s the way life is, with a new game every day, and that''s the way baseball is.', '01928852-6939-7e68-842e-11a7eb0b033e', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.668715', '2024-10-14 00:04:43.668715'),
('82ef73b8-141e-4bae-84cf-07bdde1781c9', 'In life, all good things come hard, but wisdom is the hardest to come by.', '01928852-716e-74c1-92bb-4de523746907', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.997388', '2024-10-14 00:05:27.997388'),
('831622d6-dea4-48db-a896-e939477c0445', 'I look forward to a great future for America - a future in which our country will match its military strength with our moral restraint, its wealth with our wisdom, its power with our purpose.', '01928852-7087-754b-baed-0b0afc98ab6a', '{wisdom,politics}', NULL, 't', 'f', '2024-10-14 00:05:34.355973', '2024-10-14 00:05:34.355973'),
('83515e9d-cc60-44e2-abdd-779f96bec976', 'If you are going to achieve excellence in big things, you develop the habit in little matters. Excellence is not an exception; it is a prevailing attitude.', '01928852-6afb-7ceb-b2ae-af04eff4f1dd', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.835903', '2024-10-14 00:05:35.835903'),
('835df256-dba2-4381-8bcf-18bbffca97ab', 'Argue for your limitations, and sure enough they''re yours.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.46081', '2024-10-14 00:05:31.46081'),
('8393d670-fd07-4bb1-b4f1-68ff11bcc926', 'If one is lucky, a solitary fantasy can totally transform one million realities.', '01928852-72ca-75e2-aec8-113f1d70cda9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:25.933317', '2024-10-14 00:05:25.933317'),
('83c04ceb-c379-4700-b1cd-bcbc8e0cb5ed', 'Man is not sum of what he has already, but rather the sum of what he does not yet have, of what he could have.', '01928852-6f3b-7e30-a41b-a326052036b9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.966736', '2024-10-14 00:05:30.966736'),
('83f82a45-7730-4532-ae93-f2774fec76e1', 'The art of storytelling is reaching its end because the epic side of truth, wisdom, is dying out.', '01928852-7729-7eb1-ac01-5b6123c0e535', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.246307', '2024-10-14 00:05:33.246307'),
