('842831b1-c2ee-43f5-8749-52916893fcdf', 'I never worry about action, but only inaction.', '01928852-778a-7b63-b73f-e0042755dd2e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.419547', '2024-10-14 00:05:30.419547'),
