('846093af-e7ab-45b3-a659-da2c12d49823', 'The best thing about the future is that it only comes one day at a time.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{famous-quotes,life,future}', NULL, 't', 'f', '2024-10-14 00:05:27.670903', '2024-10-14 00:05:27.670903'),
('846f738a-54e9-4f15-b99f-293c2e677cee', 'Anything you really want, you can attain, if you really go after it.', '01928852-7744-71bf-9a7d-d848a44374a8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.688944', '2024-10-14 00:05:35.688944'),
