('8505389c-b5bd-43c6-9f76-2a30b2b1ad9f', 'First comes thought; then organization of that thought, into ideas and plans; then transformation of those plans into reality. The beginning, as you will observe, is in your imagination.', '01928852-7319-70d7-9011-72c190bdd6f0', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.105008', '2024-10-14 00:05:27.105008'),
('8524ff9d-72f2-4cfd-98b8-ab9b20c796cf', 'If you do not change direction, you may end up where you are heading.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom,success}', NULL, 't', 'f', '2024-10-14 00:05:29.102126', '2024-10-14 00:05:29.102126'),
('8568444d-28ba-4c68-b580-c41a5efdd6f5', 'Fine words and an insinuating appearance are seldom associated with true virtue', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.339607', '2024-10-14 00:05:36.339607'),
('8582dd19-fd01-4f22-b952-577bd7181077', 'There is no scarcity of opportunity to make a living at what you love; there''s only scarcity of resolve to make it happen.', '01928852-7744-71bf-9a7d-d848a44374a8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.09569', '2024-10-14 00:05:35.09569'),
('85875487-0abb-40ec-a760-5387f7e83395', 'To be able to give away riches is mandatory if you wish to possess them. This is the only way that you will be truly rich.', '01928852-730b-749c-9143-9aa109b3a0e8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.962162', '2024-10-14 00:05:27.962162'),
('8588e053-c3f7-45de-b1b0-c82e33a8718c', 'The heart has its reasons which reason knows not of.', '01928852-6934-7c5a-a71f-65849702aff4', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.423301', '2024-10-14 00:05:27.423301'),
