('85e97a9b-a513-4a72-a7f3-12a7b16a2f62', 'I will love the light for it shows me the way, yet I will endure the darkness because it shows me the stars.', '01928852-7343-78c7-9517-53ef98ff7f51', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.667381', '2024-10-14 00:05:34.667381'),
('85eadb56-f6fb-440d-83f2-0940d9ca30e0', 'One should train in deeds of merit—generosity, a balanced life, developing a loving mind—that yield long-lasting happiness.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,happiness}', NULL, 't', 'f', '2024-10-14 00:04:42.959798', '2024-10-14 00:04:42.959798'),
('85f21506-349f-4e59-ac8a-70a43a820627', 'Life is a progress, and not a station.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.267732', '2024-10-14 00:05:27.267732'),
