('860f4087-aaa3-4aae-83e2-27f1e5b4ae84', 'Do more than dream: work.', '01928852-7754-7ec1-967c-e752177f3b43', '{success}', NULL, 't', 'f', '2024-10-14 00:05:37.162354', '2024-10-14 00:05:37.162354'),
('8610552c-48e3-4abd-bb99-c64426a59bc7', 'It is time to remember that old wisdom our soldiers will never forget: that whether we are black or brown or white, we all bleed the same red blood of patriots, we all enjoy the same glorious freedoms, and we all salute the same great American Flag.', '01928852-6b51-7a84-ae14-742194c72d73', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.910164', '2024-10-14 00:05:35.910164'),
('86128c0c-7220-4819-a39f-0d13931c69e8', 'It is not only for what we do that we are held responsible, but also for what we do not do.', '01928852-72f7-7bf0-a154-75cd845f01cb', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.920958', '2024-10-14 00:05:28.920958'),
('862f383d-441d-42b8-a176-d82296c7ccd3', 'Attitude is a little thing that makes a big difference.', '01928852-778a-7b63-b73f-e0042755dd2e', '{}', NULL, 't', 'f', '2024-10-14 00:05:25.133857', '2024-10-14 00:05:25.133857'),
('8673c137-22db-4ce0-a0be-3d8693370ede', 'Forgiveness is choosing to love. It is the first skill of self-giving love.', '01928852-7177-7e3a-83fb-11ff0731979c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.250266', '2024-10-14 00:05:33.250266'),
('867ad2b4-d9db-41b4-b33d-2c08c2172293', 'God has given you one face, and you make yourself another.', '01928852-777a-762d-9378-c5e7bfe93c82', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.659027', '2024-10-14 00:05:26.659027'),
