('86bbb5e7-738a-4310-87c7-77ebb560aec6', 'The only way to have a friend is to be one.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes,friendship}', NULL, 't', 'f', '2024-10-14 00:05:27.843242', '2024-10-14 00:05:27.843242'),
('86c1f3e3-4a21-4605-91df-9adb2f7eb8cd', 'Without this playing with fantasy no creative work has ever yet come to birth. The debt we owe to the play of the imagination is incalculable.', '01928852-6a64-7ada-9375-506781793732', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.980895', '2024-10-14 00:05:30.980895'),
('86cf3670-6cc9-4afc-8c47-865d4ea1ae43', 'It is the nature of the wise to resist pleasures, but the foolish to be a slave to them.', '01928852-6cb6-7e88-84e6-88b53db6a61e', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.000789', '2024-10-14 00:05:28.000789'),
('87d51aa5-f438-428a-83ca-d3130e02163c', 'Happiness does not come from having much, but from being attached to little.', '01928852-6add-7d08-8ef1-b3bb90f822ae', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.046317', '2024-10-14 00:05:28.046317'),
('87ef94bb-d9dc-4847-ada2-8fb1d38233af', 'The greatest good you can do for another is not just share your riches but reveal to them their own.', '01928852-690b-77b8-bda5-e8dc48fd4fa9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.689053', '2024-10-14 00:05:34.689053'),
('87fc7699-4606-4681-bdcb-ce9a5f198e4e', 'The Universal Zulu Nation stands to acknowledge wisdom, understanding, freedom, justice, and equality, peace, unity, love, and having fun, work, overcoming the negative through the positive, science, mathematics, faith, facts, and the wonders of God, whether we call him Allah, Jehovah, Yahweh, or Jah.', '01928852-681d-7e0a-afb6-7610710d8a30', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.780319', '2024-10-14 00:05:26.780319'),
('88071ce7-c28c-424f-a5d3-b795e937e746', 'The most difficult thing is the decision to act, the rest is merely tenacity. The fears are paper tigers. You can do anything you decide to do. You can act to change and control your life; and the procedure, the process is its own reward.', '01928852-6877-76cd-8984-ae03c0038a41', '{life,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.344731', '2024-10-14 00:05:28.344731'),
('880f2f13-7b03-474f-8dd4-4e611ba84919', 'If I am not for myself, who will be for me? If I am not for others, what am I? And if not now, when?', '01928852-74b0-7deb-a1aa-e7364b0fbd95', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.423867', '2024-10-14 00:05:37.423867'),
