('883e4caf-6408-4464-a659-1b727274c9dd', 'Love has no age, no limit; and no death.', '01928852-708a-77e1-a543-230a044d5b8e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.781485', '2024-10-14 00:05:27.781485'),
('88464e27-67a9-43a6-b4ca-bcaf2534cfd9', 'Knowing is not enough; we must apply. Willing is not enough; we must do.', '01928852-6f6e-72a3-82ea-f8859e323434', '{motivational}', NULL, 't', 'f', '2024-10-14 00:04:43.792721', '2024-10-14 00:04:43.792721'),
('88859e67-81b6-4d65-bbf3-7d66eadf2850', 'All achievements, all earned riches, have their beginning in an idea.', '01928852-7319-70d7-9011-72c190bdd6f0', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.534659', '2024-10-14 00:05:36.534659'),
('88c7ce67-6ff3-45bd-bd73-19fbd4b2250f', 'Much though he recites the sacred texts, but acts not accordingly, that heedless man is like a cowherd who only counts the cows of others', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.452673', '2024-10-14 00:05:27.452673'),
('88cda474-3faf-41e0-95dd-5506be4bec04', 'To acquire knowledge, one must study; but to acquire wisdom, one must observe.', '01928852-729d-7780-b26d-0e0b517f452e', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.181682', '2024-10-14 00:05:33.181682'),
