('8a289361-3831-4748-bf09-f442232bb5f6', 'Everyone in the world ought to do the things for which he is specially adapted. It is the part of wisdom to recognize what each one of us is best fitted for, and it is the part of education to perfect and utilize such predispositions. Because education can direct and aid nature but can never transform her.', '01928852-7287-70b7-a8ab-df78fe8430dc', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.569482', '2024-10-14 00:05:34.569482'),
