('8b8aea09-5eef-48bd-b00f-d51733f3ea56', 'I think that we have a great opportunity to impart our wisdom and our knowledge and our experience to this younger generation. It may be different times, but experience transcends time, and wisdom transcends time.', '01928852-7707-7ad6-97ad-628c9eec184d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.808307', '2024-10-14 00:05:27.808307'),
('8b9f9f16-eb28-4b87-ba76-22a1359c3176', 'False friendship, like the ivy, decays and ruins the walls it embraces; but true friendship gives new life and animation to the object it supports.', '01928852-74dd-7703-90b9-17bf30f40043', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:33.110094', '2024-10-14 00:05:33.110094'),
