('8e288640-656f-42a9-aed8-a65a43286da4', 'Happiness cannot be travelled to, owned, earned, worn or consumed. Happiness is the spiritual experience of living every minute with love, grace and gratitude.', '01928852-6b3c-7b7e-b9d1-0ec52c690e37', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.293192', '2024-10-14 00:05:35.293192'),
