('8e93c0ca-9bd2-4003-9776-e5d1a8784e58', 'Don''t be afraid to go out on a limb. That''s where the fruit is.', '01928852-6d46-73b0-bbb7-a1be0a360df5', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.379977', '2024-10-14 00:05:26.379977'),
