('8f059249-ddcf-4a10-9708-21375c703037', 'Grief can be the garden of compassion. If you keep your heart open through everything, your pain can become your greatest ally in your life''s search for love and wisdom.', '01928852-751e-7ba4-bbc6-9f9044390793', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.341799', '2024-10-14 00:05:30.341799'),
('8f221ccd-0493-457b-a594-1f3270daec9b', 'Laws alone can not secure freedom of expression; in order that every man present his views without penalty there must be spirit of tolerance in the entire population.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{freedom,tolerance}', NULL, 't', 'f', '2024-10-14 00:04:42.720621', '2024-10-14 00:04:42.720621'),
('8f27cb6c-1cbd-433d-8791-e068bb2e0560', 'Life is movement-we breathe, we eat, we walk, we move!', '01928852-70b1-7d83-8b2d-5d215153e495', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.543804', '2024-10-14 00:05:32.543804'),
