('8f49038f-577d-4835-b215-fa8c8459a8c6', 'Gold medals aren''t really made of gold. They''re made of sweat, determination, and a hard-to-find alloy called guts.', '01928852-6b16-7ccb-98e2-c21351fee432', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.705082', '2024-10-14 00:04:43.705082'),
