('8f64ca73-2efb-4f4b-b17a-80369289f97a', 'If your actions inspire others to dream more, learn more, do more and become more, you are a leader.', '01928852-70b7-730d-84a7-ff94b1f17931', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.185169', '2024-10-14 00:05:30.185169'),
('8f851b05-7caf-44eb-b43d-3569ca053491', 'We must be as courteous to a man as we are to a picture, which we are willing to give the advantage of a good light.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.04728', '2024-10-14 00:05:33.04728'),
('8f8c2892-a684-45d2-9c8d-e1c176c7c842', 'If with a pure mind a person speaks or acts, happiness follows them like a never-departing shadow.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,happiness}', NULL, 't', 'f', '2024-10-14 00:04:43.053246', '2024-10-14 00:04:43.053246'),
('8f9f97e7-ab3c-4c73-bbdf-f42e0b3c52be', 'Love, friendship and respect do not unite people as much as a common hatred for something.', '01928852-68ae-757a-a935-540429953998', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:30.877988', '2024-10-14 00:05:30.877988'),
