('a7b47481-522b-484d-abd2-fb7f0f1efef9', 'All our talents increase in the using, and every faculty, both good and bad, strengthen by exercise.', '01928852-689f-7d66-9372-3b22966697e8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.162606', '2024-10-14 00:05:35.162606'),
