('a904eb6a-2f53-42b3-8e2e-0aa0aa9d92b5', 'My motto was always to keep swinging. Whether I was in a slump or feeling badly or having trouble off the field, the only thing to do was keep swinging.', '01928852-6d4d-76aa-99c2-af28b31a1a4a', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.500746', '2024-10-14 00:04:43.500746'),
