('aa5718a6-25be-4539-adb4-cdfadb00b47c', 'First we thought the PC was a calculator. Then we found out how to turn numbers into letters with ASCII — and we thought it was a typewriter. Then we discovered graphics, and we thought it was a television. With the World Wide Web, we''ve realized it''s a brochure.', '01928852-6b5f-7bf6-a1a1-dc998255d0a4', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:27.849863', '2024-10-14 00:05:27.849863'),
('aa681e40-af7a-4328-b57f-33acf60642c8', 'Creativity comes from trust. Trust your instincts. And never hope more than you work.', '01928852-74e9-7f48-82c4-d82eb7f75aef', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.871626', '2024-10-14 00:05:33.871626'),
