('acde47c5-88da-4bdc-8b4a-f5e2aa20a2cb', 'The friend who can be silent with us in a moment of despair or confusion, who can stay with us in an hour of grief and bereavement, who can tolerate not knowing... not healing, not curing... that is a friend who cares.', '01928852-6e73-7475-9304-a28c80a75f57', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:26.443468', '2024-10-14 00:05:26.443468'),
