('ae95eb72-68b6-4ad9-88fe-92690f6de474', 'You learn to speak by speaking, to study by studying, to run by running, to work by working; in just the same way, you learn to love by loving.', '01928852-6884-77ad-a225-b2401731958d', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.481828', '2024-10-14 00:05:34.481828'),
('aeb58915-044e-45e4-8a0d-250da2eb0ccc', 'You and I are all as much continuous with the physical universe as a wave is continuous with the ocean.', '01928852-682f-7990-bde7-7116c7df0f5d', '{philosophy}', NULL, 't', 'f', '2024-10-14 00:05:25.06656', '2024-10-14 00:05:25.06656'),
('aeca8895-5ebd-4ae6-9505-187076b0e4bc', 'Kindness is the golden chain by which society is bound together.', '01928852-6f6e-72a3-82ea-f8859e323434', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.218302', '2024-10-14 00:05:29.218302'),
('af0cc2d1-962d-42fd-acf5-027e7719447b', 'All perceiving is also thinking, all reasoning is also intuition, all observation is also invention.', '01928852-751b-7cc7-9eee-27151871e994', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.895616', '2024-10-14 00:05:35.895616'),
('af961796-3a52-44ee-b788-0dfacf5dff95', 'The ladder of success is never crowded at the top.', '01928852-7319-70d7-9011-72c190bdd6f0', '{success}', NULL, 't', 'f', '2024-10-14 00:05:33.747788', '2024-10-14 00:05:33.747788'),
('af98b02b-cc6b-436f-8def-b01430bde1e6', 'I define friendship as a bond that transcends all barriers. When you are ready to expect anything and everything from friends, good, bad or ugly... that''s what I call true friendship.', '01928852-6d5d-799d-8db8-d9850db68b49', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:36.514621', '2024-10-14 00:05:36.514621'),
('afabed33-8b11-4ed5-9721-062007f57722', 'When the solution is simple, God is answering.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{famous-quotes,religion}', NULL, 't', 'f', '2024-10-14 00:05:36.335308', '2024-10-14 00:05:36.335308'),
('afdd4e83-0e8a-4e1a-a0b6-b106a4fb71b7', 'If I find 10,000 ways something won''t work, I haven''t failed. I am not discouraged, because every wrong attempt discarded is another step forward.', '01928852-76b7-746d-ac06-f2d9547d384b', '{perseverance,success,inspirational,motivational}', NULL, 't', 'f', '2024-10-14 00:04:42.634243', '2024-10-14 00:04:42.634243'),
('afed565b-1be8-44d3-852e-ac2ae98c8aa6', 'Even youngish men can acquire wisdom as time goes by.', '01928852-7067-78b4-83de-381f6f54ff70', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.143567', '2024-10-14 00:05:35.143567'),
('b019ba3d-7b1f-4c1c-80bf-1e1dcabf55b2', 'There are three classes of men; lovers of wisdom, lovers of honor, and lovers of gain.', '01928852-7495-7bbb-8c71-fb1111ec3bdf', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.224499', '2024-10-14 00:05:35.224499'),
('b01dbdf7-9885-4321-864d-eecd4621cbb7', 'The person who lives life fully, glowing with life''s energy, is the person who lives a successful life.', '01928852-6b09-70bb-b5d7-6842f2d812b5', '{success}', NULL, 't', 'f', '2024-10-14 00:05:34.510502', '2024-10-14 00:05:34.510502'),
('b043da40-67c0-414f-80d2-451b27565864', 'Always keep an open mind and a compassionate heart.', '01928852-7484-715d-90ec-267a9fd04c98', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.220859', '2024-10-14 00:05:35.220859'),
('b05a5d1f-1765-46f2-8267-de1e644be3fc', 'He is a wise man who does not grieve for the things which he has not but rejoices for those which he has.', '01928852-6cb6-7e88-84e6-88b53db6a61e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.862974', '2024-10-14 00:05:33.862974'),
('b09b99a3-f988-4da4-b665-fc5c2e96938b', 'Arriving at one point is the starting point to another.', '01928852-707f-7334-934e-3a6dd90deb03', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.966218', '2024-10-14 00:05:27.966218'),
('b0a3135c-a7ec-4797-985b-27c53a350dcd', 'And when the world is created, it is created in such a way that those eternal objects of God''s loving wisdom become actualities - interacting with one another, relating to God in the finite realm.', '01928852-7518-7fbf-859a-f7018a854eec', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.071729', '2024-10-14 00:05:33.071729'),
('b10c2a44-c2b8-4372-b707-77bf8e1a233d', 'Keep me away from the wisdom which does not cry, the philosophy which does not laugh and the greatness which does not bow before children.', '01928852-7107-7406-9ddd-aa4185419e20', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.408962', '2024-10-14 00:05:28.408962'),
('b11901a8-1abb-40cc-ad32-b7a7382398b6', 'As a cure for worrying, work is better than whisky.', '01928852-76b7-746d-ac06-f2d9547d384b', '{humorous}', NULL, 't', 'f', '2024-10-14 00:04:42.682261', '2024-10-14 00:04:42.682261'),
('b12010db-56aa-4865-84a7-317663032d1b', 'A hero is no braver than an ordinary man, but he is braver five minutes longer.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.643772', '2024-10-14 00:05:28.643772'),
('b12f6275-101b-4033-8f11-6d6462eed182', 'It is with words as with sunbeams. The more they are condensed, the deeper they burn.', '01928852-7505-7e83-b1a5-8e4389d004c8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.975613', '2024-10-14 00:05:27.975613'),
('b135d8b7-b905-40b9-9f02-bf0fbdd6bfb6', 'You must welcome change as the rule but not as your ruler.', '01928852-6b3c-7b7e-b9d1-0ec52c690e37', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.676682', '2024-10-14 00:05:25.676682'),
('b13698b7-78d4-41de-9827-a80d64ead88d', 'Do I speak at the right time, or not? Do I speak of facts, or not? Do I speak gently or harshly? Do I speak profitable words or not? Do I speak with a kindly heart, or inwardly malicious?', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.1049', '2024-10-14 00:05:31.1049'),
('b184746d-c262-4b63-bf4a-378549a5848d', 'Happiness is as a butterfly which, when pursued, is always beyond our grasp, but which if you will sit down quietly, may alight upon you.', '01928852-731f-7e58-bd37-d57c69ce65ff', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.584383', '2024-10-14 00:05:36.584383'),
('b18d1886-6005-4651-94fb-e1492f96785b', 'The function of wisdom is to discriminate between good and evil.', '01928852-6af0-792f-a520-9a06cb1ad7f7', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.139989', '2024-10-14 00:05:37.139989'),
('b1d410d7-e0b8-4b9f-93b0-9533a10d0b1a', 'Think big thoughts but relish small pleasures.', '01928852-6d46-73b0-bbb7-a1be0a360df5', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.113095', '2024-10-14 00:05:29.113095'),
('b1dca093-d942-4568-a778-fa9d9895a181', 'Beware of missing chances; otherwise it may be altogether too late someday.', '01928852-6cf9-7467-9b8f-7dbd8f0c61f8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.589709', '2024-10-14 00:05:31.589709'),
('b215b53a-96b7-4417-a813-9c9a4030c54d', 'Wisdom and penetration are the fruit of experience, not the lessons of retirement and leisure. Great necessities call out great virtues.', '01928852-67e5-7f8e-b2d3-f3277d2af558', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.749643', '2024-10-14 00:05:27.749643'),
('b2390bba-eda6-43e9-b3c9-2c8323959906', 'Friendship may, and often does, grow into love, but love never subsides into friendship.', '01928852-715e-7538-8a2d-a4899d8e814c', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:33.858809', '2024-10-14 00:05:33.858809'),
('b2778fd1-5127-424b-857a-42a18467e69d', 'Don''t ruin the present with the ruined past.', '01928852-6cac-7337-bde6-aba11ac94213', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.548824', '2024-10-14 00:05:33.548824'),
('b2c5d66f-288c-4d23-af27-c260cef9e038', 'The beginning is always today.', '01928852-72b5-73c0-90cf-bef92c143aa9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:25.920496', '2024-10-14 00:05:25.920496'),
('b2d0b3e1-f411-435d-a721-91f5834cfe86', 'Do you want to know who you are? Don''t ask. Act! Action will delineate and define you.', '01928852-76c9-7011-8399-cc2c7c075bec', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:37.250375', '2024-10-14 00:05:37.250375'),
('b310efd4-2d05-4121-835e-afe45ced3e19', '''As I am, so are they; as they are, so am I.'' Comparing others with oneself, do not kill nor cause others to kill.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom,virtue}', NULL, 't', 'f', '2024-10-14 00:04:42.966675', '2024-10-14 00:04:42.966675'),
('b31d9f36-1568-4027-a829-bd136ec568bd', 'Make it a rule of life never to regret and never to look back. Regret is an appalling waste of energy; you can''t build on it; it''s only for wallowing in.', '01928852-710d-76f0-b251-c0f22958fd70', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.680805', '2024-10-14 00:05:34.680805'),
('b346c657-4a81-4889-b7d1-8cf382b3cddd', 'We may encounter many defeats, but we must not be defeated.', '01928852-72ca-75e2-aec8-113f1d70cda9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.57517', '2024-10-14 00:05:28.57517'),
('b37aa80a-7e4b-4f98-894b-338c80638b2f', 'The only time to buy these is on a day with no ''y'' in it.', '01928852-773b-7553-92eb-3fdb88846bc3', '{}', NULL, 't', 'f', '2024-10-14 00:04:42.839093', '2024-10-14 00:04:42.839093'),
('b37d9e5a-08b4-42c8-82a1-9f72e6f10c76', 'When you judge another, you do not define them, you define yourself.', '01928852-7744-71bf-9a7d-d848a44374a8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.837271', '2024-10-14 00:05:31.837271'),
('b3a55bdb-afa8-4124-b088-25146968c725', 'The awareness of our own strength makes us modest.', '01928852-7367-713b-9ea8-4e0c57ea5660', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.646776', '2024-10-14 00:05:29.646776'),
('b3b29c53-d00a-4564-8e9e-7d476de4db67', 'I have never been hurt by anything I didn''t say.', '01928852-6a5d-71cb-86d8-dfc03ba45a6d', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.314208', '2024-10-14 00:05:27.314208'),
('b3d69567-c21e-4df0-9d5a-5521122ec564', 'Study the past, if you would divine the future.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.959506', '2024-10-14 00:05:25.959506'),
('b3e801e2-b514-4f43-835e-6b84a55ba969', 'The less effort, the faster and more powerful you will be.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.448242', '2024-10-14 00:05:27.448242'),
('b3fa2f4d-9f85-4be2-9525-be530169bb9f', 'With every experience, you alone are painting your own canvas, thought by thought, choice by choice.', '01928852-734a-7d5e-9d80-a55b35905931', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.124486', '2024-10-14 00:05:33.124486'),
('b4190bd9-0a86-4ab8-953d-fd96a16975a4', 'A thing well said will be wit in all languages.', '01928852-7082-7713-87f4-12d996218264', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.240057', '2024-10-14 00:05:36.240057'),
('b4213062-5cb5-4199-894a-18551ae51884', 'Imagination is the living power and prime agent of all human perception.', '01928852-7540-7ca2-84b9-dc1cc27b2933', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.30077', '2024-10-14 00:05:29.30077'),
('b4271607-3f7a-46af-8450-1d0fe1750480', 'A true friend is the most precious of all possessions and the one we take the least thought about acquiring.', '01928852-6ce9-7e86-abdf-1e51f618cd65', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.739163', '2024-10-14 00:05:35.739163'),
('b42e72cf-cce6-48d2-90bc-976d96d30421', 'True silence is the rest of the mind; it is to the spirit what sleep is to the body, nourishment and refreshment.', '01928852-7775-7c61-9ba4-f354b4670447', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.992332', '2024-10-14 00:05:30.992332'),
('b4694eb5-614e-43e0-a331-416126fe4049', 'The best thing in every noble dream is the dreamer...', '01928852-72f9-797e-8a22-138ea1d275a5', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.842423', '2024-10-14 00:05:33.842423'),
('b48b181c-ff7c-40e9-b44f-9fe971467f02', 'If you spend too much time thinking about a thing, you''ll never get it done.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.263747', '2024-10-14 00:05:28.263747'),
('b4a4cfc9-832b-4989-808c-e2ffc88041e9', 'Commitment is an act, not a word.', '01928852-6f3b-7e30-a41b-a326052036b9', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.375658', '2024-10-14 00:05:34.375658'),
('b4b81d15-866e-4e7c-a45b-05a2527db070', 'I walk slowly, but I never walk backward.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.416168', '2024-10-14 00:05:30.416168'),
('b4c16899-0f5c-417e-acfc-151b371af9f3', 'Success consists of going from failure to failure without loss of enthusiasm.', '01928852-778a-7b63-b73f-e0042755dd2e', '{success}', NULL, 't', 'f', '2024-10-14 00:05:25.302222', '2024-10-14 00:05:25.302222'),
('b50f38b3-8b04-417e-9d13-39d7aa9166cf', 'The key to transforming our hearts and minds is to have an understanding of how our thoughts and emotions work.', '01928852-6b0b-786b-8dd4-995ae2eb3355', '{famous-quotes,character}', NULL, 't', 'f', '2024-10-14 00:05:37.097855', '2024-10-14 00:05:37.097855'),
('b51b34a5-feaa-4de9-8d12-7735108721c4', 'If you cannot do great things, do small things in a great way.', '01928852-7319-70d7-9011-72c190bdd6f0', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.426571', '2024-10-14 00:05:32.426571'),
('b522a791-c31b-465f-9b16-e81a0ea4ff92', 'Mind is everything: muscle, pieces of rubber. All that I am, I am because of my mind.', '01928852-735a-7ed5-ae97-52a9ed1d2b99', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.186215', '2024-10-14 00:05:33.186215'),
('b5281b5e-4e1b-4ad4-8141-c3ac2518d2e1', 'Ethical axioms are found and tested not very differently from the axioms of science. Truth is what stands the test of experience.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{education,science,ethics}', NULL, 't', 'f', '2024-10-14 00:04:42.76791', '2024-10-14 00:04:42.76791'),
('b56ea586-660e-45a2-83f0-2d79fad2e57f', 'Learning is finding out what you already know.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.134074', '2024-10-14 00:05:31.134074'),
('b58e6f99-3ddf-4498-b31f-94687ef96a40', 'Setting an example is not the main means of influencing another, it is the only means.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.098697', '2024-10-14 00:05:33.098697'),
('b59635d3-7f4f-425a-86a4-b0defb9a59cb', 'Eighty percent of success is showing up.', '01928852-7790-79f7-8c8c-b0430a929515', '{success}', NULL, 't', 'f', '2024-10-14 00:05:29.903014', '2024-10-14 00:05:29.903014'),
('b59fb12b-a4f0-4e9a-98d5-3b3ce4769636', 'The thoughts we choose to think are the tools we use to paint the canvas of our lives.', '01928852-716b-7d75-8c30-032a2866730a', '{famous-quotes,life,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.226342', '2024-10-14 00:05:37.226342'),
('b5b89492-8ab0-4a39-9abb-12e95933dbf2', 'A goal is a dream with a deadline.', '01928852-7319-70d7-9011-72c190bdd6f0', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.552306', '2024-10-14 00:05:34.552306');
INSERT INTO "public"."quotes" ("id", "content", "author_id", "categories_slug", "bible_reference", "active", "verified", "created_at", "updated_at") VALUES
('b5e08b5c-c183-45bf-ad92-3b7dd84c3dc1', 'We can only learn to love by loving.', '01928852-6edf-7665-a6b2-c0ebb2c5aa1e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.46677', '2024-10-14 00:05:32.46677'),
('b5ed3b0d-e9f5-4668-adf7-212112dff5ca', 'To profit from good advice requires more wisdom than to give it.', '01928852-7782-7be5-b01e-bf9291139728', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.019676', '2024-10-14 00:05:34.019676'),
('b6beda65-9666-46b4-bdf7-5551da930044', 'One''s life has value so long as one attributes value to the life of others, by means of love, friendship, indignation and compassion.', '01928852-7564-7866-9759-a8648846b0d3', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:30.560673', '2024-10-14 00:05:30.560673'),
('b6ca9980-7084-4ee3-953d-ba5c3a2b2220', 'Failure will never overtake me if my determination to succeed is strong enough.', '01928852-7343-78c7-9517-53ef98ff7f51', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:31.716913', '2024-10-14 00:05:31.716913'),
('b6e7f253-312c-4841-a065-465ba154297f', 'Each friend represents a world in us, a world not born until they arrive, and it is only by this meeting that a new world is born.', '01928852-6881-712d-afda-f6e1fb00242e', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:35.260294', '2024-10-14 00:05:35.260294'),
('b70cd6fd-f34b-489f-8e1b-b202c08bdc66', 'Reason and free inquiry are the only effectual agents against error.', '01928852-76c9-7011-8399-cc2c7c075bec', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.002404', '2024-10-14 00:05:33.002404'),
('b73aa068-336f-4ba4-9f82-1df6fc0bbc97', 'Yesterday I dared to struggle. Today I dare to win.', '01928852-6915-73b0-b72b-51382be31ad6', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.556253', '2024-10-14 00:05:35.556253'),
