('c06f9716-a72c-4468-8aa7-166110e8f0c3', 'Do not waste yourself in rejection, nor bark against the bad, but chant the beauty of the good.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.631867', '2024-10-14 00:05:34.631867'),
('c0b8b363-710c-47e8-9af1-bc5f6d5b4d76', 'The man who makes everything that leads to happiness depends upon himself, and not upon other men, has adopted the very best plan for living happily. This is the man of moderation, the man of manly character and of wisdom.', '01928852-7495-7bbb-8c71-fb1111ec3bdf', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.505236', '2024-10-14 00:05:26.505236'),
('c0e28209-7ba5-46bb-b96e-2e6bbf92e0e6', 'I''m selfish, impatient and a little insecure. I make mistakes, I am out of control and at times hard to handle. But if you can''t handle me at my worst, then you sure as hell don''t deserve me at my best.', '01928852-729a-70f1-a61e-d1c3ba8b90c6', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.017749', '2024-10-14 00:05:26.017749'),
