('c19bd21f-6198-41a1-942a-8dba594f4cf2', 'We could never learn to be brave and patient if there were only joy in the world.', '01928852-6e68-7e82-b1a6-7a4567140254', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.392786', '2024-10-14 00:05:30.392786'),
