('c22c2417-46b9-4c69-a784-da1d513f2ea6', 'All that is necessary is to accept the impossible, do without the indispensable, and bear the intolerable.', '01928852-7110-7e2f-8991-1141614ae480', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.91618', '2024-10-14 00:05:36.91618'),
