('c2bc5621-db5c-4fe9-87df-4c7d4111e7df', 'I am always doing that which I cannot do, in order that I may learn how to do it.', '01928852-735d-7e92-b053-51055d8d43dc', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.231269', '2024-10-14 00:05:33.231269'),
('c2c7d61c-008f-4a11-a9f6-a3815c43935c', 'In times of change, learners inherit the earth, while the learned find themselves beautifully equipped to deal with a world that no longer exists.', '01928852-6cbd-7030-ad3b-4231930f99c8', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:25.354759', '2024-10-14 00:05:25.354759'),
('c2d183af-ccf8-4e3f-b51f-c4da1d4c3b62', 'Wisdom cannot come by railroad or automobile or airplane or be hurried up by telegraph or telephone.', '01928852-7073-7f51-bea7-966f5b5c06c0', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.577075', '2024-10-14 00:05:30.577075'),
('c2e9a789-3c1d-43e4-9eeb-cb7cace6705d', 'Most of the important things in the world have been accomplished by people who have kept on trying when there seemed to be no hope at all.', '01928852-6b0e-77ca-bc5d-cd5da36bf700', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.566842', '2024-10-14 00:05:36.566842'),
('c2fc00e6-6838-48aa-b7dd-a6080d1f9917', 'It is very easy to forgive others their mistakes; it takes more grit to forgive them for having witnessed your own.', '01928852-6f43-70fe-9815-700c521eb081', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.538384', '2024-10-14 00:05:35.538384'),
