('c30f94a0-bcc0-4e0a-8b9e-4d9f451b6cf7', 'What is new in the world? Nothing. What is old in the world? Nothing. Everything has always been and will always be.', '01928852-7520-73ec-bb99-a8a1ea50224c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.173523', '2024-10-14 00:05:35.173523'),
('c320bf1e-d9ec-49a7-954f-58f9be1f6e52', 'Love yourself first and everything else falls into line. You really have to love yourself to get anything done in this world.', '01928852-716e-74c1-92bb-4de523746907', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.327139', '2024-10-14 00:05:35.327139'),
('c33ac720-94ef-41e6-afa0-fbd10cbb28e5', 'To bring anything into your life, imagine that it''s already there.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:25.974484', '2024-10-14 00:05:25.974484'),
('c340bf48-add1-443a-87b9-941ff2b56cb3', 'Swim upstream. Go the other way. Ignore the conventional wisdom.', '01928852-752f-78b0-8b93-bdefcd227548', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.64759', '2024-10-14 00:05:28.64759'),
('c34459ab-0952-4c1a-8244-b4482f5d830a', 'Don''t cry because it''s over. Smile because it happened.', '01928852-6b68-7103-940a-27bff50ae691', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.135602', '2024-10-14 00:05:29.135602'),
('c35da8c6-a4ad-41fb-9c34-37db01a5a5c7', 'Nature gave us one tongue and two ears so we could hear twice as much as we speak.', '01928852-6cb6-7e88-84e6-88b53db6a61e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.297038', '2024-10-14 00:05:35.297038'),
('c36bf875-9956-43f1-be86-941ff584c1cb', 'Where there is charity and wisdom, there is neither fear nor ignorance.', '01928852-6ce7-7102-a8b4-b9d13dff2d7a', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.282288', '2024-10-14 00:05:32.282288'),
('c36ee211-a95d-4410-97ae-36a8dc2b24bf', 'Let your hook always be cast; in the pool where you least expect it, there will be a fish.', '01928852-7352-701e-936e-f953a1185478', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.431589', '2024-10-14 00:05:32.431589'),
('c39ff1c8-a480-4514-b320-28602b990f7a', 'Setting goals is the first step in turning the invisible into the visible.', '01928852-76ed-7661-a537-c3978973ac97', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:34.335647', '2024-10-14 00:05:34.335647'),
('c3b0fc1a-7764-4a49-ad41-23968a8acb63', 'I believe that we are fundamentally the same and have the same basic potential.', '01928852-6b0b-786b-8dd4-995ae2eb3355', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.733588', '2024-10-14 00:05:26.733588'),
('c3c6a4a7-068a-4fbd-b33b-91bc881145cd', 'Serious sport has nothing to do with fair play. It is bound up with hatred, jealousy, boastfulness, disregard of all rules and sadistic pleasure in witnessing violence. In other words, it is war minus the shooting.', '01928852-6d20-7c35-a7b4-253cc2911041', '{sports}', NULL, 't', 'f', '2024-10-14 00:04:43.725055', '2024-10-14 00:04:43.725055'),
('c3ef8b00-fab5-4f76-a0dc-90b1b86555c5', 'There are no failures. Just experiences and your reactions to them.', '01928852-76db-7864-b1f6-c0b2b72b1772', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.948192', '2024-10-14 00:05:32.948192'),
('c4587566-7a22-41b5-933e-3ab478986541', 'The doorstep to the temple of wisdom is a knowledge of our own ignorance.', '01928852-690d-7022-b386-1900654a746e', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.337028', '2024-10-14 00:05:27.337028'),
('c4951fed-b2d1-450a-8474-2ae585c82f49', 'Technology frightens me to death. It''s designed by engineers to impress other engineers. And they always come with instruction booklets that are written by engineers for other engineers — which is why almost no technology ever works.', '01928852-707a-779e-a3f7-fc9a557b0ff0', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:29.726434', '2024-10-14 00:05:29.726434'),
('c519c2d3-41aa-46d9-b1b5-2a838edf855e', 'It is impossible to escape the impression that people commonly use false standards of measurement — that they seek power, success and wealth for themselves and admire them in others, and that they underestimate what is of true value in life.', '01928852-755b-7ae3-a03d-d8ec18a78542', '{success}', NULL, 't', 'f', '2024-10-14 00:05:35.906632', '2024-10-14 00:05:35.906632'),
('c51b0af7-8fc2-4ae2-8fec-a14ee860be17', 'An optimist is a person who sees a green light everywhere, while the pessimist sees only the red spotlight... The truly wise person is color-blind.', '01928852-683a-71d6-b41c-d2b672f92792', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.934344', '2024-10-14 00:05:34.934344'),
('c528714e-819f-4460-9159-13e6c951a71b', 'Appreciation can make a day, even change a life. Your willingness to put it into words is all that is necessary.', '01928852-7277-74d5-a896-37e619d6c0aa', '{change,life,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.501346', '2024-10-14 00:05:34.501346'),
('c545665c-16f6-43d0-abc7-3c9a81c2a76b', 'In wartime, truth is so precious that she should always be attended by a bodyguard of lies.', '01928852-778a-7b63-b73f-e0042755dd2e', '{war,history}', NULL, 't', 'f', '2024-10-14 00:05:25.221534', '2024-10-14 00:05:25.221534'),
('c5aba0f7-193d-4530-a297-c7820faae8c5', 'Take rest; a field that has rested gives a bountiful crop.', '01928852-7352-701e-936e-f953a1185478', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.922602', '2024-10-14 00:05:34.922602'),
('c5e6bbeb-de41-4007-8720-dcdf6f95bc1b', 'Your sacred space is where you can find yourself again and again.', '01928852-70db-7cb4-96ac-f4164cc59c5a', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.621576', '2024-10-14 00:05:31.621576'),
('c62b1073-3375-4f40-8068-08263cd584f6', 'Spectacular achievement is always preceded by unspectacular preparation.', '01928852-7503-7208-ac23-5f475b6da5f4', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.020857', '2024-10-14 00:05:31.020857'),
('c63a3feb-712c-43ed-a7de-75031e53c195', 'No party has a monopoly on wisdom. No democracy works without compromise.', '01928852-68f7-701a-abae-2a051a9dd370', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.862743', '2024-10-14 00:05:27.862743'),
('c63f12ce-7476-4e5f-b114-75ccfd19e216', 'Parents can only give good advice or put them on the right paths, but the final forming of a person''s character lies in their own hands.', '01928852-68a1-781d-9263-47ac67a6ded4', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.689145', '2024-10-14 00:05:31.689145'),
('c6b57f4a-e0a7-4c5c-9362-c9d6ac651e87', 'Today you are you! That is truer than true! There is no one alive who is you-er than you!', '01928852-6b68-7103-940a-27bff50ae691', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.919847', '2024-10-14 00:05:29.919847'),
('c710afed-ff7e-4b52-86f4-92ed112b400e', 'Everything that irritates us about others can lead us to an understanding of ourselves.', '01928852-6a64-7ada-9375-506781793732', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.429264', '2024-10-14 00:05:30.429264'),
('c73fd429-8bdd-4498-b2fa-f9cbb71c405b', 'The one thing that you have that nobody else has is you. Your voice, your mind, your story, your vision. So write and draw and build and play and dance and live as only you can.', '01928852-7321-7c66-9a2c-02204419e070', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:25.374386', '2024-10-14 00:05:25.374386'),
('c7546b8a-5ec3-44f5-9a32-fdadd933af96', 'If you want to go east, don''t go west.', '01928852-74c7-7ed7-8316-be59e42e7449', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.351988', '2024-10-14 00:05:26.351988'),
('c7715d74-f97c-40f9-a44c-96d506933360', 'Genius is one per cent inspiration, ninety-nine per cent perspiration.', '01928852-76b7-746d-ac06-f2d9547d384b', '{work,genius,inspirational,motivational}', NULL, 't', 'f', '2024-10-14 00:04:42.663427', '2024-10-14 00:04:42.663427'),
('c7a0f334-888b-4a60-b460-aca77adf62fd', 'Obstacles are those things you see when you take your eyes off the goal.', '01928852-6d55-73cb-b591-94dddd699484', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.796438', '2024-10-14 00:05:29.796438'),
('c81a3e1c-949d-40e9-a831-735e6b534a8b', 'Quality means doing it right when no one is looking.', '01928852-6e84-7c1a-bcd0-c3a5056c0970', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.296827', '2024-10-14 00:05:28.296827'),
('c83b34ef-78a6-4308-a566-fc6cc854e13c', 'Not every difficult and dangerous thing is suitable for training, but only that which is conducive to success in achieving the object of our effort.', '01928852-6cb6-7e88-84e6-88b53db6a61e', '{success}', NULL, 't', 'f', '2024-10-14 00:05:37.144218', '2024-10-14 00:05:37.144218'),
('c83c89c2-465c-4834-98cc-29763bb19159', 'You can only learn so much from books. You can only learn so much from education. Ultimately, it is the wisdom of God that will carry you through in the toughest situations of life.', '01928852-74cb-7c7e-a3a4-babdb048e2d7', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.967813', '2024-10-14 00:05:36.967813'),
('c849bf16-aa63-40de-b1f5-752aaa97e859', 'When you learn, teach. When you get, give.', '01928852-72ca-75e2-aec8-113f1d70cda9', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.95623', '2024-10-14 00:05:33.95623'),
('c862fb66-de07-4cf9-b473-69bf627e947f', 'Love isn''t something you find. Love is something that finds you.', '01928852-7161-7916-9471-933675b84b30', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.068618', '2024-10-14 00:05:35.068618'),
('c8657209-7056-48bc-9085-ba37c536fd76', 'A brand for a company is like a reputation for a person. You earn reputation by trying to do hard things well.', '01928852-6f3e-7104-adb9-1623d1d16d5b', '{business}', NULL, 't', 'f', '2024-10-14 00:04:43.763195', '2024-10-14 00:04:43.763195'),
