('c8956e3c-8621-40d0-9df8-ec9d7ef32dfc', 'At the center of your being, you have the answer; you know who you are, and you know what you want.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.113361', '2024-10-14 00:05:35.113361'),
('c89d50a9-593a-47b8-8837-be9861c474a3', 'There''s power in looking silly and not caring that you do.', '01928852-687c-7ec5-9f9a-5350fcc15806', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:25.359673', '2024-10-14 00:05:25.359673'),
('c8e4b436-ecd4-477f-a27e-f3766fea1ca7', 'The rule of friendship means there should be mutual sympathy between them, each supplying what the other lacks and trying to benefit the other, always using friendly and sincere words.', '01928852-6af0-792f-a520-9a06cb1ad7f7', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:28.390107', '2024-10-14 00:05:28.390107'),
('c91dc6d5-dd65-4946-9cee-28226db1d045', 'By nature, man hates change; seldom will he quit his old home till it has actually fallen around his ears.', '01928852-76b1-7b8b-b8c3-2a0fdd79fdee', '{change,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.549441', '2024-10-14 00:05:36.549441'),
('c9a3c340-3581-4066-be62-8d1a1f1abb07', 'Sweet is the memory of distant friends! Like the mellow rays of the departing sun, it falls tenderly, yet sadly, on the heart.', '01928852-7741-71a7-a9ec-760f631de7db', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:32.997088', '2024-10-14 00:05:32.997088'),
