('ca9a4040-1efc-4078-9f21-28645b8e363a', 'Do one thing every day that scares you.', '01928852-6c92-7a6b-a6bb-78c31b86df98', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.886617', '2024-10-14 00:05:29.886617'),
