('cadae834-0d3b-48c8-a351-26357d299355', 'The most important thing is transforming our minds, for a new way of thinking, a new outlook: we should strive to develop a new inner world.', '01928852-6b0b-786b-8dd4-995ae2eb3355', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.96076', '2024-10-14 00:05:29.96076'),
