('cb73ff28-2437-49a8-99d9-b9588b15b5a9', 'I don''t want to achieve immortality through my work... I want to achieve it through not dying.', '01928852-7790-79f7-8c8c-b0430a929515', '{film}', NULL, 't', 'f', '2024-10-14 00:05:30.494523', '2024-10-14 00:05:30.494523'),
('cb94dbe8-65c8-48fa-8cf2-c4dbba3a27eb', 'Be courteous to all, but intimate with few, and let those few be well tried before you give them your confidence.', '01928852-6d2a-7f6c-ac13-5797dd10ef25', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:33.722646', '2024-10-14 00:05:33.722646'),
