('cc8b31f4-a34a-4168-bf52-6f59b64a0a02', 'Russia is a riddle wrapped in a mystery inside an enigma.', '01928852-778a-7b63-b73f-e0042755dd2e', '{history,politics}', NULL, 't', 'f', '2024-10-14 00:05:25.230173', '2024-10-14 00:05:25.230173'),
('ccea54ea-96c6-4471-a0f7-828aed1ed3fb', 'If you live to be a hundred, I want to live to be a hundred minus one day, so I never have to live without you.', '01928852-67d6-77de-8db9-20873b3fce88', '{famous-quotes,love}', NULL, 't', 'f', '2024-10-14 00:05:35.664807', '2024-10-14 00:05:35.664807'),
('ccf3c2d5-71f2-41d1-9baa-835ba81c9c87', 'The greatest obstacle to discovery is not ignorance - it is the illusion of knowledge.', '01928852-6b1c-7361-a4b9-245a1444d238', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.609147', '2024-10-14 00:05:30.609147'),
('cd0b4184-cdab-42f9-8527-4bda76fa1aba', 'You do not become good by trying to be good, but by finding the goodness that is already within you.', '01928852-6c63-7d04-951f-6e0cd76fb527', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.585431', '2024-10-14 00:05:28.585431'),
('cd15f03a-49e1-449b-b2c4-3331b18df859', 'Almost everything comes from nothing.', '01928852-6e7a-783f-b5b8-e0e4ed07c39c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.397001', '2024-10-14 00:05:30.397001'),
('cd1c9af6-b0e5-4bcd-991b-ee23d2f356bd', 'Friendship marks a life even more deeply than love. Love risks degenerating into obsession, friendship is never anything but sharing.', '01928852-6c95-7766-a21c-dd14ceab75ae', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:32.327784', '2024-10-14 00:05:32.327784'),
('cd249f95-c968-44e1-89bb-e9d711f7a27c', 'You can tell whether a man is clever by his answers. You can tell whether a man is wise by his questions.', '01928852-7314-76e2-9d66-08509a7161da', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.926322', '2024-10-14 00:05:27.926322'),
('cd479c28-1665-465d-b4c4-cf1345487a0f', 'I am building a fire, and everyday I train, I add more fuel. At just the right moment, I light the match.', '01928852-72d4-769f-9739-d5d93b787e4d', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:05:24.946831', '2024-10-14 00:05:24.946831'),
