('cd702607-fdfd-47ed-b97a-375cb2c03ed3', 'The spirit, the will to win, and the will to excel, are the things that endure. These qualities are so much more important than the events that occur.', '01928852-770d-757d-8ad9-6eab16a7b24b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.132655', '2024-10-14 00:05:27.132655'),
('cd70e654-2233-4c60-a3c8-1d5462e3e97e', 'Imagination will often carry us to worlds that never were. But without it we go nowhere.', '01928852-6a6b-7352-9301-a8780c9ff6fe', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.80576', '2024-10-14 00:05:31.80576'),
('cda4e9e9-2324-4b7f-bcc7-f7d77173e63f', 'To give oneself earnestly to the duties due to men, and, while respecting spiritual beings, to keep aloof from them, may be called wisdom.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.533236', '2024-10-14 00:05:33.533236'),
('cdb0fda7-4ec9-4bd1-bb1f-b25923892874', 'To avoid criticism, do nothing, say nothing, be nothing.', '01928852-6c90-7231-913f-c43f8cd95fbc', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.746102', '2024-10-14 00:05:29.746102'),
('cdee3c5c-33d4-44b9-b76c-180b6a3d1fa4', 'Each day provides its own gifts.', '01928852-726f-73a3-874e-ff874af9432a', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.516961', '2024-10-14 00:05:37.516961'),
('cdfe8954-f1fc-453e-b9fc-cfc167a5a01c', 'I owe my solitude to other people.', '01928852-682f-7990-bde7-7116c7df0f5d', '{humorous}', NULL, 't', 'f', '2024-10-14 00:05:25.170334', '2024-10-14 00:05:25.170334'),
