('ce2d62df-a136-4bbf-9554-3ca44e6c0816', 'This is the final test of a gentleman: his respect for those who can be of no possible value to him.', '01928852-7773-7bc5-8834-a8bd1a779409', '{wisdom,life}', NULL, 't', 'f', '2024-10-14 00:05:37.441237', '2024-10-14 00:05:37.441237'),
('ce448b6a-1ced-4857-8701-9ac5f179e2b9', 'Silence is the true friend that never betrays.', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.613742', '2024-10-14 00:05:32.613742'),
('ce50ffeb-e640-4e85-bf7e-5d80de6ed06c', 'Friendship brings in a lot of honesty and trust into any relationship, especially a marriage.', '01928852-6cdb-763d-b136-cf560e6f656f', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:28.619258', '2024-10-14 00:05:28.619258'),
('ce5974f7-5564-4c72-b094-62cdd02f46bc', 'Do not be embarrassed by your mistakes. Nothing can teach us better than our understanding of them. This is one of the best ways of self-education.', '01928852-76b1-7b8b-b8c3-2a0fdd79fdee', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.648516', '2024-10-14 00:05:34.648516'),
