('cec1bb02-2131-47a5-9f98-5f5a63dab9bf', 'Respect should be earned by actions, and not acquired by years.', '01928852-6cf0-7cde-a1f9-8b42df10989c', '{wisdom,life}', NULL, 't', 'f', '2024-10-14 00:05:37.041533', '2024-10-14 00:05:37.041533'),
