('cfbd62f4-448f-4859-804f-d61ec015d0d4', 'You spend a good piece of your life gripping a baseball and in the end it turns out that it was the other way around all the time.', '01928852-6f4a-7141-83e3-7f3b5b9a9297', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.838335', '2024-10-14 00:04:43.838335'),
('cfc9e5f5-1fe6-44c8-a678-9fbddac15e49', 'When written in Chinese, the word ''crisis'' is composed of two characters. One represents danger and the other represents opportunity.', '01928852-7087-754b-baed-0b0afc98ab6a', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.587813', '2024-10-14 00:05:36.587813'),
('cff69b42-7601-43c9-a153-d359e0dfbb83', 'Lord, make me an instrument of thy peace. Where there is hatred, let me sow love.', '01928852-6ce7-7102-a8b4-b9d13dff2d7a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.642088', '2024-10-14 00:05:29.642088'),
