('d017b979-e88a-44e9-b46f-4d4d44f7823c', 'Don''t watch the clock; do what it does. Keep going.', '01928852-752a-7843-9378-6283b306c7de', '{motivational}', NULL, 't', 'f', '2024-10-14 00:04:43.833645', '2024-10-14 00:04:43.833645'),
('d03e41a5-a9f2-43c1-bf3e-89c927128cc2', 'Never do things others can do and will do, if there are things others cannot do or will not do.', '01928852-6877-76cd-8984-ae03c0038a41', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.744107', '2024-10-14 00:05:26.744107'),
('d05ad396-42aa-4137-931c-7119805d1274', 'Whoever is happy will make others happy, too.', '01928852-72a3-779c-ab93-ce6393452d73', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.350187', '2024-10-14 00:05:30.350187'),
('d072e44d-7d96-4fcc-888d-be8091608c88', 'A friend to all is a friend to none.', '01928852-68b3-7125-bd4b-b18bd987836b', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:29.283724', '2024-10-14 00:05:29.283724'),
('d08d298a-b240-48d5-b592-950d2b4a1df2', 'Dreams come true. Without that possibility, nature would not incite us to have them.', '01928852-70bf-7835-bced-d3171344c327', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.36049', '2024-10-14 00:05:27.36049'),
('d0e7ecfc-1f69-452e-8a52-e4751c1e87d6', 'Interestingly, according to modern astronomers, space is finite. This is a very comforting thought-- particularly for people who can never remember where they have left things.', '01928852-7790-79f7-8c8c-b0430a929515', '{film}', NULL, 't', 'f', '2024-10-14 00:05:36.330236', '2024-10-14 00:05:36.330236'),
('d0eee6da-6b89-40cd-8b0b-94458950a8c6', 'Conflict is the gadfly of thought. It stirs us to observation and memory. It instigates to invention. It shocks us out of sheeplike passivity, and sets us at noting and contriving.', '01928852-707f-7334-934e-3a6dd90deb03', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.31907', '2024-10-14 00:05:28.31907'),
('d10a1b34-12e5-4ec2-9c7d-ff02eb73903d', 'I would maintain that thanks are the highest form of thought, and that gratitude is happiness doubled by wonder.', '01928852-6d01-77cf-a898-8dbfebef9e89', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.631887', '2024-10-14 00:05:26.631887'),
