('d139b8a5-0c37-4cbb-9658-542a7b0660d3', 'Everything that exists is in a manner the seed of that which will be.', '01928852-726f-73a3-874e-ff874af9432a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.964601', '2024-10-14 00:05:36.964601'),
('d1424847-e844-43f3-8557-847913253e88', 'We must learn our limits. We are all something, but none of us are everything.', '01928852-6934-7c5a-a71f-65849702aff4', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.06258', '2024-10-14 00:05:37.06258'),
('d145a407-d52c-4a93-82cc-24a94b62c14e', 'I know not with what weapons World War III will be fought, but World War IV will be fought with sticks and stones.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{history,war}', NULL, 't', 'f', '2024-10-14 00:04:42.818405', '2024-10-14 00:04:42.818405'),
('d15d292c-998d-4081-91aa-a5b078f0b872', 'You can''t cross the sea merely by standing and staring at the water.', '01928852-74b3-733a-96bf-f69311a30ef7', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:31.665579', '2024-10-14 00:05:31.665579'),
('d15de381-a0e2-4ffa-85fd-b195924dbd3f', 'There is only one corner of the universe you can be certain of improving, and that''s your own self.', '01928852-683e-7661-9177-822acb04971e', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:32.476583', '2024-10-14 00:05:32.476583'),
