('d9518625-af8b-41b5-b516-ad55e4e94c74', 'I will give you a definition of a proud man: he is a man who has neither vanity nor wisdom one filled with hatreds cannot be vain, neither can he be wise.', '01928852-7090-70ef-8c91-67a66c54b3d7', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.239045', '2024-10-14 00:05:32.239045'),
('d9ee8e83-030d-4f8b-9099-daea464b15fe', 'All difficult things have their origin in that which is easy, and great things in that which is small.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.899214', '2024-10-14 00:05:35.899214'),
('d9f32b9b-6c34-4bc8-9bc1-c05676604864', 'Sir, my concern is not whether God is on our side; my greatest concern is to be on God''s side, for God is always right.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{spirituality,history}', NULL, 't', 'f', '2024-10-14 00:05:25.252672', '2024-10-14 00:05:25.252672'),
('da019eab-3489-4da2-98ac-87b3afc64d8c', 'True friendship is like sound health; the value of it is seldom known until it is lost.', '01928852-6ab3-7bf2-95e1-c33067dda6ef', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:36.961249', '2024-10-14 00:05:36.961249'),
('da31f012-0cf9-4abb-b524-59d34557978e', 'It is important to our friends to believe that we are unreservedly frank with them, and important to friendship that we are not.', '01928852-72e5-7551-b589-2cb86e8d3454', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:30.490311', '2024-10-14 00:05:30.490311'),
('da4dc08a-8e6b-440c-bd45-d66b514eca57', 'Mistakes are always forgivable, if one has the courage to admit them.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.41324', '2024-10-14 00:05:34.41324'),
('da8b3d34-bf7a-498c-b727-4e7457bc8f23', 'Time changes everything except something within us which is always surprised by change.', '01928852-76be-7f47-bff8-b5cdd058e427', '{change,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.927872', '2024-10-14 00:05:35.927872'),
('da8c268e-7820-4ecc-8cbf-ed0ef77f0063', 'Don''t look back. Something might be gaining on you.', '01928852-754a-773d-93e2-2286c02a237a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.158425', '2024-10-14 00:05:29.158425'),
('da9403c0-eb9e-4566-b70e-02863242becf', 'Great acts are made up of small deeds.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.463799', '2024-10-14 00:05:36.463799'),
('dab65e22-936b-4cf4-af28-da376bf2be9c', 'There surely is in human nature an inherent propensity to extract all the good out of all the evil.', '01928852-6910-70d0-817b-dd4f3560ad43', '{famous-quotes,wisdom,character}', NULL, 't', 'f', '2024-10-14 00:05:37.245799', '2024-10-14 00:05:37.245799'),
('dabc7637-43da-4a3a-ba4c-61ebd8930caa', 'Yesterday is history, tomorrow is a mystery, today is God''s gift, that''s why we call it the present.', '01928852-6f5d-7262-bf5a-1a2aeadcf026', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.913861', '2024-10-14 00:05:33.913861'),
('dac2bdfd-34ac-4693-87e7-536677dc9792', 'I can, therefore I am.', '01928852-7568-71c0-8bd7-012704be675f', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:31.081301', '2024-10-14 00:05:31.081301'),
('dae2a4d2-88ed-4687-84ce-fab8f7c0ef10', 'You cannot escape the responsibility of tomorrow by evading it today.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{history}', NULL, 't', 'f', '2024-10-14 00:05:25.262784', '2024-10-14 00:05:25.262784'),
('daf1c338-f63e-4578-a013-cece0b70685c', 'Most people get interested in stocks when everyone else is. The time to get interested is when no one else is. You can''t buy what is popular and do well.', '01928852-773b-7553-92eb-3fdb88846bc3', '{}', NULL, 't', 'f', '2024-10-14 00:04:42.892082', '2024-10-14 00:04:42.892082'),
('db019784-c2d4-40a5-9043-129fa3532dca', 'There is a magnet in your heart that will attract true friends. That magnet is unselfishness, thinking of others first; when you learn to live for others, they will live for you.', '01928852-735f-7b48-870e-71481be07090', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:26.043911', '2024-10-14 00:05:26.043911'),
('db03080f-4de3-44ae-aaee-c8d588516579', 'Be as you wish to seem.', '01928852-756a-7fd4-b16a-01ad0d140de2', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:31.474504', '2024-10-14 00:05:31.474504'),
('db1fd615-8690-4ac2-9da6-c33cbfb55929', 'Happiness is not in the mere possession of money; it lies in the joy of achievement, in the thrill of creative effort.', '01928852-6cf2-7719-89e2-fc251b33f18e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.025269', '2024-10-14 00:05:26.025269'),
('db2d21db-0f18-4a47-af0d-cb4c2e7feaab', 'I never think of the future. It comes soon enough.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{future,famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.967682', '2024-10-14 00:05:33.967682'),
('db455003-d67b-497d-99b8-944eff15b3bf', 'Twenty years from now you will be more disappointed by the things that you didn''t do than by the ones you did do.', '01928852-72a3-779c-ab93-ce6393452d73', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.956255', '2024-10-14 00:05:30.956255'),
('db92c57f-cc9e-4f30-a036-0db88f28deef', 'Success is not the key to happiness. Happiness is the key to success. If you love what you are doing, you will be successful.', '01928852-683a-71d6-b41c-d2b672f92792', '{famous-quotes,success,happiness}', NULL, 't', 'f', '2024-10-14 00:05:25.439123', '2024-10-14 00:05:25.439123'),
('dbafd27e-8a0d-4e45-9468-5f5545b5d2cd', 'Friendship is held to be the severest test of character. It is easy, we think, to be loyal to a family and clan, whose blood is in your own veins.', '01928852-6ac1-7a16-a688-bcccfc031c46', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:30.316217', '2024-10-14 00:05:30.316217'),
('dbb12d26-1dfe-4907-aeb2-125915c87226', 'We must become the change we want to see.', '01928852-7177-7e3a-83fb-11ff0731979c', '{change,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:33.808732', '2024-10-14 00:05:33.808732'),
('dbb626c3-d58a-4713-93ca-797dcb24304b', 'You should ignore that person’s impure behavior by way of speech and body, and focus on the fact that they get an openness and clarity of heart from time to time. That’s how to get rid of resentment for that person.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.522828', '2024-10-14 00:05:28.522828'),
('dbc4b90f-f706-473a-9642-97648d7c5a86', 'Never interrupt your enemy when he is making a mistake.', '01928852-7316-7b17-91e3-c117151f86ee', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.063133', '2024-10-14 00:05:26.063133'),
('dbf2141b-be63-4553-88ab-2f3d624c5dcd', 'A man may fulfil the object of his existence by asking a question he cannot answer and attempting a task he cannot achieve.', '01928852-7345-7ea2-9b0b-6bafb176a5dc', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.267379', '2024-10-14 00:05:35.267379'),
('dc1657d5-175e-48a2-821c-a97f5b936cb0', 'Life is a learning experience, only if you learn.', '01928852-7795-789b-a6fa-2f71177fa01c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.899057', '2024-10-14 00:05:32.899057'),
('dc3551b9-f1f0-401f-a82a-c11cc7735bf6', 'Gravitation cannot be held responsible for people falling in love. How on earth can you explain in terms of chemistry and physics so important a biological phenomenon as first love? Put your hand on a stove for a minute and it seems like an hour. Sit with that special girl for an hour and it seems like a minute. That''s relativity.', '01928852-6835-702b-82ef-f376a2bbb8fb', '{love,science}', NULL, 't', 'f', '2024-10-14 00:04:42.795378', '2024-10-14 00:04:42.795378'),
('dc7dc53c-7992-41be-82d8-9ed2b7c701ab', 'O, what a tangled web we weave when first we practice to deceive!', '01928852-7734-72d5-8213-d01ec6362a07', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:28.035775', '2024-10-14 00:05:28.035775'),
('dca1a600-6532-4298-958d-16afcb8cbcbd', 'Baseball is the only field of endeavor where a man can succeed three times out of ten and be considered a good performer.', '01928852-7688-7ae3-894e-22240948b067', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.663867', '2024-10-14 00:04:43.663867'),
('dd17b0c6-2fd2-4222-a941-42c0b3c922b2', 'Those who are blessed with the most talent don''t necessarily outperform everyone else. It''s the people with follow-through who excel.', '01928852-72b0-760f-b4c3-2d0b664b36ab', '{success}', NULL, 't', 'f', '2024-10-14 00:05:37.136034', '2024-10-14 00:05:37.136034'),
('dd1837a5-9b6a-42eb-a19a-0c8fc5e20d00', 'Every problem has a gift for you in its hands.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.323322', '2024-10-14 00:05:32.323322'),
('dd3f5f1f-e654-4f38-83a8-ef7287b01ef9', 'The person who makes a success of living is the one who see his goal steadily and aims for it unswervingly. That is dedication.', '01928852-6aab-7a46-b108-8dcf49c4b522', '{success}', NULL, 't', 'f', '2024-10-14 00:05:32.206947', '2024-10-14 00:05:32.206947'),
('dd4944da-a5d9-4ea6-afce-cbdd6bfb0bd4', 'The bird of paradise alights only upon the hand that does not grasp.', '01928852-706a-7922-94c4-601d079f1a65', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.257945', '2024-10-14 00:05:32.257945'),
('dda6c0ce-1169-42c6-86a6-07fa79abeca3', 'Marriage is the highest state of friendship. If happy, it lessens our cares by dividing them, at the same time that it doubles our pleasures by mutual participation.', '01928852-753d-7588-ba97-f473804d0686', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:30.423971', '2024-10-14 00:05:30.423971'),
('ddb8a444-54f6-4eb6-a298-c53240da9d79', 'Mistakes are the usual bridge between inexperience and wisdom.', '01928852-748c-7927-b5c6-6569fe035193', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.793091', '2024-10-14 00:05:25.793091'),
('ddc7c7fc-6939-49c2-8e4f-922358b706cb', 'Blessed are the hearts that can bend; they shall never be broken.', '01928852-6833-7961-9730-7b88ca9964db', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.613256', '2024-10-14 00:05:26.613256'),
('ddec5d9d-4e8d-4585-9b45-c815aec07bc3', 'And I love that even in the toughest moments, when we''re all sweating it - when we''re worried that the bill won''t pass, and it seems like all is lost - Barack never lets himself get distracted by the chatter and the noise. Just like his grandmother, he just keeps getting up and moving forward... with patience and wisdom, and courage and grace.', '01928852-72e2-701e-aa17-185b3cfa565f', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.248123', '2024-10-14 00:05:35.248123'),
('ddf87db8-0005-4a43-9b98-0a131613de29', 'Never complain and never explain.', '01928852-690b-77b8-bda5-e8dc48fd4fa9', '{motivational}', NULL, 't', 'f', '2024-10-14 00:04:43.842292', '2024-10-14 00:04:43.842292'),
('de09f761-40d8-4bf7-86e3-fd75e728f0e6', 'Happiness is a perfume you cannot pour on others without getting a few drops on yourself.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.864247', '2024-10-14 00:05:30.864247'),
('de0a7f7e-fbdb-4600-a91b-ea934cdc3d37', 'Take things as they are. Punch when you have to punch. Kick when you have to kick.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.907529', '2024-10-14 00:05:28.907529'),
('de1f003c-2a80-4ef9-b4c7-2cb02b8c87d7', 'Think as a wise man but communicate in the language of the people.', '01928852-775d-7a6a-a8c4-cc4f53e2c937', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.799113', '2024-10-14 00:05:33.799113'),
('de32cd0a-c389-4c2e-853b-bf4d990c5ed5', 'If a man watches three football games in a row, he should be declared legally dead.', '01928852-6cc1-7520-89da-e4433b81ec79', '{sports,humorous}', NULL, 't', 'f', '2024-10-14 00:04:43.692138', '2024-10-14 00:04:43.692138'),
('de361779-45f1-4502-abdc-567090a34617', 'Trying to sneak a fastball past Hank Aaron is like trying to sneak the sunrise past a rooster.', '01928852-6f5f-7fb4-9eb9-14c996bff081', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.688296', '2024-10-14 00:04:43.688296'),
('de3f4054-7c1e-4a4b-ab6c-c806fca0dcaa', 'If you don''t like something, change it. If you can''t change it, change your attitude.', '01928852-72ca-75e2-aec8-113f1d70cda9', '{change,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.035774', '2024-10-14 00:05:35.035774'),
('de630730-44dc-435a-b967-a1a7eb09e3f6', 'You''re never a loser until you quit trying.', '01928852-72eb-720d-91eb-b1938f2d6908', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.48788', '2024-10-14 00:05:28.48788'),
('de6a103f-9b19-4e22-bffc-fe84a7bcca49', 'Chance is always powerful. Let your hook be always cast; in the pool where you least expect it, there will be a fish.', '01928852-7352-701e-936e-f953a1185478', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.505575', '2024-10-14 00:05:34.505575'),
('de785e7a-e9fc-441f-80a3-7a6ee595bcbc', 'Something opens our wings. Something makes boredom and hurt disappear. Someone fills the cup in front of us: We taste only sacredness.', '01928852-751e-7ba4-bbc6-9f9044390793', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.82544', '2024-10-14 00:05:35.82544'),
('de86cbec-8cde-4b55-9782-d5c8af12dd46', 'Silence is a source of great strength.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.887682', '2024-10-14 00:05:35.887682'),
('de905568-8a9e-44a1-9a07-5d788fd4efa1', 'Be not afraid of greatness: some are born great, some achieve greatness, and some have greatness thrust upon them.', '01928852-777a-762d-9378-c5e7bfe93c82', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.654592', '2024-10-14 00:05:28.654592'),
('de94c268-af66-4813-8af7-da3f71bdba4f', 'Being in humaneness is good. If we select other goodness and thus are far apart from humaneness, how can we be the wise?', '01928852-6afd-7a6d-afe8-97c1d829e59d', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.222556', '2024-10-14 00:05:29.222556'),
('df129ff4-5a40-4264-834a-02d1d41a832a', 'Some of the best lessons we ever learn are learned from past mistakes. The error of the past is the wisdom and success of the future.', '01928852-6b13-7b7e-ab14-d5e74c05173f', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:37.54259', '2024-10-14 00:05:37.54259'),
('df86cb85-c2f3-4859-974e-0da1798ec8ee', 'You are the only person on earth who can use your ability.', '01928852-782c-7b27-b787-284e61240cd3', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.479911', '2024-10-14 00:05:30.479911'),
('dfd9d26c-c805-4d23-8303-42b3ddf92690', 'A ruffled mind makes a restless pillow.', '01928852-6ad7-77c9-8281-ba36b34928e9', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.697492', '2024-10-14 00:05:27.697492'),
('dfe06cc1-c6b9-444c-a829-12d27e150fc4', 'The journey of a thousand miles begins with one step.', '01928852-7123-7698-bcd8-ce7b8878a322', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.411859', '2024-10-14 00:05:30.411859'),
('dfe9b92d-a7c7-42db-a11c-e54f73fc7579', 'The real problem is not whether machines think but whether men do.', '01928852-68ed-7feb-ac46-e1ef65b0f432', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:36.153261', '2024-10-14 00:05:36.153261'),
('e05deee2-b497-49df-a493-6da2d83c3159', 'Wisdom is a kind of knowledge. It is knowledge of the nature, career, and consequences of human values.', '01928852-7559-78c8-94dc-cc813e6fb59c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.286977', '2024-10-14 00:05:32.286977'),
('e07c25aa-e058-4502-95d4-749b39d62904', 'I can''t change the direction of the wind, but I can adjust my sails to always reach my destination.', '01928852-6f57-7aec-be89-5580b252dae7', '{famous-quotes,life}', NULL, 't', 'f', '2024-10-14 00:05:31.616026', '2024-10-14 00:05:31.616026'),
('e0b4a60b-f87c-4361-b81f-d415dbe403e9', 'Peace is not something you wish for. It''s something you make, something you do, something you are, and something you give away.', '01928852-74f2-77a1-8e56-9ffe430ad337', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.325366', '2024-10-14 00:05:36.325366'),
('e0ef3d1c-d3a4-473f-ae49-f2fc725b3543', 'There is no expedient to which a man will not go to avoid the labor of thinking.', '01928852-76b7-746d-ac06-f2d9547d384b', '{work}', NULL, 't', 'f', '2024-10-14 00:04:42.48151', '2024-10-14 00:04:42.48151'),
('e1425f75-9b48-41b3-bbe5-cdd295eef2d8', 'Democracy''s premise rests on the notion that the collective wisdom of the majority will prove right more often than it''s wrong; that given sufficient opportunity in the pursuit of happiness, your population will develop its talents, its intellect, its better judgment; that over time its capacity for discernment and self-correction will be enlarged.', '01928852-6903-7aed-b16c-8d96eb134e92', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.545205', '2024-10-14 00:05:34.545205'),
('e145f67b-4523-433b-8d89-1cd2dfb99a8e', 'Nothing is at last sacred but the integrity of your own mind.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.947408', '2024-10-14 00:05:34.947408'),
('e152d9e6-67ea-4f9c-86ab-e3a88780bb83', 'The free man is he who does not fear to go to the end of his thought.', '01928852-7145-7386-a1dd-5a84ec119453', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.5054', '2024-10-14 00:05:32.5054'),
('e15d16c2-2e72-46f2-8f9d-57cd6b3b56b9', 'Always be yourself, express yourself, have faith in yourself, do not go out and look for a successful personality and duplicate it.', '01928852-6a55-7611-9a1b-cebbe58a585a', '{famous-quotes,success}', NULL, 't', 'f', '2024-10-14 00:05:27.414234', '2024-10-14 00:05:27.414234'),
('e1c6e790-da63-4eb5-a3a0-8fca76c0e861', 'This is the whole point of technology. It creates an appetite for immortality on the one hand. It threatens universal extinction on the other. Technology is lust removed from nature.', '01928852-6b46-709e-a37d-13119f1f1454', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:33.223393', '2024-10-14 00:05:33.223393'),
