('e2c18e3d-03bc-4949-b3d0-819f5490db48', 'Things are as they are. Looking out into it the universe at night, we make no comparisons between right and wrong stars, nor between well and badly arranged constellations.', '01928852-682f-7990-bde7-7116c7df0f5d', '{philosophy,self}', NULL, 't', 'f', '2024-10-14 00:05:25.285061', '2024-10-14 00:05:25.285061'),
