('e53bd5a2-19e3-418d-9438-e2222beb5a57', 'If you don''t go after what you want, you''ll never have it. If you don''t ask, the answer is always no. If you don''t step forward, you''re always in the same place.', '01928852-7331-7236-af51-90c26c43bb81', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.513935', '2024-10-14 00:05:32.513935'),
