('e5c2bf13-bce4-4976-92f9-b4e41c661a9d', 'Judge nothing, you will be happy. Forgive everything, you will be happier. Love everything, you will be happiest.', '01928852-7576-7a30-8888-1c33f110ca5a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.440828', '2024-10-14 00:05:32.440828'),
('e5c92416-fdb2-4d93-8fbd-cb61a4587650', 'Do not scorn what you have received, nor envy the gains of others. He who envies others does not obtain peace of mind.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.383964', '2024-10-14 00:05:27.383964'),
