('e7010f4c-1e77-4cd9-836f-29d65cea9fed', 'History will be kind to me for I intend to write it.', '01928852-778a-7b63-b73f-e0042755dd2e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.177692', '2024-10-14 00:05:32.177692'),
