('e76809a6-16aa-4e22-9f24-9ee746db5e90', 'Friendship is the marriage of the soul, and this marriage is liable to divorce.', '01928852-7717-7b5c-9459-cf2d84700998', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:31.632885', '2024-10-14 00:05:31.632885'),
('e77b59b9-187c-4bb8-a2fa-d203c12400e5', 'Things that were hard to bear are sweet to remember.', '01928852-754f-749d-9583-b870cbe8d40c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:37.02659', '2024-10-14 00:05:37.02659'),
('e7844eb5-cc15-4be1-8129-e50e3dfb49a8', 'People usually compare the computer to the head of the human being. I would say that hardware is the bone of the head, the skull. The semiconductor is the brain within the head. The software is the wisdom. And data is the knowledge.', '01928852-72b8-7e15-98f5-ecae4a954497', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:36.363614', '2024-10-14 00:05:36.363614'),
('e7dbe3b0-23ea-4ba3-b318-8778ef49c4cc', 'I know that inner wisdom is more precious than wealth. The more you spend it, the more you gain.', '01928852-734a-7d5e-9d80-a55b35905931', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.531169', '2024-10-14 00:05:35.531169'),
('e7e4749f-aa8e-4297-8ac6-92deaadc1580', 'What other people may find in poetry or art museums, I find in the flight of a good drive.', '01928852-68b9-796c-baaa-b73fa456886f', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.643479', '2024-10-14 00:04:43.643479'),
