('e89ae420-54be-462f-96ee-5c35d41c15ca', 'This world, after all our science and sciences, is still a miracle; wonderful, inscrutable, magical and more, to whosoever will think of it.', '01928852-76b1-7b8b-b8c3-2a0fdd79fdee', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.596128', '2024-10-14 00:05:32.596128'),
('e8a2617f-99c3-4067-9c32-8ef9826a3e97', 'He can who thinks he can, and he can''t who thinks he can''t. This is an inexorable, indisputable law.', '01928852-735d-7e92-b053-51055d8d43dc', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.203198', '2024-10-14 00:05:31.203198'),
