('ea251e6c-0dc5-4798-a082-5e9c7fc68102', 'Opportunity is missed by most people because it is dressed in overalls and looks like work.', '01928852-76b7-746d-ac06-f2d9547d384b', '{opportunity,work}', NULL, 't', 'f', '2024-10-14 00:04:42.623361', '2024-10-14 00:04:42.623361'),
('ea29353d-1277-40a9-8c8f-2ecea35b43fa', 'When I do good I feel good, when I do bad I feel bad, and that''s my religion.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{wisdom,character}', NULL, 't', 'f', '2024-10-14 00:05:25.108466', '2024-10-14 00:05:25.108466'),
