('f3c7c1c2-054b-4ae2-8b51-9495b2841eb7', 'The philosophy of the school room in one generation will be the philosophy of government in the next.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{history,politics}', NULL, 't', 'f', '2024-10-14 00:05:25.012299', '2024-10-14 00:05:25.012299'),
('f41c0c8a-b7d0-4975-ad74-09cb17acb345', 'Well begun is half done.', '01928852-68b3-7125-bd4b-b18bd987836b', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.461019', '2024-10-14 00:05:27.461019'),
('f462dfb6-6d25-43a2-80da-a09ed087d091', 'A house divided against itself cannot stand.', '01928852-67f6-7de7-afc8-c88a404f2cf1', '{famous-quotes,history,politics}', NULL, 't', 'f', '2024-10-14 00:05:28.508315', '2024-10-14 00:05:28.508315'),
('f4a1a5ea-da11-41a8-a67c-5f7503e69791', 'I have learned that to be with those I like is enough.', '01928852-7727-7162-a773-88f7f275d014', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:35.764959', '2024-10-14 00:05:35.764959'),
('f4d62471-264d-4208-9d91-be711d0094cf', 'Every person, all the events of your life are there because you have drawn them there. What you choose to do with them is up to you.', '01928852-74da-71ea-85c5-2626040df0be', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.815558', '2024-10-14 00:05:27.815558'),
('f4f5e9e0-a7ed-4ecb-8f13-00d60f993626', 'It is common sense to take a method and try it. If it fails, admit it frankly and try another. But above all, try something.', '01928852-6cf2-7719-89e2-fc251b33f18e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.730872', '2024-10-14 00:05:31.730872'),
('f51e8d3e-8885-491c-88da-7a051a537a74', 'A passion for politics stems usually from an insatiable need, either for power, or for friendship and adulation, or a combination of both.', '01928852-6cdd-7a89-8ae3-51aecc7a50eb', '{friendship,politics}', NULL, 't', 'f', '2024-10-14 00:05:34.272521', '2024-10-14 00:05:34.272521'),
('f5575295-444e-427a-b400-2abf2e0c3570', 'Friendship is but another name for an alliance with the follies and the misfortunes of others. Our own share of miseries is sufficient: why enter then as volunteers into those of another?', '01928852-76c9-7011-8399-cc2c7c075bec', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:32.372001', '2024-10-14 00:05:32.372001'),
('f580f10f-2e66-4d14-98a0-be510769d544', 'Do not wait for leaders; do it alone, person to person.', '01928852-7309-7867-bcdd-764791e3c9b8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.374023', '2024-10-14 00:05:30.374023'),
('f59a59a2-a33a-4ff9-a377-302082c136a3', 'The fact is, with every friendship you make, and every bond of trust you establish, you are shaping the image of America projected to the rest of the world. That is so important. So when you study abroad, you''re actually helping to make America stronger.', '01928852-72e2-701e-aa17-185b3cfa565f', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:27.704869', '2024-10-14 00:05:27.704869'),
('f5b221b7-0d08-4525-ba15-9ce83ae71f9c', 'A leader is one who knows the way, goes the way, and shows the way.', '01928852-7076-7cad-8bfc-b825086639d6', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.632557', '2024-10-14 00:05:28.632557'),
('f5b65350-ffd7-4aaa-bb04-b72eeaa900d0', 'I decided that it was not wisdom that enabled poets to write their poetry, but a kind of instinct or inspiration, such as you find in seers and prophets who deliver all their sublime messages without knowing in the least what they mean.', '01928852-6ee7-73ce-9b5f-b721184f9ba2', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:32.565979', '2024-10-14 00:05:32.565979'),
('f5d1c420-be4a-4b11-b26a-032cdab9509e', 'Every artist dips his brush in his own soul, and paints his own nature into his pictures.', '01928852-6ea0-7b1d-8d68-5ab8428d717c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.874128', '2024-10-14 00:05:27.874128'),
('f5ebac5f-c50d-4bba-b0c6-64415f75a570', 'We should not judge people by their peak of excellence; but by the distance they have traveled from the point where they started.', '01928852-6ea0-7b1d-8d68-5ab8428d717c', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:34.958323', '2024-10-14 00:05:34.958323'),
('f61ae464-2383-42ff-9e87-d403bd7fbde5', 'The saddest aspect of life right now is that science gathers knowledge faster than society gathers wisdom.', '01928852-6ee3-706c-8d22-e64176516efa', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.996476', '2024-10-14 00:05:30.996476'),
('f67ba460-c3e9-4cef-ac3d-f88d016b3872', 'Know what''s important and what isn''t. Have the wisdom to know the right thing to do, the integrity to do it, the character to stand up to those who don''t, and the courage to stop those who won''t.', '01928852-72a0-7d51-ae43-270a949a8a24', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:30.606161', '2024-10-14 00:05:30.606161'),
('f6b9a29f-0054-4844-9fa4-fbe43f7baac0', 'Do not follow where the path may lead. Go, instead, where there is no path and leave a trail.', '01928852-74c3-7e12-8d93-0c5a55ee071c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.65525', '2024-10-14 00:05:26.65525'),
('f6be7311-7736-4816-b053-b0501785bd96', 'We should not give up and we should not allow the problem to defeat us.', '01928852-67d9-78aa-b219-4e52d4e543d0', '{inspirational}', NULL, 't', 'f', '2024-10-14 00:05:27.465168', '2024-10-14 00:05:27.465168'),
('f6d2f7b8-42e7-48b6-963a-f9fe7dc67a13', 'TV and the Internet are good because they keep stupid people from spending too much time out in public.', '01928852-6b61-7bf4-b011-cc0150e2fe6d', '{technology}', NULL, 't', 'f', '2024-10-14 00:05:28.38068', '2024-10-14 00:05:28.38068'),
('f6d559ed-4508-4390-9f74-44f6460a9652', 'Let go of your attachment to being right, and suddenly your mind is more open. You''re able to benefit from the unique viewpoints of others, without being crippled by your own judgement.', '01928852-74c0-7134-89e3-46eec15b0885', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:34.541099', '2024-10-14 00:05:34.541099'),
('f6dcd423-313a-459a-b956-bc5c5b7b1f35', 'Friends are the siblings God never gave us.', '01928852-72d1-7d7b-a65a-ec391ef54505', '{friendship}', NULL, 't', 'f', '2024-10-14 00:05:26.670755', '2024-10-14 00:05:26.670755'),
('f71da81a-368e-43ad-b64f-ded54bcf5fa2', 'The pessimist complains about the wind; the optimist expects it to change; the realist adjusts the sails.', '01928852-7754-7ec1-967c-e752177f3b43', '{famous-quotes,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.582842', '2024-10-14 00:05:35.582842'),
('f72b2379-115c-4a2c-8803-c00735305031', 'We must overcome the notion that we must be regular. It robs you of the chance to be extraordinary and leads you to the mediocre.', '01928852-76f8-74f8-aefd-eb9305159039', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.75789', '2024-10-14 00:05:33.75789'),
('f7393afd-a346-4c6d-8945-fc2236957e56', 'The price of greatness is responsibility.', '01928852-778a-7b63-b73f-e0042755dd2e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.635985', '2024-10-14 00:05:35.635985'),
('f76d2e9f-633c-4604-a33b-07d8032d1080', 'If you have a harem of 40 women, you never get to know any of them very well.', '01928852-773b-7553-92eb-3fdb88846bc3', '{}', NULL, 't', 'f', '2024-10-14 00:04:42.861482', '2024-10-14 00:04:42.861482'),
('f7862684-7017-4001-a8a9-6b9e7822f3f7', 'The grand essentials of happiness are: something to do, something to love, and something to hope for.', '01928852-6848-7f5e-bd62-4c31a4d85a1c', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.062829', '2024-10-14 00:05:35.062829'),
('f79184dc-82a7-4607-a23e-d42d7b8b8d1f', 'Impossibilities are merely things which we have not yet learned.', '01928852-6ad5-7102-8e99-85129a30bb05', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.404121', '2024-10-14 00:05:28.404121'),
('f796c075-44b5-4d9c-9a8e-6c5cbbd7170a', 'If you surrender to the wind, you can ride it.', '01928852-76e8-7cd0-97c9-74552eb7d820', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.785567', '2024-10-14 00:05:26.785567'),
('f7b4e223-4e37-47a8-991e-5fe9dbf71b60', 'When you doubt your power, you give power to your doubt.', '01928852-6ec0-7f9d-bb11-ad943ec08fae', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.34598', '2024-10-14 00:05:29.34598'),
('f7e46d5e-89fe-4a18-90d2-68732c56b1de', 'Character cannot be developed in ease and quiet. Only through experience of trial and suffering can the soul be strengthened, vision cleared, ambition inspired, and success achieved.', '01928852-6e68-7e82-b1a6-7a4567140254', '{character}', NULL, 't', 'f', '2024-10-14 00:05:37.148684', '2024-10-14 00:05:37.148684'),
('f80724c7-4cb1-47df-ba50-c0cefd1d7907', 'Just be patient. Let the game come to you. Don''t rush. Be quick, but don''t hurry.', '01928852-6b71-793d-ba6f-b9f998fc104f', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.581923', '2024-10-14 00:04:43.581923'),
('f815e0fb-31af-4437-b189-6fe898d7b962', 'Wisdom is the reward you get for a lifetime of listening when you''d have preferred to talk.', '01928852-6b5c-7ae6-9b69-e6ae24231f62', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.885203', '2024-10-14 00:05:33.885203'),
('f820b07d-4702-4359-a124-2c436fbf96d6', 'I''m astounded by people who want to ''know'' the universe when it''s hard enough to find your way around Chinatown.', '01928852-7790-79f7-8c8c-b0430a929515', '{film}', NULL, 't', 'f', '2024-10-14 00:05:33.204632', '2024-10-14 00:05:33.204632'),
('f82f9059-16bf-49b1-bbe0-942484965b20', 'Men of perverse opinion do not know the excellence of what is in their hands, till someone dash it from them.', '01928852-7571-7f1c-90a4-db4bf8cb4038', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:30.36381', '2024-10-14 00:05:30.36381'),
('f83f62f6-0ea0-46fb-97a6-bfbcf9661882', 'Always be smarter than the people who hire you.', '01928852-713b-761a-8358-f95bf87b5fc3', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.902653', '2024-10-14 00:05:35.902653'),
('f857b10e-8b81-4e67-9f2d-743a5de52e6d', 'The truth is not for all men, but only for those who seek it.', '01928852-68ea-78a9-92af-cc65070707c9', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.699556', '2024-10-14 00:05:26.699556'),
('f8a26144-4104-435e-89c5-3ed6e2fd7b2b', 'Kind words can be short and easy to speak, but their echoes are truly endless.', '01928852-7309-7867-bcdd-764791e3c9b8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.312768', '2024-10-14 00:05:29.312768'),
('f8ae7dee-1442-4a2d-a2f1-ce07f8c4e9a7', 'In the sky there are no tracks. Outside there is no recluse. There are no conditioned things that are eternal. There is no instability in the Buddhas.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:27.145725', '2024-10-14 00:05:27.145725'),
('f8c5007f-273e-4844-97c7-d35fb4a81c26', 'By accepting yourself and being fully what you are, your presence can make others happy.', '01928852-6f19-70ed-8d76-6c441daa2031', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.864481', '2024-10-14 00:05:32.864481');
INSERT INTO "public"."quotes" ("id", "content", "author_id", "categories_slug", "bible_reference", "active", "verified", "created_at", "updated_at") VALUES
('f8d00ad0-9f00-453b-99ec-a32b6767ca9d', 'Trouble is only opportunity in work clothes.', '01928852-6e87-7deb-a8da-09269722f258', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.838754', '2024-10-14 00:05:36.838754'),
('f8d83542-bf07-4749-bdcf-4faa5aae578e', 'There is nothing permanent except change.', '01928852-6ea6-787f-808f-450f3289eb96', '{change,wisdom}', NULL, 't', 'f', '2024-10-14 00:05:35.194682', '2024-10-14 00:05:35.194682'),
('f8ebfa00-9265-4bff-baa1-add029edb605', 'To be beautiful means to be yourself. You don''t need to be accepted by others. You need to accept yourself.', '01928852-76a2-7c33-a980-dc54938dc8d2', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.503396', '2024-10-14 00:05:28.503396'),
('f8ee8278-ca4f-44f6-9d3a-91c1e1d128ff', 'One should not hurt others if one loves oneself.', '01928852-7690-7893-a0fd-622a0846e879', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.907869', '2024-10-14 00:05:25.907869'),
('f8f6da7f-b0ec-470d-939b-9eb7df01bca5', 'Maxim for life: You get treated in life the way you teach people to treat you.', '01928852-7744-71bf-9a7d-d848a44374a8', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:31.786228', '2024-10-14 00:05:31.786228'),
('f8fc6ae8-7d57-48e1-94d3-fd557015965e', 'As we express our gratitude, we must never forget that the highest appreciation is not to utter words, but to live by them.', '01928852-7087-754b-baed-0b0afc98ab6a', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:26.757278', '2024-10-14 00:05:26.757278'),
('f90473a8-6c37-44e7-b2e4-6fdb2f1345da', 'When in doubt, tell the truth.', '01928852-72a3-779c-ab93-ce6393452d73', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.552909', '2024-10-14 00:05:32.552909'),
('f93067dc-2bae-4149-a72f-3db9b9af2338', 'Life is what happens to you while you''re busy making other plans.', '01928852-7097-7de5-9e9c-16622e459f7d', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.285913', '2024-10-14 00:05:28.285913'),
('f93a3d06-d4b0-445c-90c5-15eab0e44f3f', 'From wonder into wonder existence opens.', '01928852-7123-7698-bcd8-ce7b8878a322', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:29.957209', '2024-10-14 00:05:29.957209'),
('f93f65df-05c7-4b81-b9a5-49887de88c95', 'To me, it doesn''t matter how good you are. Sport is all about playing and competing. Whatever you do in cricket and in sport, enjoy it, be positive and try to win.', '01928852-6ed5-7fff-a136-8bf1a0547540', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.755788', '2024-10-14 00:04:43.755788'),
('f98b8dc8-43bb-47bf-b9e2-f3a817ec40c5', 'The most formidable weapon against errors of every kind is reason.', '01928852-76cb-76ce-9a7b-76983016bbf0', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:37.022778', '2024-10-14 00:05:37.022778'),
('f9a6ce4e-4190-4aea-9737-8b73d541162c', 'One secret of success in life is for a man to be ready for his opportunity when it comes.', '01928852-690b-77b8-bda5-e8dc48fd4fa9', '{success}', NULL, 't', 'f', '2024-10-14 00:05:31.212422', '2024-10-14 00:05:31.212422'),
('fa0b8f52-98cd-447f-8b35-4b16ab42fa67', 'To accomplish great things, we must not only act, but also dream; not only plan, but also believe.', '01928852-6884-77ad-a225-b2401731958d', '{famous-quotes,inspirational}', NULL, 't', 'f', '2024-10-14 00:05:35.083454', '2024-10-14 00:05:35.083454'),
('fa27c682-8f80-453b-8fe0-c511b9dfdc6b', 'Successful people ask better questions, and as a result, they get better answers.', '01928852-76ed-7661-a537-c3978973ac97', '{famous-quotes,success}', NULL, 't', 'f', '2024-10-14 00:05:31.500491', '2024-10-14 00:05:31.500491'),
('fa3fc95d-ef4e-4a3b-a6a8-a64992686347', 'Wisdom ceases to be wisdom when it becomes too proud to weep, too grave to laugh, and too selfish to seek other than itself.', '01928852-7107-7406-9ddd-aa4185419e20', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.757191', '2024-10-14 00:05:25.757191'),
('fa5a47e5-6af8-421c-9fbe-9e40e19f73d3', 'We never live; we are always in the expectation of living.', '01928852-7717-7b5c-9459-cf2d84700998', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:35.551524', '2024-10-14 00:05:35.551524'),
('fa64882c-6564-406e-95e6-da4c4d38143a', 'No bird soars too high if he soars with his own wings.', '01928852-7757-7e9f-b5fa-113e06dad56c', '{motivational}', NULL, 't', 'f', '2024-10-14 00:04:43.478943', '2024-10-14 00:04:43.478943'),
('fa7c6bf6-c458-4b85-9ef8-01657d603464', 'Lose an hour in the morning, and you will spend all day looking for it.', '01928852-74e6-7dc5-a0f9-816100b10820', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:33.990508', '2024-10-14 00:05:33.990508'),
('fac7b0b7-267d-4021-9079-0bd1ed81f886', 'Our lives are the only meaningful expression of what we believe and in Whom we believe. And the only real wealth, for any of us, lies in our faith.', '01928852-6d39-78da-90ff-f8e6c1b97402', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.326223', '2024-10-14 00:05:27.326223'),
('fae5402f-4559-446d-a830-3ba46c027ff9', 'Iron rusts from disuse; water loses its purity from stagnation... even so does inaction sap the vigor of the mind.', '01928852-714a-78f9-b601-986148cb4b27', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:27.332192', '2024-10-14 00:05:27.332192'),
('fb093e92-4707-4cb1-afe8-a27db36bfd82', 'The greatest minds are capable of the greatest vices as well as of the greatest virtues.', '01928852-74d7-75f4-8e0a-4aa4c05223c6', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:29.709414', '2024-10-14 00:05:29.709414'),
('fb0fd82c-6378-47a3-b1b1-fc79a214e2ef', 'Our character is what we do when we think no one is looking.', '01928852-6d46-73b0-bbb7-a1be0a360df5', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:25.71342', '2024-10-14 00:05:25.71342'),
('fb334328-1020-4007-86ae-c7be5eac2966', 'No man is free who is not master of himself.', '01928852-6cb6-7e88-84e6-88b53db6a61e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:32.337249', '2024-10-14 00:05:32.337249'),
('fb4ac6c1-b331-4e38-a850-826427b6ec06', 'Football is football and talent is talent. But the mindset of your team makes all the difference.', '01928852-74f8-78ab-9442-f435305aff22', '{sports,competition}', NULL, 't', 'f', '2024-10-14 00:04:43.828652', '2024-10-14 00:04:43.828652'),
('fb8cb690-6d5e-4fe4-b425-32e0cf3354a7', 'Not engaging in ignorance is wisdom.', '01928852-6a39-7d74-bc5a-cfcddfb4600b', '{wisdom}', NULL, 't', 'f', '2024-10-14 00:05:26.117396', '2024-10-14 00:05:26.117396'),
('fbdacb83-c1f0-4db7-8c6b-8575c4e3c8ca', 'There are two kinds of failures: those who thought and never did, and those who did and never thought.', '01928852-7132-7a51-bb1a-7e40abf407fd', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:36.424189', '2024-10-14 00:05:36.424189'),
('fbdea7fe-27cd-40de-856e-72f07acb5ba2', 'Keep silence for the most part, and speak only when you must, and then briefly.', '01928852-6cb6-7e88-84e6-88b53db6a61e', '{famous-quotes}', NULL, 't', 'f', '2024-10-14 00:05:28.666787', '2024-10-14 00:05:28.666787'),
